(3, 'Đánh giá review Myprotein Micellar Casein 2.5 kg', 'danh-gia-review-myprotein-micellar-casein-25-kg', 1, 1, 1, 0, 'Review sản phẩm', '2020-05-08__896-catalog-anh-gia-review-myprotein-micellar-casein-2-5-kg-main-1587725835.jpg', '<p><strong>Casein&nbsp;</strong>l&agrave; một dạng Protein hấp thụ chậm, hỗ trợ phục hồi cơ bắp v&agrave;o ban đ&ecirc;m v&agrave; bổ sung protein khi cơ thể kh&ocirc;ng được bổ sung protein li&ecirc;n tục trong ng&agrave;y. Micellar Casein của Myprotein l&agrave; một sản phẩm bổ sung nguồn casein tốt nhất hiện nay. Sau đ&acirc;y sẽ l&agrave; một số&nbsp;<strong>đ&aacute;nh gi&aacute; Myprotein Casein</strong>&nbsp;để mọi người hiểu r&otilde; hơn về sản phẩm.</p>\r\n\r\n<p><strong>Myprotein Casein &ndash; Hỗ trợ tăng cơ ban đ&ecirc;m tốt nhất</strong></p>\r\n\r\n<p>Đa số người tập thể h&igrave;nh thường chỉ biết đến loại Whey hấp thụ nhanh l&agrave;&nbsp;<a href=\"https://www.wheystore.vn/c152/whey-protein-tang-co\"><strong>Whey Protein</strong></a>&nbsp;bổ sung ngay sau tập, m&agrave; &iacute;t nghe đến&nbsp;<strong>Casein Protein</strong>. Đ&oacute; l&agrave; một dạng proten hấp thu chậm, chiếm 80% trong sữa.</p>\r\n\r\n<p>Myprotein Micellar Casein l&agrave; sản phẩm l&yacute; tưởng d&agrave;nh cho bất kỳ ai khi tham gia tập luyện thường xuy&ecirc;n, bổ sung đầy đủ Protein trong chế độ ăn uống để phục vụ cho sự phục hồi v&agrave; ph&aacute;t triển của cơ bắp.</p>\r\n\r\n<p>Đồng thời, đ&acirc;y cũng l&agrave; một sản phẩm bổ sung tuyệt vời để gi&uacute;p tăng lượng protein h&agrave;ng ng&agrave;y v&agrave; gi&uacute;p cho mọi người c&oacute; thể y&ecirc;n t&acirc;m đi nhiều giờ m&agrave; kh&ocirc;ng cần ăn để bổ sung protein li&ecirc;n tục.</p>\r\n\r\n<p><strong>Micellar Casein&nbsp;</strong>l&agrave; một protein giải ph&oacute;ng chậm c&oacute; nguồn gốc từ sữa. Kh&ocirc;ng giống như Whey Protein, được cơ thể hấp thụ v&agrave; sử dụng rất nhanh, casein được dạ d&agrave;y hấp thụ chậm cho ph&eacute;p cung cấp axit amin cho cơ bắp trong một thời gian d&agrave;i. Điều n&agrave;y l&agrave;m cho Micellar Casein trở th&agrave;nh chất bổ sung protein l&yacute; tưởng cho giữa c&aacute;c bữa ăn v&agrave; trước khi đi ngủ.</p>\r\n\r\n<p>Khi ch&uacute;ng ta ngủ, cơ thể kh&ocirc;ng được cung cấp đầy đủ dinh dưỡng trong khoảng 6-12 giờ v&agrave; do đ&oacute;, một loại protein giải ph&oacute;ng chậm l&agrave; giải ph&aacute;p l&yacute; tưởng cho cơ bắp c&oacute; thể phục hồi v&agrave; ph&aacute;t triển suốt đ&ecirc;m.</p>\r\n\r\n<p>Sau đ&acirc;y sẽ l&agrave; một số&nbsp;<strong>đ&aacute;nh gi&aacute; Myprotein Micellar Casein</strong>&nbsp;của t&ocirc;i sau khi trải nghiệm sản phẩm. T&ocirc;i t&igrave;m thấy sản phẩm khi đang t&igrave;m mua một loại bột Protein mới để phục vụ cho qu&aacute; tr&igrave;nh tập luyện. T&ocirc;i đ&atilde; d&ugrave;ng Myprotein Casein trong khi bulking v&agrave; trong khi cắt, uống trước khi ngủ để đ&aacute;p ứng nhu cầu protein của t&ocirc;i.</p>\r\n\r\n<p><strong>Đ&aacute;nh gi&aacute; về th&agrave;nh phần dinh dưỡng</strong></p>\r\n\r\n<p>Hầu hết, c&aacute;c hương vị chứa khoảng 95% protein, sản phẩm n&agrave;y cũng c&oacute; sẵn trong hương vị tự nhi&ecirc;n hoặc kh&ocirc;ng hương vị. Kh&ocirc;ng c&oacute; chất độn trong sản phẩm n&agrave;y v&agrave; 100% protein l&agrave; từ micellar casein (sữa). Đối với phi&ecirc;n bản kh&ocirc;ng c&oacute; hương vị, một muỗng 30g cung cấp cho bạn 24g protein, 0,5g chất b&eacute;o v&agrave; 1g carbs cho 110 calo. Tỷ lệ macro sẽ thay đổi một ch&uacute;t t&ugrave;y thuộc v&agrave;o hương vị bạn chọn.</p>\r\n\r\n<p>Micellar Casein l&agrave; h&igrave;nh thức ti&ecirc;u ho&aacute; chậm nhất của&nbsp;<strong><a href=\"https://www.wheystore.vn/casein-protein\">Casein Protein</a></strong>. N&oacute; được t&aacute;ch ra từ sữa th&ocirc;ng qua một qu&aacute; tr&igrave;nh si&ecirc;u lọc. Một trong những tinh chất đặc biệt l&agrave; Myprotein Micellar Casein c&oacute; khả năng &quot;Gel Ho&aacute;&quot; trong qu&aacute; tr&igrave;nh ti&ecirc;u ho&aacute;, v&igrave; vậy ch&uacute;ng gi&uacute;p cơ thể được cung cấp một h&agrave;m lượng Amino Acid ổn định trong h&agrave;ng giờ liền.</p>\r\n\r\n<p><strong>Đ&aacute;nh gi&aacute; về hương vị</strong></p>\r\n\r\n<p>Hương vị Micellar Casein của Myprotein rất tuyệt. T&ocirc;i đ&atilde; thử với vị vani, n&oacute; mịn, kh&ocirc;ng qu&aacute; ngọt, hơi nhạt nhẽo nhưng chắc chắn l&agrave; dư vị vani, đ&aacute;nh gi&aacute; 7/10.</p>\r\n\r\n<p>Khả năng pha trộn tốt, kh&ocirc;ng bị v&oacute;n cục. Bột rất nhẹ v&igrave; vậy h&atilde;y cẩn thận khi mở t&uacute;i kh&ocirc;ng th&igrave; bột sẽ bay khắp nơi. Sau khi uống, l&agrave;m sạch b&igrave;nh lắc hoặc cốc của bạn ngay lập tức v&igrave; n&oacute; sẽ để lại một bộ phim tr&ecirc;n bất cứ thứ g&igrave; n&oacute; chạm v&agrave;o sau khi kh&ocirc;.</p>\r\n\r\n<p>T&ocirc;i đ&atilde; định lượng protein trong mỗi tối l&agrave; 1 muỗng. Đối với những ng&agrave;y t&ocirc;i lười hoặc bận kh&ocirc;ng bổ sung protein li&ecirc;n tục trong ng&agrave;y được th&igrave; buổi tối uống 2 muỗng Micellar Casein.</p>\r\n\r\n<p><strong>Đ&aacute;nh gi&aacute; t&iacute;nh hiệu qủa</strong></p>\r\n\r\n<p>Đ&acirc;y l&agrave; một sản phẩm tuyệt vời cho cả chế độ ăn ki&ecirc;ng Bulking v&agrave; Cutting. Sản phẩm n&agrave;y giữ cho t&ocirc;i no v&agrave; ngăn chặn sự th&egrave;m ăn, th&egrave;m đồ ngọt của t&ocirc;i. T&ocirc;i thường th&egrave;m ăn v&agrave;o buổi tối ngay trước khi đi ngủ, ch&iacute;nh Myprotein Micellar Casein đ&atilde; gi&uacute;p t&ocirc;i đ&aacute;nh bay c&acirc;n th&egrave;m đ&oacute;.</p>\r\n\r\n<p>T&ocirc;i cũng cảm thấy rằng,&nbsp;<strong><a href=\"https://wheystore.vn/myprotein-casein-2.5kg-1116.html\">Micellar Casein</a>&nbsp;</strong>c&oacute; hiệu quả trong khi t&ocirc;i đang Builking v&igrave; t&ocirc;i gặp kh&oacute; khăn trong việc đạt được mục ti&ecirc;u protein m&agrave; kh&ocirc;ng c&oacute; n&oacute;. T&ocirc;i cảm nhận được sự phục hồi cơ bắp tốt hơn khi t&ocirc;i d&ugrave;ng sản phẩm trước khi đi ngủ.</p>\r\n\r\n<p><strong>Về gi&aacute; th&agrave;nh</strong></p>\r\n\r\n<p>Myprotein l&agrave; một thương hiệu xuất hiện trong l&agrave;ng thực phẩm bổ sung năm 2004, nổi tiếng l&agrave; một thương hiệu gi&aacute; rẻ nhưng chất lượng đạt chuẩn.</p>\r\n\r\n<p>Với sản phẩm&nbsp;<strong>Micellar Casein</strong>&nbsp;cũng vậy, so với c&aacute;c sản phẩm c&ugrave;ng loại của c&aacute;c h&atilde;ng kh&aacute;c th&igrave; Myprotein c&oacute; gi&aacute; tốt nhất. Cửa h&agrave;ng Wheystore hiện đang b&aacute;n với gi&aacute;:&nbsp;<strong>Myprotein Micellar Casein 1kg</strong>&nbsp;gi&aacute; 850.000 đồng v&agrave;&nbsp;<strong>Myprotein Micellar Casein 2.5kg</strong>&nbsp;1.600.000 đồng.</p>\r\n\r\n<p>Tr&ecirc;n đ&acirc;y l&agrave; một số&nbsp;<strong>đ&aacute;nh gi&aacute; Myprotein Micellar Casein</strong>, một sản phẩm hỗ trợ phục hồi v&agrave; tăng cơ bắp về ban đ&ecirc;m. Mong rằng qua b&agrave;i viết n&agrave;y, mọi người sẽ hiểu r&otilde; hơn về sản phẩm v&agrave; sẽ dễ d&agrave;ng quyết định khi ph&acirc;n v&acirc;n khi kh&ocirc;ng biết c&oacute; n&ecirc;n mua Micellar Casein của Myprotein kh&ocirc;ng?</p>', '2020-05-08 11:11:55', 1, 1, '2020-05-08 12:33:06'),
(4, 'Review sữa tăng cân Muscle Juice Revolution 2600 5kg', 'review-sua-tang-can-muscle-juice-revolution-2600-5kg', 1, 1, 1, 0, 'Review sản phẩm', '2020-05-08__823-catalog-review-sua-tang-can-muscle-juice-revolution-2600-5kg-main-1587725807.jpg', '<p>Muscle Juice l&agrave; một trong những sản phẩm sữa tăng c&acirc;n d&agrave;nh cho người gầy nổi tiếng tr&ecirc;n thị trường của h&atilde;ng Ultimate Nutrition. B&agrave;i viết sau đ&acirc;y sẽ cung cấp một số th&ocirc;ng tin review&nbsp;<strong>Muscle Juice Revolution&nbsp;2600</strong>&nbsp;để c&aacute;c bạn hiểu r&otilde; hơn về sản phẩm v&agrave; đưa ra quyết định xem c&oacute; n&ecirc;n mua hay kh&ocirc;ng?</p>\r\n\r\n<p><strong>Giới thiệu chung về Muscle Juice</strong></p>\r\n\r\n<p>Muscle Juice Revolution 2600 l&agrave; sản phẩm&nbsp;<a href=\"https://www.wheystore.vn/c157/sua-tang-can\">sữa tăng c&acirc;n</a>&nbsp;được sản xuất bởi h&atilde;ng Ultimate Nutrition . Muscle Juice chứa đầy đủ c&aacute;c th&agrave;nh phần dinh dưỡng quan trọng hỗ trợ người tập luyện thể h&igrave;nh, thể dục thể thao tăng c&acirc;n hiệu quả.</p>\r\n\r\n<p>H&atilde;y bổ sung th&ecirc;m nhiều protein v&agrave;o chế độ ăn uống h&agrave;ng ng&agrave;y của bạn bằng c&aacute;ch uống Muscle Juice 2600.</p>\r\n\r\n<p>Sản phẩm n&agrave;y c&oacute; một c&ocirc;ng thức độc với sự pha trộn đặc biệt của Octo &ndash; Protein c&ugrave;ng với tỷ lệ carb, chất b&eacute;o lạnh mạnh v&agrave; c&aacute;c enzyme ti&ecirc;u h&oacute;a đ&atilde; được chứng minh khoa học.</p>\r\n\r\n<p>C&ocirc;ng thức x&acirc;y dựng khối lượng nạc n&agrave;y được thiết kế để phục vụ cho chế độ ăn ki&ecirc;ng của bạn với nguồn &nbsp;protein tinh khiết, cung cấp dinh dưỡng cần thiết để phục hồi sau một qu&aacute; tr&igrave;nh tập luyện kh&oacute; khăn.</p>\r\n\r\n<p><strong>Th&agrave;nh phần dinh dưỡng c&oacute; trong Muscle Juice 2600</strong></p>\r\n\r\n<p>C&ocirc;ng thức tạo n&ecirc;n sữa tăng c&acirc;n Muscle Juice tuyệt vời gồm những th&agrave;nh phần ch&iacute;nh sau:</p>\r\n\r\n<p><strong><em>1020 calo</em></strong></p>\r\n\r\n<p>H&agrave;m lượng calo lớn, bổ sung năng lượng cho cơ thể gi&uacute;p tăng c&acirc;n hiệu quả.</p>\r\n\r\n<p><strong><em>55g Protein</em></strong></p>\r\n\r\n<p>Hỗn hợp Protein Octo - PRO trong Muscle Juice l&agrave; sự kết hợp ho&agrave;n hảo của 8 loại protein chia th&agrave;nh 3 nh&oacute;m (hấp thụ nhanh, hấp thụ trung b&igrave;nh, hấp thụ chậm), đ&oacute; l&agrave;: Whey Protein Concentrates, Whey Protein Isolates, Milk Protein Isolates, Hydrolyzed Whey Protein, Egg Protein Isolate, Micellar Casein, Milk Protein Concentrate v&agrave; Calcium Caseinate.</p>\r\n\r\n<p>Những protein n&agrave;y cung cấp một loạt c&aacute;c axit amin mạnh mẽ v&ocirc; c&ugrave;ng đa dạng được cơ thể hấp thụ ở c&aacute;c tốc độ kh&aacute;c nhau, gi&uacute;p bạn duy tr&igrave; khả năng giữ nitơ trong thời gian d&agrave;i, nu&ocirc;i dưỡng cơ bắp từ 7 &ndash; 8&nbsp; tiếng.</p>\r\n\r\n<p><strong><em>1g hỗn hợp Glutamine</em></strong></p>\r\n\r\n<p>Hỗn hợp Glutamine bao gồm: L &ndash; Glutamine v&agrave; L &ndash; Alanyl &ndash; L &ndash; Glutamine, gi&uacute;p bổ sung năng lượng cho cơ bắp, chống dị h&oacute;a cơ bắp, giảm đau nhức cơ bắp nhờ khả năng loại bỏ axit Lactic gi&uacute;p người tập tập được l&acirc;u hơn, mạnh mẽ hơn.</p>\r\n\r\n<p><strong><em>170g Carb</em></strong></p>\r\n\r\n<p>Carbohydrate được sản xuất bằng c&ocirc;ng nghệ co, đi qua dạ d&agrave;y rất nhanh hơn 80 lần so với đường. N&oacute; đ&oacute;ng vai tr&ograve; như một chiếc m&aacute;y bơm, k&eacute;o nước v&agrave; c&aacute;c chất dinh dưỡng đi c&ugrave;ng với n&oacute; để th&uacute;c đẩy nhanh sự ph&aacute;t triển của cơ bắp.</p>\r\n\r\n<p><strong><em>14g hỗn hợp axit b&eacute;o</em></strong></p>\r\n\r\n<p><a href=\"https://www.wheystore.vn/muscle-juice-revolution-2600-5kg.html\">Muscle Juice Revolution 2600</a>&nbsp;bổ sung 4 nguồn chất b&eacute;o tốt nhất, để bổ sung năng lượng, tăng cường Hormone để k&iacute;ch th&iacute;ch giảm mỡ, tăng cơ v&agrave; d&agrave;y xương gi&uacute;p tăng c&acirc;n m&agrave; kh&ocirc;ng bị t&iacute;ch mỡ.</p>\r\n\r\n<p>4 nguồn chất b&eacute;o tốt được sử dụng l&agrave;: MCT, CLA, Canola Oil, Omega 3 Fish Oil.</p>\r\n\r\n<p><strong><em>250mg Enzyme</em></strong></p>\r\n\r\n<p>Hỗn hợp Enzyme trong Muscle Juice 2600 l&agrave; sự kết hợp của hai enzyme l&agrave; Protease v&agrave; Lastase. C&aacute;c enzyme n&agrave;y hỗ trợ hệ ti&ecirc;u h&oacute;a tốt hơn v&agrave; gi&uacute;p cơ thể c&oacute; thể sử dụng protein c&oacute; nguồn gốc từ sữa, gi&uacute;p cơ thể c&oacute; thể dung nạp Lactose.</p>\r\n\r\n<p><strong>C&ocirc;ng dụng tuyệt vời của Muscle Juice Revolution 2600</strong></p>\r\n\r\n<p><strong><em>* Hỗ trợ hệ ti&ecirc;u h&oacute;a</em></strong></p>\r\n\r\n<p>Điều m&agrave; nhiều người d&ugrave;ng lo lắng nhất đ&oacute; ch&iacute;nh l&agrave; việc cơ thể bị phản ứng đau bụng, ti&ecirc;u chảy do dị ứng với Lactose c&oacute; trong sữa.</p>\r\n\r\n<p>Muscle Juice cung cấp c&aacute;c enzyme hỗ trợ cải thiện hệ ti&ecirc;u h&oacute;a v&agrave; gi&uacute;p ph&acirc;n hủy Lactose c&oacute; trong sữa gi&uacute;p c&aacute;c bạn c&oacute; thể an t&acirc;m sử dụng sản phẩm m&agrave; kh&ocirc;ng lo bị c&aacute;c hiện tượng tr&ecirc;n.</p>\r\n\r\n<p><strong><em>* Tăng sức bền, bảo vệ cơ bắp</em></strong></p>\r\n\r\n<p>Sự c&oacute; mặt của Glutamine gi&uacute;p cơ bắp được phục hồi nhanh, giảm t&igrave;nh trạng vỡ cơ, đau nhức cơ v&agrave; k&iacute;ch th&iacute;ch c&aacute;c tế bảo cơ ph&aacute;t triển. Kết hợp với&nbsp;<a href=\"https://www.wheystore.vn/c161/amino-acid\">BCAA</a>&nbsp;c&oacute; trong Whey Protein gi&uacute;p phục hồi năng lượng, tăng hiệu suất luyện tập, tăng khả năng tổng hợp protein gi&uacute;p cơ bắp ph&aacute;t triển tối ưu.</p>\r\n\r\n<p><strong><em>* Cung cấp chất b&eacute;o tốt</em></strong></p>\r\n\r\n<p>Muscle Juice cung cấp một h&agrave;m lượng lớn chất b&eacute;o nhưng đều l&agrave; c&aacute;c chất b&eacute;o tốt: MCT, CLA, Omega 3 v&agrave; &nbsp;Canola Oil. C&aacute;c chất b&eacute;o n&agrave;y v&ocirc; c&ugrave;ng an to&agrave;n, tốt cho sức khỏe, kh&ocirc;ng hề g&acirc;y t&iacute;ch mỡ trong cơ thể.</p>\r\n\r\n<p><strong>Đối tượng sử dụng</strong></p>\r\n\r\n<p>Muscle Juice Revolution 2600 5kg l&agrave; d&ograve;ng sữa tăng c&acirc;n d&agrave;nh cho cả nam v&agrave; nữ gi&uacute;p cho việc tập luyện thể thao, người gầy tăng c&acirc;n hiệu quả. Đ&acirc;y l&agrave; sản phẩm được c&aacute;c Gymer đ&aacute;nh gi&aacute; cao trong c&aacute;c d&ograve;ng sản phẩm sữa tăng c&acirc;n hiện nay.</p>\r\n\r\n<p><strong>Muscle Juice Revolution 2600 c&oacute; tốt kh&ocirc;ng?</strong></p>\r\n\r\n<p>Với một c&ocirc;ng thức kết hợp ho&agrave;n hảo của 1020 calo với h&agrave;m lượng protein chất lượng cao, nhiều carb, đầy đủ axit amin v&agrave; c&aacute;c enzyme&nbsp; gi&uacute;p cơ thể hấp thu tốt, tăng c&acirc;n nhanh ch&oacute;ng v&agrave; ph&aacute;t triển cơ bắp tối ưu.</p>\r\n\r\n<p>Đ&acirc;y l&agrave; một sản phẩm tốt gi&uacute;p tăng c&acirc;n nhanh, chắc cơ v&agrave; tạo n&eacute;t số 1 của h&atilde;ng Ultimate Nutrition, d&agrave;nh cho những người gầy tập thể h&igrave;nh, vận động vi&ecirc;n, người tập thể dục thể thao, &hellip;</p>\r\n\r\n<p>Tr&ecirc;n đ&acirc;y, l&agrave; to&agrave;n bộ th&ocirc;ng tin về sản phẩm sữa tăng c&acirc;n&nbsp;<strong>Muscle Juice Revolution 2600</strong>&nbsp;- một sản phẩm tăng c&acirc;n rất tốt cho người gầy. Đ&acirc;y l&agrave; một sản phẩm đ&aacute;ng để c&aacute;c bạn lựa chọn l&agrave;m người bạn đồng h&agrave;nh trong qu&aacute; tr&igrave;nh tăng c&acirc;n của m&igrave;nh. Ch&uacute;c c&aacute;c bạn th&agrave;nh c&ocirc;ng!</p>', '2020-05-08 11:14:03', 1, 1, '2020-05-08 12:32:53'),
(5, 'Review Optimum Pro Gainer - Sản phẩm tăng cân nạc ít mỡ', 'review-optimum-pro-gainer-san-pham-tang-can-nac-it-mo', 1, 1, 1, 0, 'Review sản phẩm', '2020-05-08__822-catalog-review-optimum-pro-gainer-san-pham-tang-can-nac-it-mo-main-1587725807.jpg', '<p>Optimum Nutrition Pro Gainer l&agrave; một sản phẩm hỗ trợ tăng c&acirc;n v&agrave; tăng cơ nạc to&agrave;n diện, hiểu quả, ti&ecirc;n tiến nhất hiện nay d&agrave;nh ri&ecirc;ng cho những người muốn tăng c&acirc;n kh&ocirc;ng tăng mỡ. Sau đ&acirc;y sẽ l&agrave; một số&nbsp;<strong>review Optimum Pro Gainer</strong>&nbsp;để mọi người hiểu r&otilde; hơn về sản phẩm.</p>\r\n\r\n<p><strong>Th&ocirc;ng tin về sản phẩm Optimum Pro Gainer</strong></p>\r\n\r\n<p>Đ&acirc;y l&agrave; một sản phẩm hỗ trợ tăng c&acirc;n, tăng cơ nạc, &iacute;t mỡ, được nhiều vận động vi&ecirc;n nổi tiếng tin d&ugrave;ng.</p>\r\n\r\n<p>Kh&ocirc;ng giống như c&aacute;c sản phẩm tăng c&acirc;n kh&aacute;c chủ yếu tăng c&acirc;n dựa tr&ecirc;n lượng đường v&agrave; chất b&eacute;o, Pro Gainer mang đến một nguồn năng lượng cao hơn từ 7 nguồn Protein cao cấp.</p>\r\n\r\n<p>Ngo&agrave;i ra, n&oacute; cũng chứa carb tổng hợp, chất xơ, Triglycerides chuỗi trung b&igrave;nh&nbsp; - MCTs, men ti&ecirc;u h&oacute;a, vitamin v&agrave; kho&aacute;ng chất. Tất cả kết hợp lại tạo n&ecirc;n một Optimum Pro Gainer chất lượng,&nbsp;<a href=\"https://www.wheystore.vn/c157/sua-tang-can\">tăng c&acirc;n hiệu quả</a>, tăng cơ nạc, kh&ocirc;ng tăng mỡ.</p>\r\n\r\n<p><strong>Th&agrave;nh phần dinh dưỡng</strong></p>\r\n\r\n<p>Trong mỗi khẩu phần, Pro Gainer cung cấp cho cơ thể:</p>\r\n\r\n<p><strong><em>60g Protein chất lượng cao</em></strong></p>\r\n\r\n<p>Protein trong Pro Gainer c&oacute; gi&aacute; trị sinh học cao, dễ d&agrave;ng ti&ecirc;u h&oacute;a, hấp thu nhanh tối đa v&agrave;o trong cơ thể v&agrave; l&agrave; sự pha trộn của 7 loại protein cao cấp: Whey Protein Isolate, Whey Protein Concentrate, Calcium Caseinate, Egg Whites, Whey Peptides, Whey Glutamine Peptides.</p>\r\n\r\n<p><strong><em>85g Carb tổng hợp v&agrave; Lipid</em></strong></p>\r\n\r\n<p>Trong mỗi khẩu phần, Pro Gainer cung cấp 85g Carb v&agrave; 5g chất xơ, trong đ&oacute; chỉ c&oacute; 5g đường. Th&ecirc;m v&agrave;o đ&oacute; c&ograve;n c&oacute; MCTs v&agrave; nhiều Lipit gi&agrave;u năng lượng kh&aacute;c.</p>\r\n\r\n<p><strong><em>650 calo</em></strong></p>\r\n\r\n<p>Trong mỗi liều d&ugrave;ng chỉ cung cấp 650 calo vừa đủ để tăng c&acirc;n nạc m&agrave; kh&ocirc;ng bị t&iacute;ch mỡ.</p>\r\n\r\n<p><strong><em>Hơn 20 loại vitamin v&agrave; kho&aacute;ng chất</em></strong></p>\r\n\r\n<p>Pro Gainer cung cấp đầy đủ vitamin v&agrave; kho&aacute;ng chất cho cơ thể với hơn 20 loại, bao gồm: vitamin A, C, D, E, B6, B12, đồng, canxi, selen, kẽm, magi&ecirc;, natri, phốt pho, &hellip;</p>\r\n\r\n<p><strong><em>C&aacute;c Enzyme ti&ecirc;u h&oacute;a</em></strong></p>\r\n\r\n<p>Pro Gainer c&oacute; bổ sung th&ecirc;m một số enzyme ti&ecirc;u h&oacute;a như Lactase, Aminogen, Protease để gi&uacute;p ti&ecirc;u hủy đường lactose.</p>\r\n\r\n<p><strong>C&ocirc;ng dụng của Optimum Nutrition Pro Gainer</strong></p>\r\n\r\n<p><strong><em>* Tăng c&acirc;n, tăng cơ nạc, &iacute;t mỡ</em></strong></p>\r\n\r\n<p>Như c&aacute;c bạn đ&atilde; thấy ở bảng th&agrave;nh phần dinh dưỡng, với một lượng calo vừa đủ, tỷ lệ protein : carb cao, tỷ lệ đường v&agrave; chất b&eacute;o thấp, sẽ gi&uacute;p bạn tăng c&acirc;n nạc hiệu quả, cơ bắp săn chắc, kh&ocirc;ng bị tăng mỡ.</p>\r\n\r\n<p><strong><em>* Tăng cơ hiệu quả với nguồn protein cao cấp</em></strong></p>\r\n\r\n<p>Sản phẩm được đ&aacute;nh gi&aacute; c&oacute; nguồn protein tinh khiết, hấp thụ nhanh v&agrave;o trong cơ bắp, gi&uacute;p kịp thời sửa chữa c&aacute;c m&ocirc; cơ bị tổn thương v&agrave; k&iacute;ch th&iacute;ch cơ bắp ph&aacute;t triển mạnh mẽ.</p>\r\n\r\n<p><strong><em>* Tăng cường hệ miễn dịch</em></strong></p>\r\n\r\n<p>Pro Gainer cung cấp đầy đủ&nbsp;<a href=\"https://www.wheystore.vn/c162/vitahmin-koang-chat\">vitamin v&agrave; kho&aacute;ng chất</a>, gi&uacute;p tăng cường hệ miễn dịch v&agrave; tăng khả năng hấp thụ chất dinh dưỡng cho cơ thể từ đ&oacute; tăng c&acirc;n nhanh ch&oacute;ng.</p>\r\n\r\n<p><strong><em>* Cải thiện hệ ti&ecirc;u h&oacute;a</em></strong></p>\r\n\r\n<p>C&aacute;c enzyme ti&ecirc;u h&oacute;a c&oacute; trong sản phẩm gi&uacute;p cải thiện hệ ti&ecirc;u h&oacute;a gi&uacute;p cơ thể hấp thu được nhiếu chất dinh dưỡng hơn đồng thời ti&ecirc;u hủy đường Lactose c&oacute; trong Whey Protein Concentrate để những ai bị dị ứng với Lactose an t&acirc;m sử dụng sản phẩm.</p>\r\n\r\n<p><strong><em>* Một bữa ăn phụ tiện lợi, gi&agrave;u dinh dưỡng</em></strong></p>\r\n\r\n<p>Với đầy đủ c&aacute;c chất dinh dưỡng, Pro Gainer c&oacute; thể sử dụng để thay thế bữa ăn phụ rất tiện lợi d&agrave;nh cho nhữung ai kh&ocirc;ng c&oacute; thời gian chuẩn bị bữa ăn.</p>\r\n\r\n<p><strong>M&ugrave;i vị đa dạng</strong></p>\r\n\r\n<p>Hương vị rất quan trọng, quyết định xem người ti&ecirc;u d&ugrave;ng c&oacute; n&ecirc;n mua trong những lần tiếp theo hay kh&ocirc;ng. Hiểu được điều n&agrave;y n&ecirc;n h&atilde;ng Optimum Nitrition đ&atilde; nghi&ecirc;n cứu v&agrave; đưa ra những m&ugrave;i vị v&ocirc; c&ugrave;ng thơm ngon v&agrave; hấp dẫn.</p>\r\n\r\n<p><a href=\"https://www.wheystore.vn/optimum-pro-complex-10-lbs-4-62kg--154.html\">Pro Gainer Complex</a>&nbsp;c&oacute; vị ngọt dịu, do lượng đường thấp n&ecirc;n rất dễ uống. Hai vị chuối v&agrave; socola được nhiều người ti&ecirc;u d&ugrave;ng lựa chọn nhiều nhất, b&aacute;n chạy nhất.</p>\r\n\r\n<p><strong>Pro Gainer c&oacute; tốt kh&ocirc;ng?</strong></p>\r\n\r\n<p>Đ&acirc;y l&agrave; một sản phẩm tốt, gi&uacute;p tăng c&acirc;n, tăng cơ nạc, kh&ocirc;ng bị l&ecirc;n mỡ nhờ c&oacute; h&agrave;m lượng calo vừa phải, h&agrave;m lượng protein v&agrave; carb cao, &iacute;t đường.</p>\r\n\r\n<p>Để qu&aacute; tr&igrave;nh tăng c&acirc;n nạ đạt hiệu quả th&igrave; cần kết hợp giữa việc sử dụng Pro Gainer với chế độ dinh dưỡng khoa học, tập luyện thể h&igrave;nh, thể dục thể thao thường xuy&ecirc;n.</p>\r\n\r\n<p><strong>Kết luận</strong></p>\r\n\r\n<p>ON Pro Gainer l&agrave; d&ograve;ng sản phẩm cao cấp, chất lượng cao được sản xuất bởi thương hiệu nổi tiếng hỗ trợ tăng c&acirc;n nạc, &iacute;t mỡ.</p>', '2020-05-08 11:16:48', 1, 1, '2020-05-08 12:32:39'),
(6, 'Mắc 3 sai lầm này: Đừng hỏi tại sao tập gym không giảm cân', 'mac-3-sai-lam-nay-dung-hoi-tai-sao-tap-gym-khong-giam-can', 1, 1, 2, 0, 'Chương trình tập luyện', '2020-05-08__1056-catalog-mac-3-sai-lam-nay-ung-hoi-tai-sao-tap-gym-khong-giam-can-main-1587725922.jpg', '<p><em>L&yacute; do n&agrave;o khiến bạn d&ugrave; tập gym rất chăm chỉ nhưng kh&ocirc;ng giảm c&acirc;n? Check ngay 3 sai lầm n&agrave;y để kiểm tra xem l&yacute; do tại sao nh&eacute;!</em></p>\r\n\r\n<p>Thể h&igrave;nh được biết đến l&agrave; bộ m&ocirc;n thể thao hỗ trợ rất tốt cho mục đ&iacute;ch giảm c&acirc;n của bạn. Nhưng tại sao người kh&aacute;c tập gym sau 1 thời gian sẽ giảm c&acirc;n c&ograve;n bạn th&igrave; vẫn &ldquo;dậm ch&acirc;n tại chỗ&rdquo;? Bạn đang bắt đầu nản l&ograve;ng? Đừng vội nản. B&agrave;i viết n&agrave;y WheyStore sẽ chỉ ra cho bạn 3 sai lầm trong việc giảm c&acirc;n khiến việc tập luyện trở th&agrave;nh c&ocirc;ng cốc. Kiểm tra ngay xem bạn c&oacute; mắc phải sai lầm n&agrave;o trong số n&agrave;y kh&ocirc;ng nh&eacute;!</p>\r\n\r\n<h2><strong>Nguy&ecirc;n tắc giảm c&acirc;n cần nhớ</strong></h2>\r\n\r\n<p>1 nguy&ecirc;n tắc tối quan trọng bạn cần nắm khi thực hiện chế độ giảm c&acirc;n đ&oacute; l&agrave; đảm bảo kiểm so&aacute;t lượng Calo in v&agrave; Calo out một c&aacute;ch chặt chẽ, lu&ocirc;n tu&acirc;n thủ Calo in &lt; Calo out. Đ&acirc;y l&agrave; nguy&ecirc;n tắc đầu ti&ecirc;n gi&uacute;p bạn giảm c&acirc;n hiệu quả.</p>\r\n\r\n<p><img alt=\"Mắc 3 sai lầm này: Đừng hỏi tại sao tập gym không giảm cân - Ảnh 1\" src=\"https://cdn.wheystore.vn/upload/news_optimize/wst_1056_mac_3_sai_lam_nay____ung_hoi_tai_sao_tap_gym_khong_giam_can_image_1587725922_1.jpg\" title=\"Mắc 3 sai lầm này: Đừng hỏi tại sao tập gym không giảm cân - Ảnh 1\" /></p>\r\n\r\n<p>Nguy&ecirc;n tắc giảm c&acirc;n cần nắm r&otilde;</p>\r\n\r\n<p>V&igrave; thế, để đ&aacute;p ứng nguy&ecirc;n tắc tr&ecirc;n, c&aacute;ch duy nhất đ&oacute; l&agrave; bạn cần giảm năng lượng nạp v&agrave;o cơ thể từ thực phẩm bạn ăn h&agrave;ng ng&agrave;y v&agrave; tăng cường mức ti&ecirc;u hao năng lượng bằng c&aacute;c hoạt động thể chất v&agrave; tr&iacute; &oacute;c...</p>\r\n\r\n<p>Bạn c&oacute; thể &aacute;p dụng theo mọi chế độ giảm c&acirc;n m&agrave; bạn th&iacute;ch, ăn những thức ăn m&agrave; bạn th&iacute;ch hoặc được khuy&ecirc;n l&agrave; chia nhỏ c&aacute;c bữa ăn trong ng&agrave;y để th&uacute;c đẩy trao đổi chất v&agrave; l&agrave;m giảm cảm gi&aacute;c th&egrave;m ăn. Bạn c&oacute; thể thử mọi c&aacute;ch, nhưng d&ugrave; l&agrave; bất kỳ c&aacute;ch n&agrave;o, chỉ cần tu&acirc;n thủ nguy&ecirc;n tắc về việc th&acirc;m hụt Calo n&ecirc;u tr&ecirc;n, bạn chắc chắn sẽ giảm c&acirc;n sau 1 thời gian thực hiện.</p>\r\n\r\n<p>Vậy tại sao bạn kh&ocirc;ng giảm c&acirc;n d&ugrave; đ&atilde; tập luyện rất chăm chỉ? Dưới đ&acirc;y sẽ l&agrave; c&acirc;u trả lời cho bạn!</p>\r\n\r\n<h2><strong>3 sai lầm trong việc giảm c&acirc;n khiến việc tập luyện trở th&agrave;nh c&ocirc;ng cốc</strong></h2>\r\n\r\n<h3><strong>Sai lầm 1: Đ&aacute;nh gi&aacute; sai lượng Calo nạp v&agrave;o</strong></h3>\r\n\r\n<p>Đ&acirc;y l&agrave; sai lầm phải tới 99% những người muốn giảm c&acirc;n thường mắc phải. Nhiều người tự nhận định rằng, m&igrave;nh rất chăm chỉ tập luyện v&agrave; nghĩ rằng m&igrave;nh ăn rất &iacute;t th&igrave; chắc chắn cơ thể sẽ ở trong t&igrave;nh trạng thiếu hụt Calo. Nhưng thực tế kh&ocirc;ng ho&agrave;n to&agrave;n như họ nhận định!</p>\r\n\r\n<p><img alt=\"Mắc 3 sai lầm này: Đừng hỏi tại sao tập gym không giảm cân - Ảnh 2\" src=\"https://cdn.wheystore.vn/upload/news_optimize/wst_1056_mac_3_sai_lam_nay____ung_hoi_tai_sao_tap_gym_khong_giam_can_image_1587725922_2.jpg\" title=\"Mắc 3 sai lầm này: Đừng hỏi tại sao tập gym không giảm cân - Ảnh 2\" /></p>\r\n\r\n<p>Đ&aacute;nh gi&aacute; sai lượng calo nạp v&agrave;o l&agrave; nguy&ecirc;n nh&acirc;n giảm c&acirc;n thất bại</p>\r\n\r\n<p>Việc kh&ocirc;ng theo d&otilde;i s&aacute;t sao lượng Calo nạp v&agrave;o khiến nhiều khi bạn &ldquo;tưởng&rdquo; rằng m&igrave;nh ăn &iacute;t, nhưng thực tế lượng Calo ti&ecirc;u thụ trong 1 ng&agrave;y lại cao hơn nhiều so với con số dự t&iacute;nh.</p>\r\n\r\n<p>Mặc d&ugrave; việc theo d&otilde;i v&agrave; t&iacute;nh to&aacute;n lượng Calo trong từng bữa ăn c&oacute; vẻ kh&aacute; phức tạp v&agrave; kh&oacute; khăn, nhưng cố gắng h&atilde;y kiểm so&aacute;t thật kỹ, đừng ước lượng, bạn c&oacute; thể sử dụng th&ecirc;m 1 số ứng dụng bổ trợ để t&iacute;nh to&aacute;n mức năng lượng nạp v&agrave;o cơ thể mỗi ng&agrave;y sẽ gi&uacute;p &iacute;ch cho việc giảm c&acirc;n của bạn.</p>\r\n\r\n<p>V&agrave; h&atilde;y lưu &yacute; 1 điều, ngay cả những thứ nhỏ nhặt như dầu oliu trong mỗi khẩu phần, hay v&ocirc; t&igrave;nh cắn 1 miếng g&agrave; r&aacute;n ph&ocirc; mai...cũng khiến lượng Calo nạp v&agrave;o của bạn tăng th&ecirc;m đ&oacute;!</p>\r\n\r\n<h3><strong>Sai lầm 2: Kh&ocirc;ng tự c&acirc;n ch&iacute;nh x&aacute;c c&acirc;n nặng của m&igrave;nh</strong></h3>\r\n\r\n<p>Nếu bạn nghĩ rằng, 1 tuần chỉ cần nhảy l&ecirc;n c&acirc;n 1 v&agrave;i lần, nếu c&acirc;n nặng kh&ocirc;ng giảm nghĩa l&agrave; bạn đ&atilde; thực hiện sai hoặc điều n&agrave;y khiến bạn ch&aacute;n nản v&agrave; muốn bỏ cuộc th&igrave; c&oacute; lẽ bạn đ&atilde; nhầm!</p>\r\n\r\n<p>Qu&aacute; tr&igrave;nh giảm c&acirc;n cần được đ&aacute;nh gi&aacute; ch&iacute;nh x&aacute;c nhất bằng việc bạn tự c&acirc;n c&acirc;n nặng của m&igrave;nh v&agrave;o 3 thời điểm: buổi s&aacute;ng khi thức dậy, sau khi đi vệ sinh v&agrave; trước khi ăn. Mỗi ng&agrave;y, h&atilde;y ghi v&agrave;o sổ chỉ số c&acirc;n nặng v&agrave;o 3 thời điểm n&agrave;y v&agrave; t&iacute;nh trung b&igrave;nh theo tuần. So s&aacute;nh trọng lượng cơ thể trung b&igrave;nh của từng tuần sẽ gi&uacute;p bạn đ&aacute;nh gi&aacute; ch&iacute;nh x&aacute;c hơn tiến tr&igrave;nh giảm c&acirc;n của m&igrave;nh.</p>\r\n\r\n<p>Nếu sau khoảng 3-4 tuần, mức c&acirc;n nặng trung b&igrave;nh kh&ocirc;ng giảm, điều n&agrave;y c&oacute; nghĩa l&agrave; bạn cần tiếp tục thay đổi trong chế độ ăn uống, giảm bớt lượng calo nạp v&agrave;o hoặc tăng thời gian/ cường độ tập luyện để tăng mức năng lượng ti&ecirc;u hao.</p>\r\n\r\n<h3><strong>Sai lầm 3: Đ&aacute;nh gi&aacute; qu&aacute; cao lượng calo ti&ecirc;u thụ &amp; ăn lại qu&aacute; nhiều</strong></h3>\r\n\r\n<p>Rất nhiều người đ&aacute;nh gi&aacute; sai về năng lượng ti&ecirc;u hao khi tập luyện. Việc tập luyện cường độ cao sẽ khiến bạn trở n&ecirc;n đ&oacute;i, v&agrave; dĩ nhi&ecirc;n l&uacute;c n&agrave;y, bạn muốn nạp calo cho cơ thể.</p>\r\n\r\n<p>Tuy nhi&ecirc;n, 1 sai lầm phổ biến đ&oacute; l&agrave; bạn nạp qu&aacute; nhiều thức ăn gi&agrave;u calo sau qu&aacute; tr&igrave;nh tập luyện đến mức vượt qu&aacute; cả mức calo vừa đốt ch&aacute;y trong buổi tập.</p>\r\n\r\n<p>Theo 1 nghi&ecirc;n cứu chỉ ra rằng, c&oacute; tới 70% đ&aacute;nh gi&aacute; qu&aacute; cao về lượng calo ti&ecirc;u thụ trong 1 buổi tập. V&iacute; dụ, bạn cho rằng việc cardio trong 30 ph&uacute;t c&oacute; thể đốt ch&aacute;y tới 1000 Calories, nhưng thực tế, con số chỉ l&agrave; 300 m&agrave; th&ocirc;i.</p>\r\n\r\n<p>B&ecirc;n cạnh đ&oacute;, c&aacute;c thiết bị v&agrave; m&aacute;y m&oacute;c tại ph&ograve;ng tập c&oacute; chức năng theo d&otilde;i lượng calo đốt ch&aacute;y, được nhận định l&agrave; đ&aacute;nh gi&aacute; cao qu&aacute; mức lượng calo thực tế l&ecirc;n tới 24%.</p>\r\n\r\n<p>Bởi vậy, h&atilde;y cố gắng tu&acirc;n thủ theo h&agrave;m lượng calo định sẵn trong ng&agrave;y v&agrave; duy tr&igrave; tập luyện h&agrave;ng tuần, đồng thời theo d&otilde;i trọng lượng cơ thể h&agrave;ng tuần để đ&aacute;nh gi&aacute; ch&iacute;nh x&aacute;c việc giảm c&acirc;n nh&eacute;!</p>\r\n\r\n<p>Tr&ecirc;n đ&acirc;y l&agrave;&nbsp;<strong>3 sai lầm khiến bạn kh&ocirc;ng giảm c&acirc;n</strong>&nbsp;d&ugrave; tập luyện rất chăm chỉ. Hy vọng b&agrave;i viết sẽ cung cấp cho bạn những th&ocirc;ng tin cần thiết. Ch&uacute;c c&aacute;c bạn giảm c&acirc;n th&agrave;nh c&ocirc;ng!</p>', '2020-05-08 11:18:27', 1, 1, '2020-05-08 11:22:28'),
(7, 'Đau căng cơ: Cần làm gì khi bị căng cơ?', 'dau-cang-co-can-lam-gi-khi-bi-cang-co', 1, 1, 2, 0, 'Chương trình tập luyện', '2020-05-08__1055-catalog-au-cang-co-can-lam-gi-khi-bi-cang-co-main-1587725922.jpg', '<p>Căng cơ l&agrave; hiện tượng thường gặp ở những người luyện tập thể thao. Dấu hiệu n&agrave;o cho thấy bạn bị căng cơ? V&agrave; cần l&agrave;m g&igrave; khi bị căng cơ? C&ugrave;ng tham khảo b&agrave;i viết n&agrave;y của&nbsp;<strong>WheyStore.vn</strong>&nbsp;nh&eacute;!</p>\r\n\r\n<p>Nếu tập luyện thể thao, bạn sẽ kh&ocirc;ng thể tr&aacute;nh khỏi những cơn đau do bị căng cơ. V&igrave; thế, bạn cần hiểu r&otilde; về hiện tượng n&agrave;y, dấu hiệu nhận biết cũng như c&aacute;ch xử l&yacute; khi bị căng cơ để kh&ocirc;ng ảnh hưởng tới sức khỏe nh&eacute;.</p>\r\n\r\n<p><strong>T&igrave;m hiểu về hiện tượng căng cơ</strong></p>\r\n\r\n<p>Căng cơ (Muscle Strain) l&agrave; hiện tượng xảy ra khi cơ của bạn bị căng qu&aacute; mức dẫn tới bị r&aacute;ch 1 phần hoặc r&aacute;ch to&agrave;n bộ cơ. Hiện tượng n&agrave;y thường xảy ra khi bạn khởi động kh&ocirc;ng đ&uacute;ng c&aacute;ch, tập luyện qu&aacute; sức hoặc mang v&aacute;c vật qu&aacute; nặng.</p>\r\n\r\n<p><img alt=\"Đau căng cơ: Cần làm gì khi bị căng cơ? - Ảnh 1\" src=\"https://cdn.wheystore.vn/upload/news_optimize/wst_1055___au_cang_co__can_lam_gi_khi_bi_cang_co__image_1587725921_1.jpg\" title=\"Đau căng cơ: Cần làm gì khi bị căng cơ? - Ảnh 1\" /></p>\r\n\r\n<p>C&aacute;c mức độ căng cơ</p>\r\n\r\n<p>Căng cơ thường gặp ở c&aacute;c v&ugrave;ng như thắt lưng, cổ, vai v&agrave; đ&ugrave;i sau.</p>\r\n\r\n<p>Khi bị căng cơ, c&aacute;c sợi cơ bị k&eacute;o gi&atilde;n qu&aacute; mức dẫn tới r&aacute;ch một phần hoặc to&agrave;n bộ, g&acirc;y ra hiện tượng chảy m&aacute;u cục bộ. V&ugrave;ng bị căng cơ thường bị đau, bầm t&iacute;m v&agrave; bị sưng l&ecirc;n.</p>\r\n\r\n<p><strong>C&aacute;c dấu hiệu nhận biết khi bị căng cơ</strong></p>\r\n\r\n<p>- Bị đau nhức cơ ngay cả khi nghỉ ngơi.</p>\r\n\r\n<p>- Xuất hiện c&aacute;c vết bầm t&iacute;m, sưng, đỏ tấy da tại v&ugrave;ng cơ đ&oacute;.</p>\r\n\r\n<p>- Cơ bắp bị co thắt, bị cứng cơ, cứng khớp v&agrave; mỏi cơ.</p>\r\n\r\n<p>- G&acirc;y ra những hạn chế nhất định khi hoạt động sử dụng cơ bắp đ&oacute;.</p>\r\n\r\n<p>Khi bị căng cơ ở mức độ nhẹ, bạn vẫn c&oacute; thể cử động b&igrave;nh thường v&agrave; chỉ cảm thấy hơi đau, c&ograve;n khi bị nặng, bạn sẽ cảm thấy rất đau d&ugrave; chỉ di chuyển nhẹ nh&agrave;ng.</p>\r\n\r\n<p><strong>Cần l&agrave;m g&igrave; khi bị căng cơ?</strong></p>\r\n\r\n<p>Trong trường hợp căng cơ cấp t&iacute;nh (thường xảy ra do việc tập luyện thể thao qu&aacute; sức hoặc khởi động sai c&aacute;ch), bạn c&oacute; thể xử l&yacute; tại nh&agrave; bằng c&aacute;ch:</p>\r\n\r\n<p><img alt=\"Đau căng cơ: Cần làm gì khi bị căng cơ? - Ảnh 2\" src=\"https://cdn.wheystore.vn/upload/news_optimize/wst_1055___au_cang_co__can_lam_gi_khi_bi_cang_co__image_1587725921_2.jpg\" title=\"Đau căng cơ: Cần làm gì khi bị căng cơ? - Ảnh 2\" /></p>\r\n\r\n<p>Xử l&yacute; khi bị căng cơ</p>\r\n\r\n<p><strong>1- Nghỉ ngơi</strong>: Dừng ngay việc tập luyện để cơ bắp được nghỉ ngơi v&agrave; phục hồi. Bạn c&oacute; thể hoạt động nhẹ nh&agrave;ng nhưng tr&aacute;nh vận động qu&aacute; sức nh&eacute;.</p>\r\n\r\n<p><strong>2- Chườm đ&aacute; lạnh</strong>: Chườm đ&aacute; lạnh c&agrave;ng sớm c&agrave;ng tốt sẽ gi&uacute;p co mạch m&aacute;u cục bộ, đồng thời giảm phản ứng g&acirc;y sưng, vi&ecirc;m.</p>\r\n\r\n<p>Mỗi 1h lại chườm lạnh khoảng 10-20 ph&uacute;t (chườm l&acirc;u hơn trong trường hợp v&ugrave;ng căng cơ s&acirc;u hoặc rộng hơn).</p>\r\n\r\n<p>Lưu &yacute;, để v&ugrave;ng bị căng cơ trở về nhiệt độ b&igrave;nh thường trước khi tiếp tục chườm đ&aacute; v&agrave; kh&ocirc;ng nền chườm qu&aacute; l&acirc;u 1 l&uacute;c.</p>\r\n\r\n<p>Giảm tần suất chườm khi cơn đau v&agrave; sưng đ&atilde; giảm bớt.</p>\r\n\r\n<p><strong>3- Quấn băng</strong>: Sử dụng băng đ&agrave;n hồi quấn v&agrave;o khu vực căng cơ sẽ gi&uacute;p bạn hạn chế bị sưng. Lưu &yacute; kh&ocirc;ng quấn qu&aacute; chặt sẽ l&agrave;m cản trở việc lưu th&ocirc;ng m&aacute;u.</p>\r\n\r\n<p><strong>4- N&acirc;ng cao v&ugrave;ng căng cơ</strong>: N&ecirc;n lưu &yacute;, giữ cho khu vực căng cơ lu&ocirc;n cao hơn tim sẽ gi&uacute;p bạn nhanh ch&oacute;ng giảm bầm t&iacute;m, sưng đỏ.</p>\r\n\r\n<p>Đối với t&igrave;nh trạng căng cơ m&atilde;n t&iacute;nh (k&eacute;o d&agrave;i tr&ecirc;n 1 th&aacute;ng):</p>\r\n\r\n<p>Nếu t&igrave;nh trạng căng cơ của bạn k&eacute;o d&agrave;i tr&ecirc;n 1 th&aacute;ng, th&igrave; điều cần quan t&acirc;m kh&ocirc;ng phải l&agrave; giảm sưng tức thời. Điều đ&aacute;ng quan t&acirc;m l&agrave; v&ugrave;ng cơ đ&oacute; sẽ bị suy yếu, hạn chế khả năng lưu th&ocirc;ng m&aacute;u, dẫn đến t&igrave;nh trạng cung cấp kh&ocirc;ng đủ chất dinh dưỡng như oxy, kho&aacute;ng chất v&agrave; glucose, dẫn tới cơ bắp sẽ kh&oacute; phục hồi. Trong trường hợp bạn bị căng cơ m&atilde;n t&iacute;nh, n&ecirc;n &aacute;p dụng c&aacute;ch chườm n&oacute;ng để giảm căng v&agrave; co thắt cơ, đồng thời tăng tuần ho&agrave;n m&aacute;u, đẩy nhanh qu&aacute; tr&igrave;nh chữa l&agrave;nh m&ocirc; cơ bị căng m&atilde;n t&iacute;nh.</p>\r\n\r\n<p>- Chườm t&uacute;i ấm l&ecirc;n v&ugrave;ng bị căng cơ khoảng 15-20 ph&uacute;t, thực hiện 3-5 lần mỗi ng&agrave;y cho đến khi cơ bớt căng.</p>\r\n\r\n<p>- Bạn c&oacute; thể ng&acirc;m v&ugrave;ng cơ bị căng m&atilde;n t&iacute;nh v&agrave;o nước muối Epsom ấm trong v&ograve;ng 20-30 ph&uacute;t gi&uacute;p giảm sưng, đau cơ bởi Magie trong muối sẽ gi&uacute;p gi&atilde;n sợi cơ v&agrave; nước ấm sẽ l&agrave;m tăng tuần ho&agrave;n m&aacute;u.</p>\r\n\r\n<p>- Lưu &yacute; kh&ocirc;ng chườm n&oacute;ng kh&ocirc; để tr&aacute;nh l&agrave;m mất nước trong m&ocirc;, khiến v&ugrave;ng căng cơ bị nặng hơn.</p>\r\n\r\n<p><strong>Một số lưu &yacute; khi chăm s&oacute;c v&ugrave;ng căng cơ tại nh&agrave;</strong></p>\r\n\r\n<p>- Sử dụng th&ecirc;m 1 số loại thuốc kh&aacute;ng vi&ecirc;m kh&ocirc;ng cần k&ecirc; đơn như Ibuprofen (Advil, Motrin), Naproxen (Aleve) v&agrave; Aspirin c&oacute; t&aacute;c dụng giảm sưng đau, ngăn ngừa vi&ecirc;m nhiễm.</p>\r\n\r\n<p>- Sau 3 ng&agrave;y, bạn c&oacute; thể chườm n&oacute;ng cho khu vực căng cơ v&agrave;i lần để th&uacute;c đẩy lưu th&ocirc;ng m&aacute;u v&agrave; phục hồi cơ nhanh hơn.</p>\r\n\r\n<p>- Kh&ocirc;ng n&ecirc;n nghỉ qu&aacute; l&acirc;u sẽ l&agrave;m cơ bắp bị cứng v&agrave; yếu đi. Bắt đầu bằng c&aacute;c hoạt động nhẹ nh&agrave;ng (khoảng 50% sức) v&agrave; từ từ tăng dần l&ecirc;n để cơ thể dễ th&iacute;ch nghi.</p>\r\n\r\n<p>- Lu&ocirc;n đảm bảo khởi động thật kỹ trước khi tập luyện để tr&aacute;nh t&igrave;nh trạng căng cơ bị t&aacute;i lại.</p>\r\n\r\n<p>Với những chia sẻ tr&ecirc;n đ&acirc;y hy vọng sẽ gi&uacute;p bạn hiểu r&otilde; về&nbsp;<strong>hiện tượng căng cơ</strong>&nbsp;cũng như c&aacute;ch khắc phục t&igrave;nh trạng n&agrave;y. Ch&uacute; &yacute; tập luyện đ&uacute;ng c&aacute;ch v&agrave; n&acirc;ng cao sức khỏe để ph&ograve;ng tr&aacute;nh bị căng cơ anh em nh&eacute;!</p>', '2020-05-08 11:22:14', 1, 1, '2020-05-08 11:22:32'),
(8, 'Những điều cần biết khi xả cơ và siết cơ.', 'nhung-dieu-can-biet-khi-xa-co-va-siet-co', 1, 1, 2, 0, 'Chương trình luyện tập', '2020-05-08__1016-catalog-nhung-dieu-can-biet-khi-xa-co-va-siet-co-main-1587725895.jpg', '<h1>Những điều cần biết khi xả cơ v&agrave; siết cơ.</h1>\r\n\r\n<p>Đối với gymer hẳn kh&aacute;i niệm xả cơ v&agrave; siết cơ kh&ocirc;ng c&ograve;n qu&aacute; xa lạ. Nhưng kh&ocirc;ng phải ai cũng biết c&aacute;ch xả v&agrave; siết đ&uacute;ng c&aacute;ch. Xả v&agrave; siết sai c&aacute;ch kh&ocirc;ng những kh&ocirc;ng mang lại hiệu quả như mong đợi m&agrave; c&ograve;n khiến gymer tự &ldquo;giết chết&rdquo; c&aacute;c sợi cơ của m&igrave;nh.</p>\r\n\r\n<p>Một trong những sai lầm phổ biến thường gặp khi gymer bước v&agrave;o giai đoạn xả v&agrave; siết cơ đ&oacute; ch&iacute;nh l&agrave; qu&aacute; tự tin v&agrave;o c&aacute;ch tăng c&acirc;n, tăng cơ nhưng sự thực lại tăng đồng thời cả mỡ thừa, hoặc &aacute;p dụng c&aacute;c c&aacute;ch giảm c&acirc;n, giảm cơ sai c&aacute;ch khiến cơ bắp cũng giảm theo.</p>\r\n\r\n<p>V&igrave; vậy, muốn xả v&agrave; siết cơ th&agrave;nh c&ocirc;ng, gymer cần phải hiểu r&otilde; những điểm cần lưu &yacute; dưới đ&acirc;y.</p>\r\n\r\n<h2><strong>Hiểu đ&uacute;ng về xả cơ v&agrave; siết cơ</strong></h2>\r\n\r\n<p><em><strong>1. Xả cơ l&agrave; g&igrave;?</strong></em></p>\r\n\r\n<p>Xả cơ l&agrave; qu&aacute; tr&igrave;nh bạn li&ecirc;n tục nạp một lượng lớn calo v&agrave;o cơ thể, nhiều hơn rất nhiều so với mức b&igrave;nh thường. Đồng thời, thay đổi phương ph&aacute;p tập luyện để k&iacute;ch th&iacute;ch sự ph&aacute;t triển tối đa của c&aacute;c nh&oacute;m cơ. Tuy nhi&ecirc;n, bạn cần chọn lọc lượng tinh bột v&agrave; chất b&eacute;o nạp v&agrave;o cơ thể, hạn chế tối đa dầu mỡ.</p>\r\n\r\n<p>Bạn cần quan t&acirc;m tới chỉ số trao đổi chất BMR (Basal Metabolic Rate) trong thời gian xả cơ để tr&aacute;nh tăng mỡ kh&ocirc;ng mong muốn. Bạn chỉ n&ecirc;n tăng 500 calories nạp v&agrave;o cơ thể trong tuần đầu. Sau đ&oacute; theo sự thay đổi của cơ thể để c&oacute; sự điều chỉnh tăng giảm ph&ugrave; hợp hơn.</p>\r\n\r\n<p><em><strong>2. Siết cơ l&agrave; g&igrave;?</strong></em></p>\r\n\r\n<p>Siết cơ l&agrave; thời điểm bạn bước v&agrave;o qu&aacute; tr&igrave;nh tập luyện nghi&ecirc;m t&uacute;c để cắt giảm lượng chất b&eacute;o đ&atilde; dung nạp thoải m&aacute;i, duy tr&igrave; cơ bắp đ&atilde; được h&igrave;nh th&agrave;nh, từ đ&oacute; tăng cường h&igrave;nh th&agrave;nh đường n&eacute;t tr&ecirc;n cơ bắp một c&aacute;ch r&otilde; rệt cho đến khi cơ thể chỉ bao gồm nạc v&agrave; cơ bắp săn chắc.</p>\r\n\r\n<p>Bạn n&ecirc;n cắt giảm 300 calo mỗi ng&agrave;y khi mới bắt đầu siết cơ. T&ugrave;y theo mục đ&iacute;ch m&agrave; điều chỉnh chế độ ăn nhưng lu&ocirc;n phải ch&uacute; &yacute; cung cấp đạm để nu&ocirc;i dưỡng cơ trong qu&aacute; tr&igrave;nh siết.</p>\r\n\r\n<h2><strong>Chế độ dinh dưỡng khi siết cơ giảm mỡ</strong></h2>\r\n\r\n<p>Nguy&ecirc;n tắc h&agrave;ng đầu bạn bắt buộc cần ghi nhớ khi bước v&agrave;o qu&aacute; tr&igrave;nh siết cơ ch&iacute;nh l&agrave; kh&ocirc;ng cắt bỏ ho&agrave;n to&agrave;n nguồn dinh dưỡng mỗi ng&agrave;y, kể cả việc uống thực phẩm bổ sung, ngoại trừ trường hợp bạn muốn mất đi nhiều cơ bắp trong thời gian rất ngắn.</p>\r\n\r\n<p>B&ecirc;n cạnh đ&oacute;, bạn phải ch&uacute; &yacute; giảm đi h&agrave;m lượng calo nạp v&agrave;o cơ thể mỗi ng&agrave;y. Trung b&igrave;nh mỗi ng&agrave;y n&ecirc;n giảm khoảng 100-150 calo. C&aacute;c HLV chuy&ecirc;n nghiệp khuy&ecirc;n bạn chỉ n&ecirc;n giảm 1-2kg mỗi th&aacute;ng v&igrave; giảm mỡ qu&aacute; nhanh sẽ l&agrave;m mất cơ bắp nhanh.</p>\r\n\r\n<p><strong>3 nguồn dinh dưỡng ch&iacute;nh cần quan t&acirc;m khi siết cơ:</strong></p>\r\n\r\n<ul>\r\n	<li>Carbohydrate: 1gr carb cung cấp 4 calo</li>\r\n	<li>Lipid/chất b&eacute;o: 1gr chất b&eacute;o cung cấp 9 calo</li>\r\n	<li>Protein/chất đạm: 1gr protein cung cấp 4 calo</li>\r\n</ul>\r\n\r\n<p>D&ugrave; carbs v&agrave; protein cung cấp năng lượng như nhau nhưng mục đ&iacute;ch sử dụng kh&aacute;c nhau: Carb chủ yếu l&agrave; cung cấp năng lượng, c&ograve;n protein th&igrave; hỗ trợ x&acirc;y dựng c&aacute;c m&ocirc; cơ bắp. Ngo&agrave;i ra, cần phải bổ sung đầy đủ c&aacute;c loại vitamin, kho&aacute;ng chất từ rau củ, tr&aacute;i c&acirc;y&hellip; Tập trung v&agrave;o vitamin C, vitamin nh&oacute;m B (gi&uacute;p chuyển h&oacute;a năng lượng), omega-3, dầu c&aacute;&hellip;</p>\r\n\r\n<p>C&aacute;ch tốt nhất l&agrave; chia nhỏ thực đơn 6 bữa/ ng&agrave;y để gi&uacute;p đảm bảo năng lượng được ph&acirc;n bổ xuy&ecirc;n suốt cả ng&agrave;y, hạn chế năng lượng dư thừa t&iacute;ch mỡ. Đồng thời cần lưu &yacute;:</p>\r\n\r\n<ul>\r\n	<li>Trước khi tập, ăn uống đủ dưỡng chất</li>\r\n	<li>Sau khi tập, n&ecirc;n ăn bổ sung th&ecirc;m protein (đạm), giảm carbs (tinh bột, đường), mỡ động vật, bổ sung th&ecirc;m rau xanh&hellip;</li>\r\n	<li>Trước khi đi ngủ khoảng 30 ph&uacute;t, c&oacute; thể d&ugrave;ng 1 bữa nhỏ với c&aacute;c thực phẩm chứa nhiều protein (kh&ocirc;ng c&oacute; mỡ, carbs).</li>\r\n</ul>\r\n\r\n<h2>Phương ph&aacute;p luyện tập trong giai đoạn siết cơ</h2>\r\n\r\n<p>Thời gian trung b&igrave;nh n&ecirc;n luyện tập khi siết cơ l&agrave; từ 60-90 ph&uacute;t n&ecirc;n kết hợp 3 phương ph&aacute;p: Weight training, Bodyweight training v&agrave; Cardio training.</p>\r\n\r\n<h3>Tập Cardio (b&agrave;i tập tim mạch)</h3>\r\n\r\n<p>N&ecirc;n thực hiện từ 3-5 lần/ tuần. Bạn c&oacute; thể tập từ 8-12 giờ trước buổi tập tạ. Tập Cardio n&ecirc;n thực hiện với cường độ cao nhưng kh&ocirc;ng qu&aacute; 20 ph&uacute;t/lượt. Việc n&agrave;y sẽ gi&uacute;p đốt ch&aacute;y mỡ, giảm mỡ siết cơ v&agrave; giảm sự suy nhược của tế b&agrave;o cơ.</p>\r\n\r\n<h3>Weight training (chuyển động đa khớp)</h3>\r\n\r\n<p>Đ&acirc;y l&agrave; c&aacute;ch tập tăng cơ giảm mỡ hiệu quả v&igrave; gi&uacute;p k&iacute;ch th&iacute;ch nhiều cơ bắp cũng như đốt nhiều calories. Những b&agrave;i tập như squats, deadlift, bench press (đẩy ngực) hay over head press (đẩy vai) sẽ đ&oacute;ng vai tr&ograve; rất l&agrave; quan trọng trong qu&aacute; tr&igrave;nh siết cơ của c&aacute;c bạn.</p>\r\n\r\n<h3>Bodyweight training</h3>\r\n\r\n<p>N&ecirc;n xếp những b&agrave;i body weight v&agrave;o những b&agrave;i tập cuối trong chương tr&igrave;nh tập bởi v&igrave; ban đầu buổi tập, khi cơ thể khoẻ nhất th&igrave; ch&uacute;ng ta n&ecirc;n tập tạ đầu ti&ecirc;n.</p>\r\n\r\n<p>H&atilde;y nhớ rằng muốn siết cơ th&agrave;nh c&ocirc;ng nhất định phải biết c&aacute;ch xả cơ hiệu quả. Thiếu một trong hai bạn sẽ kh&oacute; c&oacute; thể đạt được c&aacute;c chỉ số mẫu mực của h&igrave;nh thể đẹp.</p>', '2020-05-08 11:23:48', 1, 1, '2020-05-08 11:24:00');
INSERT INTO `articles` (`id`, `a_name`, `a_slug`, `a_hot`, `a_active`, `a_menu_id`, `a_view`, `a_description`, `a_avatar`, `a_content`, `created_at`, `a_position_2`, `a_position_1`, `updated_at`) VALUES
(9, 'Bật mí 5 điều bạn chưa biết về EAA - BCAA', 'bat-mi-5-dieu-ban-chua-biet-ve-eaa-bcaa', 1, 1, 3, 0, 'Tìm hiểu sản phẩm', '2020-05-08__1026-catalog-bat-mi-5-dieu-ban-chua-biet-ve-eaa-phien-ban-nang-cap-cua-bcaa-main-1587725903.png', '<p>EAA l&agrave; một c&aacute;i t&ecirc;n đang được nhiều người đặc biệt l&agrave; Gymer nhắc đến nhiều nhất hiện nay. Vậy EAA l&agrave; g&igrave; m&agrave; &ldquo;hot&rdquo; vậy? B&agrave;i viết sau đ&acirc;y sẽ bật m&iacute; cho bạn&nbsp;<strong>5 điều bạn chưa biết về EAA</strong>, gi&uacute;p bạn c&oacute; c&aacute;i nh&igrave;n tổng quan hơn v&agrave; c&oacute; được kiến thức cơ bản nhất về EAA.</p>\r\n\r\n<p><strong><em>1. EAA l&agrave; g&igrave;?</em></strong></p>\r\n\r\n<p>EAA l&agrave; t&ecirc;n gọi tắt của&nbsp;Essential Amino Acids- l&agrave; một phi&ecirc;n bản n&acirc;ng cấp của BCAA, chứa 9 loại amino acid thiết yếu bao gồm cả BCAA.</p>\r\n\r\n<p>Amino axit ch&iacute;nh l&agrave; th&agrave;nh phần cấu tạo n&ecirc;n Protein trong cơ thể, cấu tạo n&ecirc;n cơ thể sống v&agrave; c&oacute; vai tr&ograve; rất quan trọng trong qu&aacute; tr&igrave;nh trao đổi chất của tế b&agrave;o.</p>\r\n\r\n<p>Protein được cấu tạo từ 22 loại&nbsp;<a href=\"https://www.wheystore.vn/c161/amino-acid\">amino acid</a>&nbsp;kh&aacute;c nhau trong đ&oacute; c&oacute; 13 loại l&agrave; cơ thể c&oacute; thể tự tổng hợp được c&ograve;n 9 loại cơ thể kh&ocirc;ng tự tổng hợp được gọi l&agrave; EAA. Do cơ thể kh&ocirc;ng tự tổng hợp được n&ecirc;n c&aacute;c axit amin thiết yếu n&agrave;y cần phải bổ sung thường xuy&ecirc;n qua việc ăn uống c&aacute;c thực phẩm từ tự nhi&ecirc;n v&agrave; d&ugrave;ng th&ecirc;m thực phẩm bổ sung.</p>\r\n\r\n<p><strong><em>2. Th&agrave;nh phần trong EAA</em></strong></p>\r\n\r\n<p>EAA bao gồm 9 loại amino acid thiết yếu sau: Leucine, Isoleucine, Valine, Tryptophan, Histidine, Threonine, Methionine, Lysine, Phenylalanine.</p>\r\n\r\n<p><em>Phenylalanine</em></p>\r\n\r\n<p>Đ&acirc;y l&agrave; axit amin thiết yếu kh&ocirc;ng ph&acirc;n cực do nh&aacute;nh Benzyl c&oacute; t&iacute;nh kị nước, c&oacute; t&iacute;nh năng chống trầm cảm, giảm đau v&agrave; c&oacute; vai tr&ograve; rất quan trọng trong cấu tr&uacute;c, chức năng của protein v&agrave; enzyme.</p>\r\n\r\n<p><em>Valine</em></p>\r\n\r\n<p>Đ&acirc;y l&agrave; một trong 3 axit amin dạng chuỗi, gi&uacute;p k&iacute;ch th&iacute;ch cơ bắp, t&aacute;i tạo cơ bắp bị tổn thương. Đồng thời, Valine c&ograve;n gi&uacute;p cải thiện chứng hồi hộp, mất ngủ v&agrave; gi&uacute;p điều h&ograve;a hệ thống miễn dịch của cơ thể.</p>\r\n\r\n<p>Amino Acid Valine đ&atilde; được chứng minh l&agrave; c&oacute; t&aacute;c dụng tốt trong việc giảm bớt c&aacute;c rối loạn cơ bắp, phục hồi c&aacute;c m&ocirc; cơ, tăng sức bền trong qu&aacute; tr&igrave;nh tập luyện n&ecirc;n được sử dụng nhiều trong lĩnh vực thể h&igrave;nh, thể dục thể thao.</p>\r\n\r\n<p><em>Threonine</em></p>\r\n\r\n<p>Axit amin n&agrave;y l&agrave; một th&agrave;nh phần ch&iacute;nh của c&aacute;c protein cấu tr&uacute;c như Collagen v&agrave; c&aacute;c sợi Elastin cấu tạo n&ecirc;n da v&agrave; c&aacute;c m&ocirc; dưới da. Ngo&agrave;i ra, Threonine cũng đ&oacute;ng vai tr&ograve; trong chuyển h&oacute;a chất b&eacute;o v&agrave; n&acirc;ng cao chức năng hệ miễn dịch cho cơ thể.</p>\r\n\r\n<p>Amino Acid Threonine thường được sử dụng trong việc điều trị c&aacute;c chứng rối loạn hệ thần kinh kh&aacute;c nhau như co cứng cột sống, đa xơ cứng.</p>\r\n\r\n<p><em>Tryptophan</em></p>\r\n\r\n<p>Amino Acid Tryptophan c&oacute; nguồn gốc từ thực vật v&agrave; cần thiết cho qu&aacute; tr&igrave;nh sinh tỏng hợp protein. Sau khi được ti&ecirc;u thụ th&igrave; Tryptophan sẽ được chuyển h&oacute;a th&agrave;nh 4 chất sau: Serotonin, Melatonin,&nbsp;Kynurenine v&agrave; Vitamin Niacin. Trong đ&oacute; Serotonin c&oacute; chức năng điều chỉnh giấc ngủ v&agrave; t&acirc;m trạng của bạn.</p>\r\n\r\n<p>Amino axit n&agrave;y rất cần thiết trong việc duy tr&igrave; sự c&acirc;n bằng nitơ ở mức độ ph&ugrave; hợp.</p>\r\n\r\n<p><em>Methionine</em></p>\r\n\r\n<p>Axit amin n&agrave;y được t&igrave;m thấy trong sữa, thịt, c&aacute;, trứng v&agrave; đ&oacute;ng vai tr&ograve; rất quan trọng trong nhiều chức năng của tế b&agrave;o.</p>\r\n\r\n<p>Methionine ngăn ngừa tổn thương gan trong trường hợp bị ngộ độc Paracatamol, đồng thời n&oacute; cũng gi&uacute;p tăng acid nước tiểu, điều trị rối loạn gan, cải thiện vết thương v&agrave; đ&oacute;ng vai tr&ograve; lớn trong việc ph&aacute;t triển c&aacute;c m&ocirc; gi&uacute;p cơ thể hấp thu kẽm v&agrave; selen tốt hơn.</p>\r\n\r\n<p><em>Leucine</em></p>\r\n\r\n<p>Leucine l&agrave; một axit amin chuỗi nh&aacute;nh quan trong nhất trong BCAA, gi&uacute;p tổng hợp protein, phục hồi cơ bắp bị tổn thương. B&ecirc;n cạnh đ&oacute;, Leucine c&ograve;n gi&uacute;p điều chỉnh lượng đường trong m&aacute;u, k&iacute;ch th&iacute;ch chữa l&agrave;nh c&aacute;c tổn thương b&ecirc;n ngo&agrave;i da v&agrave; tham gia v&agrave;o qu&aacute; tr&igrave;nh sản xuất Hormone tăng trưởng.</p>\r\n\r\n<p><em>Isoleucine</em></p>\r\n\r\n<p>Đ&acirc;y l&agrave; amino acid cuối c&ugrave;ng trong BCAA &ndash; nh&oacute;m bộ 3 axit amin dạng chuỗi. Isoleucine tập trung nhiều ở c&aacute;c m&ocirc; cơ gi&uacute;p chuyển h&oacute;a cơ bắp v&agrave; sản xuất huyết sắc tố.</p>\r\n\r\n<p><em>Lysine</em></p>\r\n\r\n<p>Đ&acirc;y l&agrave; một axit amin gi&uacute;p cơ thể ph&aacute;t triển to&agrave;n diện, vận chuyển chất b&eacute;o qua c&aacute;c tế b&agrave;o để đốt ch&aacute;y năng lượng. Ngo&agrave;i ra n&oacute; cũng tham gia v&agrave;o qu&aacute; tr&igrave;nh sản xuất Collagen, Elastin, Hormone v&agrave; Enzyme gi&uacute;p hấp thụ canxi tốt.</p>\r\n\r\n<p>L &ndash; lysine l&agrave; dạng m&agrave; cơ thể c&oacute; thể hấp thụ v&agrave; được t&igrave;m thấy trong thực phẩm tự nhi&ecirc;n&nbsp; như: thịt b&ograve;, thịt g&agrave;, trứng, đậu trắng, &hellip; hoặc trong c&aacute;c thực phẩm bổ sung.</p>\r\n\r\n<p><em>Histidine</em></p>\r\n\r\n<p>Đ&acirc;y l&agrave; một axit amin cần thiết cho sự ph&aacute;t triển, h&igrave;nh th&agrave;nh tế b&agrave;o m&aacute;u v&agrave; qu&aacute; tr&igrave;nh sửa chữa c&aacute;c m&ocirc; cơ. Ngo&agrave;i ra, Histidine c&ograve;n tham gia v&agrave;o qu&aacute; tr&igrave;nh sản xuất Histamine &ndash; một chất dẫn truyền thần kinh quan trọng đối với hệ miễn dịch v&agrave; khả năng ti&ecirc;u h&oacute;a.</p>\r\n\r\n<p><strong><em>3. T&aacute;c dụng của EAA</em></strong></p>\r\n\r\n<p><em>Cải thiện hiệu suất luyện tập</em></p>\r\n\r\n<p>EAA bao gồm cả BCAA &ndash; bộ 3 amino acid gi&uacute;p cải thiện hiệu suất luyện tập, hỗ trợ phục hồi cơ bắp bị tổn thương trong qu&aacute; tr&igrave;nh tập luyện nhanh hơn v&agrave; giảm bớt mệt mỏi cho người d&ugrave;ng.</p>\r\n\r\n<p><em>Cải thiện t&acirc;m trạng v&agrave; giấc ngủ</em></p>\r\n\r\n<p>EAA bao gồm Tryptophan l&agrave; tiền th&acirc;n của Serotonin &ndash; một chất quan trọng trong việc điều chỉnh giấc ngủ v&agrave; t&acirc;m trạng của con người, cải thiện chứng mất ngủ, hồi hộp hay lo lắng.</p>\r\n\r\n<p><em>EAA rất tốt cho người bị bệnh gan, gout, thận</em></p>\r\n\r\n<p>C&oacute; thể n&oacute;i EAA được sinh ra l&agrave; để d&agrave;nh ri&ecirc;ng cho những người bị gout, tốt cho người bị yếu thận hoặc bệnh thận v&igrave; n&oacute; ho&agrave;n to&agrave;n kh&ocirc;ng c&oacute; chứa Purin. EAA l&agrave; c&aacute;c amin dạng free form cho n&ecirc;n cũng rất tốt cho gan.</p>\r\n\r\n<p><em>Ngăn ngừa t&igrave;nh trạng mất cơ bắp</em></p>\r\n\r\n<p>Khi cơ thể &iacute;t vận động, kh&ocirc;ng tập trong một thời gian d&agrave;i sẽ khiến c&aacute;c cơ bắp bị ch&ugrave;ng nh&atilde;o. Việc bổ sung đầy đủ axit amin cho cơ thể sẽ gi&uacute;p ngăn ngừa t&igrave;nh trạng mất cơ bắp v&agrave; bảo to&agrave;n khối lượng cơ.</p>\r\n\r\n<p><em>Phụ hồi cơ bắp</em></p>\r\n\r\n<p>Trong EAA c&oacute; chứa BCAA -&nbsp; bộ 3 axit amin mạch nh&aacute;nh l&agrave; Leucine, Isoleucine v&agrave; Valine gi&uacute;p sửa chữa, phục hồi cơ bắp bị tổn thương trong qu&aacute; tr&igrave;nh tập luyện, ngăn chặn t&igrave;nh trạng dị h&oacute;a cơ bắp đưa cơ bắp về trạng th&aacute;i đồng h&oacute;a.</p>\r\n\r\n<p><strong><em>4. C&aacute;ch sử dụng EAA</em></strong></p>\r\n\r\n<p>EAA c&oacute; thể uống v&agrave;o bất k&igrave; thời gian n&agrave;o bạn muốn. Tuy nhi&ecirc;n, thời điểm l&yacute; tưởng nhất để bổ sung EAA ch&iacute;nh l&agrave; buổi sang sau khi thức dậy; trước, trong v&agrave; sau khi tập.</p>\r\n\r\n<p><strong><em>5. EAA c&oacute; ở đ&acirc;u?</em></strong></p>\r\n\r\n<p>Ch&uacute;ng ta c&oacute; thể dễ d&agrave;ng bổ sung EAA bằng một chế độ ăn gi&agrave;u protein từ c&aacute;c loại thực phẩm như: thịt, trứng, đậu, c&aacute;c loại hạt (quinoa, buckwheat, &hellip;), c&aacute;c loại hải sản, &hellip;</p>\r\n\r\n<p>Ngo&agrave;i ra, bạn cũng c&oacute; thể bổ sung th&ecirc;m EAA từ thực phẩm bổ sung&nbsp;<a href=\"https://www.wheystore.vn/nutrex-eaa-hydration-30-servings.html\">EAA Hydration</a>&nbsp;của h&atilde;ng Nutrex.</p>', '2020-05-08 11:25:44', 1, 1, '2020-05-08 11:27:15'),
(10, 'Hướng dẫn cách dùng Impact Whey Isolate hiệu quả nhất', 'huong-dan-cach-dung-impact-whey-isolate-hieu-qua-nhat', 1, 1, 3, 0, 'Tìm hiểu sản phẩm', '2020-05-08__908-catalog-huong-dan-cach-dung-impact-whey-isolate-hieu-qua-nhat-main-1587725841.png', '<p>Impact Whey Isolate l&agrave; sự lựa chọn tuyệt vời d&agrave;nh cho bạn nếu bạn đang đi t&igrave;m một sản phẩm chứa h&agrave;m lượng Whey tinh khiết v&agrave; hấp thụ nhanh. Đối với những người lần đầu ti&ecirc;n khi mua Impact Whey Protein thường chưa biết c&aacute;ch sử dụng sao cho đ&uacute;ng. B&agrave;i viết sau đ&acirc;y sẽ hướng dẫn&nbsp;<strong>c&aacute;ch d&ugrave;ng Impact Whey Isolate</strong>&nbsp;đạt hiệu quả cao nhất.</p>\r\n\r\n<p><strong>Tổng quan về Impact Whey Isolate của Myprotein</strong></p>\r\n\r\n<p>Whey Isolate l&agrave; loại Whey cao cấp v&agrave; an to&agrave;n nhất. Impact Whey Isolate l&agrave; một loại&nbsp;<strong><a href=\"https://www.wheystore.vn/c152/whey-protein-tang-co\">bột Whey Protein</a>&nbsp;</strong>được sản xuất v&agrave; ph&acirc;n phối bởi h&atilde;ng thực phẩm bổ sung Myprotein. Đ&acirc;y l&agrave; một loại protein được sản xuất từ sữa, đ&atilde; loại bỏ hết tạp chất, chỉ c&ograve;n lại&nbsp;<strong>100% Whey Isolate</strong>, hỗ trợ tăng cơ nạc đồng thời cũng c&oacute; vai tr&ograve; giảm mỡ, giảm c&acirc;n hiệu quả.</p>\r\n\r\n<p>C&aacute;c sản phẩm của My Protein được sản xuất ra với chất lượng tuyệt hảo nhưng gi&aacute; th&agrave;nh lại rẻ hơn rất nhiều so với c&aacute;c đối thủ cạnh tranh kh&aacute;c. Ch&iacute;nh điều n&agrave;y đ&atilde; gi&uacute;p My Protein trở th&agrave;nh một cơn sốt của thực phẩm thể thao thế giới.</p>\r\n\r\n<p>Nếu kh&ocirc;ng tin, bạn h&atilde;y thử v&agrave;o trang&nbsp;<a href=\"https://labdoor.com/rankings/protein\" target=\"_blank\">https://labdoor.com/rankings/protein</a>&nbsp;để xem top 10 loại protein đang Hot nhất, trong đ&oacute; c&oacute; Impact Whey Isolate.</p>\r\n\r\n<h2><strong>Vậy, c&aacute;ch d&ugrave;ng Impact Whey Isolate như thế n&agrave;o?</strong></h2>\r\n\r\n<p><strong><em>Liều d&ugrave;ng v&agrave; c&aacute;ch pha</em></strong></p>\r\n\r\n<p>Mỗi serving pha với 200ml nước lọc hoặc pha với sữa tươi t&aacute;ch b&eacute;o để gia tăng h&agrave;m lượng protein hỗ trợ tăng cơ tốt hơn. Bạn n&ecirc;n cho bột v&agrave; nước lọc v&agrave;o trong b&igrave;nh shacke lắc đều, để bột được h&ograve;a tan tốt hơn. Khi uống cho th&ecirc;m v&agrave;i vi&ecirc;n đ&aacute; v&agrave;o uống sẽ ngon v&agrave; dễ uống hơn.</p>\r\n\r\n<p>Bạn cũng c&oacute; thể pha 1 muỗng Impact Whey Isolate với chuối, sữa chua, hoa quả bạn th&iacute;ch, yến mạch, &hellip; Cho nguy&ecirc;n liệu v&agrave;o trong m&aacute;y sinh tố để tạo th&agrave;nh những cốc sinh tố whey thơm ngon, gi&agrave;u chất dinh dưỡng, hỗ trợ qu&aacute; tr&igrave;nh x&acirc;y dựng cơ bắp tối ưu.</p>\r\n\r\n<p>Ngo&agrave;i ra, Impact Whey Isolate cũng c&oacute; thể sử dụng kết hợp với&nbsp;<strong><a href=\"https://www.wheystore.vn/creatine\">Creatine</a></strong>&nbsp;v&agrave; BCAA để qu&aacute; tr&igrave;nh tập luyện v&agrave; ph&aacute;t triển cơ bắp được diễn ra tốt hơn.</p>\r\n\r\n<p><strong><em>Thời gian sử dụng</em></strong></p>\r\n\r\n<p>Đối với những người mới sử dụng, thời điểm tốt nhất để d&ugrave;ng Impact Whey Isolate l&agrave; trước khi tập luyện v&agrave; sau khi tập luyện trong v&ograve;ng 1 giờ.</p>\r\n\r\n<p>Mục đ&iacute;ch của việc uống whey trước khi tập l&agrave; để nạp&nbsp;<strong><a href=\"https://www.wheystore.vn/c161/amino-acid\">BCAA</a></strong>&nbsp;chống dị h&oacute;a cơ bắp, ngăn chặn t&igrave;nh trạng mất cơ bắp v&agrave; Glutamine giảm đau nhức v&agrave; hỗ trợ phục hồi cơ bắp tốt hơn.</p>\r\n\r\n<p>C&ograve;n, mục đ&iacute;ch của việc bổ sung&nbsp;<strong>Whey Protein</strong>&nbsp;ngay sau khi tập luyện l&agrave; để cơ thể c&oacute; nguồn protein đi nu&ocirc;i cơ bắp, gi&uacute;p cơ bắp được phục hồi nhanh nhất. Đ&acirc;y l&agrave; thời điểm quan trọng nhất để bổ sung protein.</p>\r\n\r\n<p>Sau 1 tuần, bạn c&oacute; thể uống th&ecirc;m 1 lần v&agrave;o buổi s&aacute;ng ngay sau khi thức dậy bởi l&uacute;c n&agrave;y cơ thể đ&atilde; trải qua một đ&ecirc;m d&agrave;i 8 tiếng kh&ocirc;ng được bổ sung bất kỳ chất dinh dưỡng n&agrave;o để nu&ocirc;i dưỡng cơ bắp.</p>\r\n\r\n<p>Như vậy, để đạt kết quả tối ưu nhất th&igrave; ng&agrave;y c&aacute;c bạn uống ng&agrave;y 3 lần: buổi s&aacute;ng sau khi ngủ dậy, uống trước v&agrave; sau khi tập luyện.</p>\r\n\r\n<p><img alt=\"Hướng dẫn cách dùng Impact Whey Isolate hiệu quả nhất - Ảnh 1\" src=\"https://cdn.wheystore.vn/upload/news_optimize/wst_908_huong_dan_cach_dung_impact_whey_isolate_hieu_qua_nhat_image_1587725841_1.jpg\" title=\"Hướng dẫn cách dùng Impact Whey Isolate hiệu quả nhất - Ảnh 1\" /></p>\r\n\r\n<h2><strong>Sản phẩm Impact Whey Isolate c&oacute; tốt kh&ocirc;ng?</strong></h2>\r\n\r\n<p>Impact Whey Isolate l&agrave; một trong những loại Whey tốt nhất, chất lượng cao hiện nay v&agrave; b&aacute;n chạy nhất tr&ecirc;n thị trường với gi&aacute; rẻ nhất, được đ&oacute;ng g&oacute;i v&agrave; ni&ecirc;m phong nguyển vẹn tại nh&agrave; m&aacute;y sản xuất hiện đại.</p>\r\n\r\n<p>B&ecirc;n cạnh đ&oacute; c&ograve;n c&oacute; nhiều hương vị thơm ngon v&agrave; hấp dẫn. H&atilde;ng Myprotein đ&atilde; v&agrave; đang cập nhật đưa ra thị trường nhiều hương vị thơm ngon, hấp dẫn nhất để kh&aacute;ch h&agrave;ng c&oacute; thể lựa chọn theo sở th&iacute;ch của m&igrave;nh.&nbsp;<a href=\"https://wheystore.vn/impact-whey-isolate-11lbs-5kg-1073.html\"><strong>Myprotein Impact Whey Isolate</strong></a><strong>&nbsp;</strong>hiện đang c&oacute; tổng cộng l&agrave; 11 vị v&agrave; trong tương lai sẽ c&oacute; nhiều vị hơn nữa.</p>\r\n\r\n<p>C&oacute; nhiều hương vị thơm, ngon để c&aacute;c bạn lựa chọn như: Caf&eacute; Lette, Chocolate Orange, Vanilla, Cookies &amp; Cream, Tripple Chocolte, &hellip;</p>\r\n\r\n<p>Tr&ecirc;n đ&acirc;y l&agrave; hướng dẫn về&nbsp;<strong>c&aacute;ch d&ugrave;ng Impact Whey Isolate</strong>&nbsp;chuẩn nhất v&agrave; đạt hiệu quả nhất. Đ&acirc;y l&agrave; một sản phẩm chất lượng, gi&aacute; sinh vi&ecirc;n ph&ugrave; hợp với nhiều người. C&aacute;c bạn c&ograve;n thắc mắc hay c&oacute; c&acirc;u hỏi g&igrave; cần giải đ&aacute;p li&ecirc;n quan đến Myprotein Impact Whey Isolate th&igrave; h&atilde;y để lại coment b&ecirc;n dưới hoặc nhắn tin, ch&uacute;ng t&ocirc;i sẽ trả lời trong thời gian sớm nhất.</p>', '2020-05-08 11:27:04', 1, 1, '2020-05-08 11:27:20'),
(11, 'Cách sử dụng Mutant CreaKong đạt hiệu quả tối ưu nhất', 'cach-su-dung-mutant-creakong-dat-hieu-qua-toi-uu-nhat', 1, 1, 3, 0, 'Tìm hiểu sản phẩm', '2020-05-08__875-catalog-cach-su-dung-mutant-creakong-dat-hieu-qua-toi-uu-nhat-main-1587725826.jpg', '<p>CreaKong của thương hiệu Mutant l&agrave; một sản phẩm bổ sung Creatine tốt, nổi tiếng được nhiều người tin d&ugrave;ng để tăng sức mạnh cơ bắp v&agrave; th&uacute;c đẩy cơ bắp ph&aacute;t triển. Sau đ&acirc;y, Wheystore sẽ hướng dẫn<strong>&nbsp;c&aacute;ch sử dụng Creakong&nbsp;</strong>để đạt hiệu quả tối ưu nhất.</p>\r\n\r\n<p><strong>Giới thiệu chung về CreaKong</strong></p>\r\n\r\n<p>Creatine đ&atilde; được chứng minh l&agrave; cần thiết cho việc tập luyện thể h&igrave;nh, thể thao thường xuy&ecirc;n với cường độ cao với mục đ&iacute;ch ch&iacute;nh l&agrave; tăng sức mạnh v&agrave; tăng cường cơ bắp.</p>\r\n\r\n<p>CreaKong của h&atilde;ng thực phẩm bổ sung Mutant c&ograve;n hơn thế, với sự kết hợp của 3 dạng&nbsp;<a href=\"https://www.wheystore.vn/creatine\"><strong>Creatine</strong>&nbsp;</a>h&agrave;ng đầu gi&uacute;p tăng sức mạnh vượt trội v&agrave; th&uacute;c đẩy cơ bắp ph&aacute;t triển tối ưu.</p>\r\n\r\n<p>Mutant CreaKong chứa&nbsp;<strong>3 dạng Creatine</strong>&nbsp;mạnh mẽ h&agrave;ng đầu, với tốc độ hấp thu nhanh chậm kh&aacute;c nhau v&agrave; đi v&agrave;o cơ thể bằng con đường kh&aacute;c nhau, đ&oacute; l&agrave;:</p>\r\n\r\n<p><strong><em>Creatine Monohydrate</em></strong></p>\r\n\r\n<p>Đ&acirc;y l&agrave; loại Creatine phổ biến nhất bởi t&iacute;nh đơn giản v&agrave; hiệu quả của n&oacute;, chứa 88% Creatine tinh khiết, nguy&ecirc;n chất, gi&uacute;p cải thiện sức mạnh cơ bắp, gia tăng sức bền, tập l&acirc;u hơn, tập khỏe hơn v&agrave; k&iacute;ch th&iacute;ch cơ bắp ph&aacute;t triển.</p>\r\n\r\n<p><strong><em>Creatine Magnesium Chelate</em></strong></p>\r\n\r\n<p>L&agrave; một dạng mới n&acirc;ng cao hơn so với Creatine. Magie c&oacute; nhiều t&aacute;c dụng đối với Creatine. N&oacute; được chứng minh c&oacute; khả năng tăng cường sức mạnh, bổ sung năng lượng, li&ecirc;n quan mật thiết đến qu&aacute; tr&igrave;nh năng lượng v&agrave; c&oacute; chức năng bảo vệ tim mạch.</p>\r\n\r\n<p>Đối với một số người, khi sử dụng Creatine sẽ cảm thấy kh&oacute; chịu trong dạ d&agrave;y, bị đầy hơi do tỷ lệ hấp thụ thấp hơn v&agrave; ph&acirc;n hủy Creatine th&agrave;nh c&aacute;c sản phẩm phụ trong dạ d&agrave;y. Bằng c&aacute;ch tạo ra Creatine Magnesium Chelate bảo vệ Creatine khỏi m&ocirc;i trướng axit khắc nghiệt b&ecirc;n trong dạ d&agrave;y, từ đ&oacute; Creatine được kiềm h&oacute;a, hấp thu theo con đường kh&aacute;c v&agrave; dung nạp tốt hơn&nbsp;<strong><a href=\"https://www.wheystore.vn/mutant-creakong-300g.html\">Creatine Monohydrate</a></strong>, giảm sự kh&oacute; chịu của dạ d&agrave;y.</p>\r\n\r\n<p>Ngo&agrave;i ra, Creatine Magnesium Chelate c&ograve;n gi&uacute;p cải thiện tốc độ co cơ v&agrave; tăng khả năng tổng hợp protein cho cơ bắp.</p>\r\n\r\n<p><strong><em>Tri &ndash; Creatine Citrate</em></strong></p>\r\n\r\n<p>L&agrave; Creatine ngoại quan duy nhất cơ khả năng k&iacute;ch th&iacute;ch sản sinh ra ATP để tăng cường sức mạnh đồng thời đẩy nhanh sự gia tăng nồng độ của Creatine huyết tương sau khi uống v&agrave; tăng hiệu suất luyện tập l&ecirc;n tối đa.</p>\r\n\r\n<p>Thực phẩm bổ sung CreaKong của Mutant cung cấp 4g Creatine pha trộn trong mỗi muỗng, gi&uacute;p tạo ra năng lượng tức thời nhằm gia tăng sức mạnh cơ bắp n&acirc;ng tạ mạnh hơn, động t&aacute;c nhanh hơn v&agrave; tr&ocirc;ng cơ bắp d&agrave;y hơn nhờ khả năng t&iacute;ch nước.</p>\r\n\r\n<p><strong>C&aacute;ch sử dụng CreaKong để đạt hiệu quả tối ưu nhất</strong></p>\r\n\r\n<p>Creatine l&agrave; một chất bổ sung trước khi tập luyện d&agrave;nh cho người lớn đang luyện tập thể h&igrave;nh, thể dục thể thao với cường độ mạnh. Trước khi tập luyện 20 &ndash; 30 ph&uacute;t, h&atilde;y uống 1 muỗng Mutant Creakong pha với 8 &ndash; 12 oz nước tương đương với&nbsp; 240 &ndash; 360ml nước.</p>\r\n\r\n<p>Những ng&agrave;y kh&ocirc;ng tập luyện, th&igrave; pha 1 muỗng uống v&agrave;o buổi s&aacute;ng khi bụng c&ograve;n đ&oacute;i.</p>\r\n\r\n<p>Lưu &yacute;, để kh&ocirc;ng l&agrave;m mất đi h&agrave;m lượng Creatine th&igrave; c&aacute;c bạn kh&ocirc;ng được pha c&ugrave;ng với c&aacute;c loại nước c&oacute; chứa h&agrave;m lượng axit như: nước chanh, nước cam, &hellip;</p>\r\n\r\n<p>Thời điểm để Creatine hấp thu v&agrave;o cơ thể được nhiều nhất, tốt nhất th&igrave; c&aacute;c bạn n&ecirc;n uống v&agrave;o sau mỗi buổi tập v&agrave; d&ugrave;ng chung với&nbsp;<strong><a href=\"https://www.wheystore.vn/c152/whey-protein-tang-co\">Whey&nbsp;</a></strong>hoặc Carb để tăng khả năng hấp thụ.</p>\r\n\r\n<p><strong>Tại sao n&ecirc;n sử dụng Mutant CreaKong?</strong></p>\r\n\r\n<p>C&aacute;c bạn n&ecirc;n lựa chọn sản phẩm Mutant CreaKong để bổ sung Creatine cho cơ thể trong qu&aacute; tr&igrave;nh tập luyện. Bởi v&igrave;:</p>\r\n\r\n<p>Mutant CreaKong c&oacute; gi&aacute; th&agrave;nh hợp l&yacute;, mọi người đều c&oacute; thể sử dụng được. Mỗi ng&agrave;y, c&aacute;c bạn chỉ mất 5 ngh&igrave;n đồng l&agrave; đ&atilde; c&oacute; đủ Creatine để phục vụ qu&aacute; tr&igrave;nh luyện tập tốt hơn. Trong khi đ&oacute;, để bổ sung 4g Creatine từ thực phẩm tự nhi&ecirc;n th&igrave; cần phải ăn gần 1kg thịt b&ograve; hay 500g ph&ocirc; mai, &hellip; rất tốn k&eacute;m.</p>\r\n\r\n<p>Mutant CreaKong được tạo ra bởi c&ocirc;ng thức vượt trội với sự kết hợp của 3 dạng Creatine mạnh nhất.</p>\r\n\r\n<p>Thực phẩm bổ sung Mutant Creakong vừa gi&uacute;p c&aacute;c bạn tiết kiệm chi ph&iacute; lại vừa tiết kiệm được thời gian v&agrave; an to&agrave;n sức khỏe bởi th&agrave;nh phần Creatine đ&atilde; được chứng minh l&acirc;m s&agrave;ng.</p>\r\n\r\n<p>Tr&ecirc;n đ&acirc;y l&agrave; hước dẫn về&nbsp;<strong>c&aacute;ch sử dụng CreaKong</strong>&nbsp;d&agrave;nh cho những người lần đầu ti&ecirc;n mua v&agrave; sử dụng. Đ&acirc;y đ&uacute;ng l&agrave; một sản phẩm tốt d&agrave;nh cho c&aacute;c vận động vi&ecirc;n chuy&ecirc;n nghiệp, những người tham gia tập thể h&igrave;nh với cường độ nặng.</p>', '2020-05-08 11:28:48', 1, 1, '2020-05-08 11:29:00'),
(12, 'Điều gì sẽ xảy ra với cơ thể bạn khi sử dụng Steroids?', 'dieu-gi-se-xay-ra-voi-co-the-ban-khi-su-dung-steroids', 1, 1, 4, 0, 'Cách tăng cân, tăng cơ', '2020-05-08__1046-catalog-ieu-gi-se-xay-ra-voi-co-the-ban-khi-su-dung-steroids-main-1587725916.jpg', '<p>Nếu đ&atilde; biết về thể h&igrave;nh, chắc chắn bạn đ&atilde; từng nghe qua về cụm từ ti&ecirc;m steroids. Steroid giống như &ldquo;đường tắt&rdquo; gi&uacute;p bạn nhanh ch&oacute;ng ph&aacute;t triển cơ bắp như mong muốn m&agrave; kh&ocirc;ng cần phải quan t&acirc;m qu&aacute; nhiều đến việc bổ sung dinh dưỡng khắt khe v&agrave; tập luyện theo quy tr&igrave;nh nghi&ecirc;m ngặt.</p>\r\n\r\n<p>Vậy Steroid rốt cuộc l&agrave; g&igrave;? Ch&uacute;ng ta c&oacute; thể x&acirc;y dựng cơ bắp như thế n&agrave;o khi sử dụng steroid? N&oacute; c&oacute; t&aacute;c động ra sao đến cơ thể ch&uacute;ng ta khi sử dụng mỗi ng&agrave;y? V&agrave; liệu n&oacute; c&oacute; thực sự tồi tệ hay kh&ocirc;ng? C&ugrave;ng&nbsp;<a href=\"http://wheystore.vn/\"><strong>WheyStore.vn</strong></a>&nbsp;t&igrave;m hiểu trong b&agrave;i viết n&agrave;y nh&eacute;!</p>\r\n\r\n<p><strong>T&igrave;m hiểu về Steroids</strong></p>\r\n\r\n<p>Steroids l&agrave; những loại hormone tổng hợp được sử dụng trong ng&agrave;nh y khoa. Hiện nay, Steroids được ph&acirc;n ra gồm 2 loại bao gồm steroid đồng h&oacute;a (Anabolic steroids) v&agrave; corticosteroid.</p>\r\n\r\n<p>Tr&ecirc;n thực tế, thứ m&agrave; người ta vẫn thường sử dụng như 1&ldquo;vũ kh&iacute;&rdquo; gia tăng sức mạnh v&agrave; khối lượng cơ bắp vượt trội đ&oacute; ch&iacute;nh l&agrave; anabolic steroids. V&agrave; việc sử dụng steroids đồng h&oacute;a vẫn lu&ocirc;n l&agrave; chủ đề g&acirc;y nhiều tranh c&atilde;i.</p>\r\n\r\n<p>Steroids đồng h&oacute;a l&agrave; 1 loại thuốc c&oacute; t&aacute;c dụng k&iacute;ch th&iacute;ch tăng trưởng testosterone ở nam giới, tăng k&iacute;ch thước cơ bắp vượt trội, ảnh hưởng rất nhiều tới c&aacute;c qu&aacute; tr&igrave;nh h&oacute;a học xảy ra b&ecirc;n trong cơ thể, g&oacute;p phần k&iacute;ch th&iacute;ch tăng trưởng, t&igrave;nh dục, mọc r&acirc;u, l&ocirc;ng, t&oacute;c, k&iacute;ch th&iacute;ch c&aacute;c chức năng sinh l&yacute; của cơ thể, đồng thời ngăn ngừa chất b&eacute;o t&iacute;ch tụ, ph&aacute;t triển năng lượng v&agrave; cảm x&uacute;c.</p>\r\n\r\n<p><strong>Steroids ảnh hưởng tới cơ thể ch&uacute;ng ta như thế n&agrave;o?</strong></p>\r\n\r\n<p>Khu ch&uacute;ng ta n&acirc;ng mức tạ nặng hơn so với mức th&ocirc;ng thường, điều đ&oacute; đồng nghĩa với việc ch&uacute;ng ta đang g&oacute;p phần l&agrave;m tổn thương c&aacute;c sợi cơ. Theo cơ chế hoạt động, cơ thể sẽ tự động sửa chữa c&aacute;c thương tổn n&agrave;y, đồng thời b&ugrave; đắp bằng c&aacute;ch th&ecirc;m nhiều tế b&agrave;o lớn hơn để x&acirc;y dựng c&aacute;c sợi cơ khỏe hơn. Đ&oacute; l&agrave; một chu kỳ hỏng h&oacute;c v&agrave; sửa chữa li&ecirc;n tục nhằm tăng k&iacute;ch thước cơ bắp.</p>\r\n\r\n<p><img alt=\"Điều gì sẽ xảy ra với cơ thể bạn khi sử dụng Steroids? - Ảnh 1\" src=\"https://cdn.wheystore.vn/upload/news_optimize/wst_1046___ieu_gi_se_xay_ra_voi_co_the_ban_khi_su_dung_steroids__image_1587725916_1.jpg\" title=\"Điều gì sẽ xảy ra với cơ thể bạn khi sử dụng Steroids? - Ảnh 1\" /></p>\r\n\r\n<p>Ch&iacute;ch Steroid k&iacute;ch th&iacute;ch tăng trưởng cơ bắp</p>\r\n\r\n<p>Testosterone tự nhi&ecirc;n l&agrave; nhi&ecirc;n liệu ch&iacute;nh của cơ thể phục vụ cho tiến tr&igrave;nh n&agrave;y. Bằng c&aacute;ch sử dụng steroid, ch&uacute;ng ta đang tăng mức testosterone trong cơ thể, tạo ra một m&ocirc;i trường hiệu quả hơn nhiều để k&iacute;ch th&iacute;ch tăng trưởng cơ bắp. Khi sử dụng, steroids đi theo m&aacute;u đến m&ocirc; cơ nơi ch&uacute;ng được gắn v&agrave;o c&aacute;c thụ thể cụ thể. Một khi c&aacute;c thụ thể n&agrave;y được k&iacute;ch hoạt, c&aacute;c tế b&agrave;o cơ sẽ tăng cường sản xuất protein, thứ m&agrave; cơ thể sử dụng để x&acirc;y dựng v&agrave; ph&aacute;t triển c&aacute;c tế b&agrave;o cơ bắp.</p>\r\n\r\n<p>Steroid cũng hoạt động bằng c&aacute;ch ức chế h&oacute;c m&ocirc;n c&oacute; t&ecirc;n l&agrave; glucocorticoids. Việc ức chế glucocorticoids gi&uacute;p đẩy nhanh qu&aacute; tr&igrave;nh ph&acirc;n hủy c&aacute;c ph&acirc;n tử phức tạp như protein, tạo th&agrave;nh c&aacute;c đơn vị nhỏ hơn như amino acid để cung cấp năng lượng.</p>\r\n\r\n<p>Điều n&agrave;y đồng nghĩa với việc cơ bắp của bạn sẽ tốn &iacute;t thời gian hơn để phục hồi giữa c&aacute;c b&agrave;i tập v&agrave; bạn c&oacute; thể tập nhiều hơn với thời gian nghỉ &iacute;t hơn.</p>\r\n\r\n<p>Khi bạn kết hợp sự ph&aacute;t triển cơ bắp nhanh hơn v&agrave; thời gian phục hồi nhanh hơn, bạn sẽ thấy steroid c&oacute; thể cải thiện hiệu suất thể thao như thế n&agrave;o.</p>\r\n\r\n<p>Một nghi&ecirc;n cứu chứng minh rằng, trong suốt 10 tuần hoặc &iacute;t hơn, mức tăng cơ trung b&igrave;nh đạt được trong khoảng từ 4 &ndash; 11 pounds.</p>\r\n\r\n<p>Điều n&agrave;y c&oacute; nghĩa l&agrave;, với việc sử dụng đ&uacute;ng chu kỳ steroid kết hợp tập luyện v&agrave; chế độ ăn ki&ecirc;ng, bạn c&oacute; thể đạt được mục ti&ecirc;u ph&aacute;t triển cơ bắp m&agrave; bạn mong muốn chỉ trong v&ograve;ng 2 đến 4 th&aacute;ng m&agrave; b&igrave;nh thường phải mất 1 năm bạn mới đạt được điều đ&oacute;.</p>\r\n\r\n<p>Nhưng đ&oacute; chưa phải l&agrave; tất cả!</p>\r\n\r\n<p>Sự thật l&agrave;, sử dụng thường xuy&ecirc;n steroid cũng mang tới rất nhiều t&aacute;c hại, điển h&igrave;nh c&oacute; thể kể đến những t&aacute;c hại ch&iacute;nh như:</p>\r\n\r\n<p>Xương ngừng ph&aacute;t triển sớm hơn, t&iacute;nh t&igrave;nh dễ nổi c&aacute;u, dễ bị đột quỵ hoặc c&aacute;c bệnh về tim mạch, h&oacute;i đầu, da đổ nhiều dầu v&agrave; nhiều mụn, tăng huyết &aacute;p &amp; cholestorone xấu, nguy cơ nhiễm tr&ugrave;ng da v&agrave; ung thư gan cao.</p>\r\n\r\n<p><img alt=\"Điều gì sẽ xảy ra với cơ thể bạn khi sử dụng Steroids? - Ảnh 2\" src=\"https://cdn.wheystore.vn/upload/news_optimize/wst_1046___ieu_gi_se_xay_ra_voi_co_the_ban_khi_su_dung_steroids__image_1587725916_2.jpg\" title=\"Điều gì sẽ xảy ra với cơ thể bạn khi sử dụng Steroids? - Ảnh 2\" /></p>\r\n\r\n<p>T&aacute;c hại của việc lạm dụng Steroid qu&aacute; đ&agrave;</p>\r\n\r\n<p>- Đối với nam giới c&ograve;n dễ mắc phải c&aacute;c vấn đề: co tinh ho&agrave;n, giảm tinh tr&ugrave;ng (thậm ch&iacute; c&oacute; thể v&ocirc; sinh), giảm ham muốn, ngực ph&aacute;t triển.</p>\r\n\r\n<p>- Đối với nữ giới c&oacute; thể xuất hiện c&aacute;c triệu chứng: Giọng n&oacute;i ồm, l&ocirc;ng t&oacute;c ph&aacute;t triển, ngực teo nhỏ, &acirc;m đạo to, da nh&aacute;m r&aacute;p.</p>\r\n\r\n<p>Thực tế, Steriods mang lại kh&aacute; nhiều t&aacute;c dụng v&agrave; n&oacute; cũng kh&ocirc;ng qu&aacute; xấu đến mức kh&ocirc;ng thể sử dụng. Tuy nhi&ecirc;n, kh&ocirc;ng n&ecirc;n lạm dụng v&agrave; đặc biệt phải c&oacute; sự kiểm so&aacute;t của c&aacute;c chuy&ecirc;n gia để hướng dẫn c&aacute;ch sử dụng v&agrave; hạn chế những t&aacute;c dụng phụ kh&ocirc;ng mong muốn (M&agrave; thực t&igrave;nh, ở Việt Nam chưa chuy&ecirc;n gia n&agrave;o đủ giỏi để c&oacute; thể hướng dẫn bạn l&agrave;m được điều n&agrave;y).</p>', '2020-05-08 12:22:16', 1, 1, '2020-05-08 12:31:44'),
(13, '7 cách tăng cân hiệu quả nhất từ quả bơ', '7-cach-tang-can-hieu-qua-nhat-tu-qua-bo', 1, 1, 4, 0, 'Cách tăng cân, tăng cơ', '2020-05-08__940-catalog-7-cach-tang-can-hieu-qua-nhat-tu-qua-bo-main-1587725858.jpg', '<p>Phương ph&aacute;p d&ugrave;ng bơ để tăng c&acirc;n l&agrave; một trong những c&aacute;ch tăng c&acirc;n hiệu quả nhất cho người gầy. Bởi v&igrave; quả bơ đ&aacute;p ứng đủ h&agrave;m lượng gi&aacute; trị dinh dưỡng gi&uacute;p tăng c&acirc;n nhanh v&agrave; an to&agrave;n. B&agrave;i viết sau đ&acirc;y sẽ chia sẻ&nbsp;<strong>7 c&aacute;ch tăng c&acirc;n hiệu quả nhất</strong>&nbsp;từ quả bơ.</p>\r\n\r\n<h2><strong>C&ocirc;ng dụng của quả bơ trong việc tăng c&acirc;n</strong></h2>\r\n\r\n<p><strong><img alt=\"7 cách tăng cân hiệu quả nhất từ quả bơ - Ảnh 1\" src=\"https://cdn.wheystore.vn/upload/news_optimize/wst_940_7_cach_tang_can_hieu_qua_nhat_tu_qua_bo_image_1587725858_1.jpg\" title=\"7 cách tăng cân hiệu quả nhất từ quả bơ - Ảnh 1\" /></strong></p>\r\n\r\n<p>Bơ l&agrave; một loại tr&aacute;i c&acirc;y c&oacute; nguồn gốc từ Mecico v&agrave; Trung Mỹ, c&oacute; t&ecirc;n khoa học l&agrave; Persea Ameriana. Đ&acirc;y l&agrave; một loại quả trời cho với h&agrave;m lượng gi&aacute; trị dinh dưỡng rất cao, phần thịt quả rất mềm v&agrave; mịn.</p>\r\n\r\n<p>Trong quả bơ rất gi&agrave;u chất b&eacute;o chủ yếu l&agrave; nguồn chất b&eacute;o b&atilde;o h&ograve;a đơn, gi&uacute;p kiểm so&aacute;t hoạt động trao đổi chất của cơ thể một c&aacute;ch dễ d&agrave;ng, hỗ trợ tăng c&acirc;n rất tốt.</p>\r\n\r\n<p>Ngo&agrave;i ra, bơ c&ograve;n l&agrave; một nguồn cung cấp dưỡng chất d&ocirc;i d&agrave;o, gi&agrave;u chất xơ, rất nhiều vitamin &amp; kho&aacute;ng chất như: kali, vitamin A, vitamin B, vitamin C, sắt, đồng, &hellip;</p>\r\n\r\n<p>Bơ ch&iacute;nh l&agrave; một sự lựa chọn tuyệt vời của bạn để bổ sung th&ecirc;m v&agrave;o thực đơn tăng c&acirc;n mỗi ng&agrave;y của m&igrave;nh, l&agrave; c&aacute;ch tăng c&acirc;n hiệu quả nhất d&agrave;nh cho người gầy.</p>\r\n\r\n<h2><strong>7 c&aacute;ch tăng c&acirc;n hiệu quả từ bơ</strong></h2>\r\n\r\n<p><strong><img alt=\"7 cách tăng cân hiệu quả nhất từ quả bơ - Ảnh 2\" src=\"https://cdn.wheystore.vn/upload/news_optimize/wst_940_7_cach_tang_can_hieu_qua_nhat_tu_qua_bo_image_1587725858_2.jpg\" title=\"7 cách tăng cân hiệu quả nhất từ quả bơ - Ảnh 2\" /></strong></p>\r\n\r\n<h3><strong><em>Sinh tố bơ</em></strong></h3>\r\n\r\n<p>Sinh tố bơ c&oacute; vị ngậy của bơ kết hợp với vị thơm của sữa l&agrave; một loại thức uống vừa c&oacute; thể giải nhiệt vừa cung cấp nhiều năng lượng cho cơ thể để gi&uacute;p người gầy tăng c&acirc;n nhanh ch&oacute;ng.</p>\r\n\r\n<p><em>Nguy&ecirc;n liệu:</em>&nbsp;1 quả bơ ch&iacute;n tới (kh&ocirc;ng n&ecirc;n chọn quả xanh vị nhựa của bơ xanh sẽ l&agrave;m sinh tố c&oacute; vị đắng, kh&ocirc;ng được mịn) + 40g sữa đặc + 50ml sữa tươi + đ&aacute; vi&ecirc;n.</p>\r\n\r\n<p><em>C&aacute;ch l&agrave;m:&nbsp;</em>đầu ti&ecirc;n cắt quả bơ l&agrave;m đ&ocirc;i, d&ugrave;ng dao ấn mạnh v&agrave;o hạt bơ, sau đ&oacute; xoay nhẹ để t&aacute;ch hạt ra khỏi phần thịt quả. Sau đ&oacute; d&ugrave;ng th&igrave;a x&uacute;c phần thịt bơ v&agrave;o m&aacute;y xay sinh tố, th&ecirc;m sữa tươi, sữa đặc v&agrave; mấy vi&ecirc;n đ&aacute; v&agrave;o c&ugrave;ng nữa rồi xay mịn. Cuối c&ugrave;ng đổ hỗn hợp vừa xay mịn v&agrave;o cốc v&agrave; thưởng thức th&ocirc;i.</p>\r\n\r\n<h3><strong><em>Bơ dầm tr&aacute;i c&acirc;y</em></strong></h3>\r\n\r\n<p>Bơ kết hợp với nhiều loại tr&aacute;i c&acirc;y kh&aacute;c dầm chung sẽ cho ra một hương vị mới lạ, gi&agrave;u chất dinh dưỡng vừa tốt cho sức khỏe vừa tăng c&acirc;n hiệu quả.</p>\r\n\r\n<p><em>Nguy&ecirc;n liệu:&nbsp;</em>2 quả bơ ch&iacute;n v&agrave; c&aacute;c loại quả ch&iacute;n kh&aacute;c m&agrave; bạn y&ecirc;u th&iacute;ch + sữa tươi.</p>\r\n\r\n<p><em>C&aacute;ch l&agrave;m:&nbsp;</em>cắt tất cả c&aacute;c loại tr&aacute;i c&acirc;y th&agrave;nh miếng nhỏ cho v&agrave;o t&ocirc; dầm c&ugrave;ng sữa tươi v&agrave; đ&aacute; b&agrave;o.</p>\r\n\r\n<p>Sự kết hợp của bơ với nhiều loại tr&aacute;i c&acirc;y kh&aacute;c nhau, gi&uacute;p bạn c&oacute; một bữa phụ gi&agrave;u chất dinh dưỡng, nhiều chất xơ v&agrave; gi&agrave;u vitamin.</p>\r\n\r\n<h3><strong><em>Bơ dầm sữa</em></strong></h3>\r\n\r\n<p>Đ&acirc;y l&agrave; một m&oacute;n ăn đơn giản, chỉ l&agrave; sự kết hợp của bơ với sữa, nhưng lại rất tốt cho người người muốn tăng c&acirc;n.</p>\r\n\r\n<p><em>Nguy&ecirc;n liệu:</em>&nbsp;2 quả bơ + sữa đặc</p>\r\n\r\n<p><em>C&aacute;ch l&agrave;m:&nbsp;</em>bơ bổ đ&ocirc;i, bỏ hạt rồi lấy th&igrave;a nạo phần thịt bơ cho v&agrave;o b&aacute;t rồi cho sữa đặc v&agrave;o dầm n&aacute;t. Cho th&ecirc;m đ&aacute; v&agrave;o thưởng thức hoặc cho v&agrave;o tủ lạnh cho m&aacute;t sẽ ngon hơn.</p>\r\n\r\n<p><img alt=\"7 cách tăng cân hiệu quả nhất từ quả bơ - Ảnh 3\" src=\"https://cdn.wheystore.vn/upload/news_optimize/wst_940_7_cach_tang_can_hieu_qua_nhat_tu_qua_bo_image_1587725858_3.jpg\" title=\"7 cách tăng cân hiệu quả nhất từ quả bơ - Ảnh 3\" /></p>\r\n\r\n<h3><strong><em>Sinh tố bơ xo&agrave;i</em></strong></h3>\r\n\r\n<p>Sự kết hợp của xo&agrave;i với bơ tạo n&ecirc;n một m&oacute;n sinh tố lạ miệng, gi&agrave;u chất dinh dưỡng gi&uacute;p người gầy tăng c&acirc;n hiệu quả.</p>\r\n\r\n<p><em>Nguy&ecirc;n liệu:</em>&nbsp;2 quả bơ + 1 quả xo&agrave;i + 150ml sữa tươi + 20ml sữa đặc c&oacute; đường</p>\r\n\r\n<p><em>C&aacute;ch l&agrave;m:</em>&nbsp;Bơ th&igrave; gọt vỏ, bỏ hạt, cắt miếng nhỏ. Xo&agrave;i gọt vỏ, cắt miếng vu&ocirc;ng nhỏ. Để lại một v&agrave;i miếng nhỏ kh&ocirc;ng xay để l&aacute;t trang tr&iacute;. Tiếp theo cho c&aacute;c nguy&ecirc;n liệu bơ, xo&agrave;i, sữa tươi, sữa đặc, th&ecirc;m v&agrave;i vi&ecirc;n đ&aacute; vi&ecirc;n v&agrave;o m&aacute;y xay sinh tố xay mịn sau đ&oacute; đổ ra cốc, cho th&ecirc;m v&agrave;i miếng xo&agrave;i cắt nhỏ l&ecirc;n tr&ecirc;n rồi thưởng thức.</p>\r\n\r\n<h3><strong><em>Sinh tố bơ sầu ri&ecirc;ng</em></strong></h3>\r\n\r\n<p><em>Nguy&ecirc;n liệu:</em>&nbsp;2 m&uacute;i sầu ri&ecirc;ng + 2 quả bơ nhỏ + 50g sữa đặc + 140ml sữa tươi</p>\r\n\r\n<p><em>C&aacute;ch l&agrave;m:</em>&nbsp;lấy phần thịt bơ c&ugrave;ng với cơm sầu, sữa tươi, sữa đặc, đ&aacute; vi&ecirc;n cho v&agrave;o trong m&aacute;y xay sinh tố xay cho mịn rồi cho ra cốc thưởng thức.</p>\r\n\r\n<p>Ly sinh tố bơ sầu ri&ecirc;ng c&oacute; vị thơm ngậy của bơ, hương thơm đặc trưng của sầu ri&ecirc;ng, gi&agrave;u dinh dưỡng kh&ocirc;ng những gi&uacute;p tăng c&acirc;n tốt m&agrave; c&ograve;n gi&uacute;p cho l&agrave;n da s&aacute;ng mịn, giải nhiệt ng&agrave;y h&egrave;.</p>\r\n\r\n<h3><strong><em>Bơ chi&ecirc;n gi&ograve;n</em></strong></h3>\r\n\r\n<p>Đ&acirc;y l&agrave; một m&oacute;n mới, tương đối lạ miệng d&agrave;nh cho những ai đ&atilde; ch&aacute;n c&aacute;c loại sinh tố bơ rồi.</p>\r\n\r\n<p><em>Nguy&ecirc;n liệu:</em>&nbsp;2 quả bơ ch&iacute;n + trứng g&agrave; + bột chi&ecirc;n x&ugrave; n&ecirc;m sẵn gia vị.</p>\r\n\r\n<p><em>Thực hiện:</em>&nbsp;bơ cắt th&agrave;nh những miếng nhỏ, trộn trứng g&agrave; với bột chi&ecirc;n x&ugrave; sau đ&oacute; đem bơ vừa cắt nhỏ những qua bột rồi cho v&agrave;o chảo mỡ chi&ecirc;n gi&ograve;n. Để hạn chế dầu mỡ th&igrave; sau khi r&aacute;n, c&aacute;c bạn cho c&aacute;c miếng bơ chi&ecirc;n v&agrave;o giấy thấm dầu để giảm bớt ch&uacute;ng đi.</p>\r\n\r\n<p>M&oacute;n bơ chi&ecirc;n gi&ograve;n n&agrave;y được chấm với nước sốt c&ocirc;ng thức như sau: 3 th&igrave;a tương ớt, 5 th&igrave;a sốt Mayonnaise v&agrave; 1 th&igrave;a nước cốt chanh v&agrave;o 1 c&aacute;i b&aacute;t v&agrave; trộn đều tay để c&oacute; được một hỗn hợp nước chấm sền sệt. Hoặc bạn c&oacute; thể chấm bơ chi&ecirc;n gi&ograve;n với tương ớt cũng rất ngon.</p>\r\n\r\n<p>Bơ chi&ecirc;n gi&ograve;n l&agrave; một m&oacute;n ăn rất đơn giản từ kh&acirc;u nguy&ecirc;n liệu đến kh&acirc;u chế biến, gi&uacute;p người gầy tăng c&acirc;n hiệu quả,&nbsp; l&agrave;nh mạnh v&agrave; an to&agrave;n.</p>\r\n\r\n<h3><strong><em>Salad bơ</em></strong></h3>\r\n\r\n<p><em>Nguy&ecirc;n liệu:</em>&nbsp;1 quả bơ + x&agrave; l&aacute;ch + rau thơm c&aacute;c loại + c&agrave; chua + ng&ocirc; ngọt (nửa bắp) + h&agrave;nh t&acirc;y + 200g thịt b&ograve; + gia vị (chanh, muối, đường, &hellip;)</p>\r\n\r\n<p><em>Chuẩn bị</em></p>\r\n\r\n<p>- Thịt để nguy&ecirc;n miếng rửa sạch, ướp với muối, dầu ăn, ti&ecirc;u, tỏi v&agrave; h&agrave;nh t&iacute;m 15 ph&uacute;t.</p>\r\n\r\n<p>- H&agrave;nh t&acirc;y cắt mỏng v&agrave; ng&acirc;m với nước chanh trong 5 ph&uacute;t cho bớt hăng, sau đ&oacute; vớt ra để r&aacute;o trong tủ lạnh để h&agrave;ng t&acirc;y gi&ograve;n v&agrave; ngọt hơn.</p>\r\n\r\n<p>- C&aacute;c loại rau nhặt sạch, rửa sạch rồi cắt nhỏ vừa ăn.</p>\r\n\r\n<p>- Bơ cắt miếng h&igrave;nh b&aacute;n nguyệt, hơi d&agrave;y một ch&uacute;t để kh&ocirc;ng bị n&aacute;t trong qu&aacute; tr&igrave;nh trộn. C&agrave; chua cắt hạt lựu.</p>\r\n\r\n<p>- Ng&ocirc; t&aacute;ch lấy hạt rồi hấp ch&iacute;n.</p>\r\n\r\n<p><em>C&aacute;ch l&agrave;m</em></p>\r\n\r\n<p>- Pha nước trộn: pha 1 muống nước mắm với nửa c&agrave; ph&ecirc; muối, 1 muỗng đường, ti&ecirc;u, ớt, chanh.</p>\r\n\r\n<p>- Trộn hỗn hợp tr&ecirc;n với rau thơm, x&agrave; l&aacute;ch, c&agrave; chua, h&agrave;nh t&acirc;y, ng&ocirc;.Sau đ&oacute; b&agrave;y ra đĩa.</p>\r\n\r\n<p>- Thịt b&ograve; đem &aacute;p chảo, t&ugrave;y v&agrave;o sở th&iacute;ch, khẩu vị của mỗi người m&agrave; căn chỉnh độ ch&iacute;n kh&aacute;c nhau, nhưng để ch&iacute;n vừa tới th&igrave; thịt sẽ ngọt v&agrave; mềm hơn. Sau đ&oacute; cắt thịt ra th&agrave;nh c&aacute;c l&aacute;t mỏng vừa ăn.</p>\r\n\r\n<p>- Cuối c&ugrave;ng cho bơ v&agrave; thịt l&ecirc;n đĩa, cho th&ecirc;m một &iacute;t dầu thừa từ phần thịt &aacute;p chảo để tăng độ b&eacute;o cho m&oacute;n ăn.</p>\r\n\r\n<p>Tr&ecirc;n đ&acirc;y l&agrave;&nbsp;<strong>7 c&aacute;ch tăng c&acirc;n hiệu quả nhất</strong>&nbsp;với tr&aacute;i bơ d&agrave;nh cho người gầy. Bơ l&agrave; một loại tr&aacute;i c&acirc;y tuyệt vời, hỗ trợ tăng c&acirc;n rất tốt, ch&iacute;nh v&igrave; vậy m&agrave; những ai đang c&oacute; nhu cầu tăng c&acirc;n th&igrave; h&atilde;y th&ecirc;m bơ v&agrave;o ngay thực đơn tăng c&acirc;n mỗi ng&agrave;y của m&igrave;nh nh&eacute;! Nếu muốn tăng c&acirc;n tốt hơn nữa th&igrave; c&oacute; thể thay sữa tươi bằng c&aacute;c loại sữa mass - loại sữa hỗ trợ người gầy tăng c&acirc;n rất tốt.</p>', '2020-05-08 12:23:19', 1, 1, '2020-05-08 12:31:32'),
(14, 'Cách tăng cân nhanh cho nam giới trong 1 tuần', 'cach-tang-can-nhanh-cho-nam-gioi-trong-1-tuan', 1, 1, 4, 0, 'Cách tăng cân, tăng cơ', '2020-05-08__932-catalog-cach-tang-can-nhanh-cho-nam-gioi-trong-1-tuan-main-1587725854.png', '<p>Kh&ocirc;ng chỉ c&oacute; phụ nữ mới cảm thấy tự tin về th&acirc;n h&igrave;nh&nbsp;<em>&ldquo;c&ograve; hương&rdquo;</em>&nbsp;của m&igrave;nh, m&agrave; nam giới cũng vậy. Con trai m&agrave; gầy th&igrave; nh&igrave;n sẽ cảm thấy rất ch&aacute;n, tr&ocirc;ng ốm yếu v&agrave; kh&ocirc;ng c&oacute; vẻ nam t&iacute;nh, mạnh mẽ của đ&agrave;n &ocirc;ng. Vậy, c&oacute;&nbsp;<strong>c&aacute;ch tăng c&acirc;n nhanh cho nam</strong>&nbsp;hay kh&ocirc;ng?</p>\r\n\r\n<h2><strong>C&aacute;ch tăng c&acirc;n nhanh cho nam giới</strong></h2>\r\n\r\n<h3><strong><em>Tập trung ăn uống</em></strong></h3>\r\n\r\n<p>Để tăng c&acirc;n th&igrave; việc đầu ti&ecirc;n đ&oacute; ch&iacute;nh l&agrave; nạp thật nhiều calo để sao cho lượng calo nạp v&agrave;o phải nhiều hơn lượng cơ thể ti&ecirc;u trong một ng&agrave;y. Để bổ sung một lượng lớn calo cho qu&aacute; tr&igrave;nh tăng c&acirc;n th&igrave; nam gầy c&acirc;n phải bổ sung thật nhiều thức ăn. Tuy nhi&ecirc;n kh&ocirc;ng phải thứ g&igrave; cũng ăn được m&agrave; n&ecirc;n chọn những thực phẩm vừa gi&agrave;u dinh dưỡng lại vừa tốt cho sức khỏe.</p>\r\n\r\n<p>C&aacute;ch để tăng c&acirc;n nhanh cho nam hiệu quả v&agrave; lạnh mạnh l&agrave; cần bổ sung đủ cho cơ thể: c&aacute;c thực phẩm gi&agrave;u protein, c&aacute;c loại carb tốt, chất b&eacute;o c&oacute; lợi, thật nhiều vitamin v&agrave; kho&aacute;ng chất.</p>\r\n\r\n<p>Phải bổ sung năng lượng cho cơ thể li&ecirc;n tục bằng c&aacute;ch ăn đủ 3 bữa ch&iacute;nh v&agrave; th&ecirc;m từ 2 &ndash; 3 bữa phụ xen kẽ c&aacute;c bữa ch&iacute;nh.</p>\r\n\r\n<h3><strong><em>Tham gia tập luyện thể h&igrave;nh</em></strong></h3>\r\n\r\n<p>Việc tham gia tập luyện thể h&igrave;nh, thể dục thể thao cũng l&agrave; c&aacute;ch tăng c&acirc;n nhanh chon am.việc tập luyện gi&uacute;p cơ thể khỏe mạnh, cải thiện hệ ti&ecirc;u h&oacute;a, k&iacute;ch th&iacute;ch ăn ngon miệng gi&uacute;p người gầy ăn nhiều hơn từ đ&oacute; sẽ tăng c&acirc;n. Đồng thời, n&oacute; c&ograve;n gi&uacute;p đốt ch&aacute;y mỡ thừa, x&acirc;y dựng khối cơ bắp chắc khỏe. Nếu tập luyện ki&ecirc;n tr&igrave; th&igrave; sẽ sớm c&oacute; được một th&acirc;n h&igrave;nh c&acirc;n đối, săn chắc.</p>\r\n\r\n<h2><strong>Thực đơn tăng c&acirc;n nhanh cho nam trong 1 tuần</strong></h2>\r\n\r\n<h3><strong><em>Thực đơn bữa s&aacute;ng</em></strong></h3>\r\n\r\n<p>Bữa s&aacute;ng l&agrave; bữa rất quan trọng, cung cấp năng lượng cho cơ thể để hoạt động trong suốt cả ng&agrave;y.Chắc c&aacute;c bạn đ&atilde; nghe c&acirc;u &ldquo;Ăn s&aacute;ng như một vị vua&rdquo;. Ch&iacute;nh v&igrave; vậy m&agrave; kh&ocirc;ng được bỏ bữa s&aacute;ng.</p>\r\n\r\n<p>Bữa s&aacute;ng cần bổ sung nhiều năng lượng v&agrave; n&ecirc;n ăn từ 6 &ndash; 7 giờ, muộn nhất l&agrave; trước 9 giờ.</p>\r\n\r\n<p>C&aacute;c bạn nam gầy c&oacute; thể tham khảo thực đơn cho bữa s&aacute;ng sau:</p>\r\n\r\n<p>Ng&agrave;y 1: 1 t&ocirc; phở c&oacute; nước d&ugrave;ng b&eacute;o + 1 quả trứng luộc + 1 quả chuối.</p>\r\n\r\n<p>Ng&agrave;y 2: 1 c&aacute;i b&aacute;nh bao + 1 cốc sữa + 1 quả bơ.</p>\r\n\r\n<p>Ng&agrave;y 3: b&aacute;nh mỳ pate thịt v&agrave; 1 cốc sữa đậu n&agrave;nh</p>\r\n\r\n<p>Ng&agrave;y 4: 1 b&aacute;t x&ocirc;i + 1 hộp sữa chua + 1 sinh tố m&atilde;ng cầu</p>\r\n\r\n<p>Ng&agrave;y 5: b&aacute;nh cuốn + 1 x&uacute;c x&iacute;c + 1 cốc sữa</p>\r\n\r\n<p>Ng&agrave;y 6: 1 b&aacute;t ch&aacute;o thịt + 1 l&aacute;t b&aacute;nh mỳ + 3 m&uacute;i bưởi</p>\r\n\r\n<p>Ng&agrave;y 7: 1 b&aacute;t b&uacute;n + 1 quả trứng ốp + 10 quả nho</p>\r\n\r\n<p>Với thực đơn tr&ecirc;n, c&aacute;c bạn c&oacute; thể thay đổi c&aacute;c m&oacute;n ăn giữa c&aacute;c ng&agrave;y nhưng phải đảm bảo, trong bữa s&aacute;ng phải c&oacute; đủ 4 nh&oacute;m chất dinh dưỡng: chất bột, chất đạm, chất b&eacute;o, vitamin v&agrave; kho&aacute;ng chất.</p>\r\n\r\n<h3><strong><em>Thực đơn bữa trưa</em></strong></h3>\r\n\r\n<p>Bữa trưa l&agrave; bữa ăn cung cấp năng lượng cho cơ thể hoạt động v&agrave; bổ sung nguồn dinh dưỡng thiết yếu để x&acirc;y dựng c&aacute;c tế b&agrave;o. Đối với những nam gầy tham gia tập thể dục để tăng c&acirc;n th&igrave; n&ecirc;n bổ sung nhiều tinh bột v&agrave; protein. Bởi v&igrave;, protein c&oacute; vai tr&ograve; rất quan trọng trong việc x&acirc;y dựng c&aacute;c tế b&agrave;o, x&acirc;y dựng cơ bắp c&ograve;n tinh bột th&igrave; bổ sung lượng Calo đ&atilde; mất trong qu&aacute; tr&igrave;nh hoạt động buổi s&aacute;ng.</p>\r\n\r\n<p>Bữa ăn buổi trưa bạn n&ecirc;n ăn trước 12 giờ v&agrave; n&ecirc;n ăn cơm, t&ugrave;y v&agrave;o khả năng của bạn c&oacute; thể ăn 2-3 b&aacute;t hoặc hơn c&ugrave;ng với 1 m&oacute;n canh v&agrave; 2 m&oacute;n mặn.</p>\r\n\r\n<p>Sau đ&acirc;y l&agrave; thực đơn bữa trưa tham khảo d&agrave;nh cho nam gầy.</p>\r\n\r\n<p>Ng&agrave;y 1: 2 b&aacute;t cơm + b&ograve; x&agrave;o đỗ + canh b&iacute; đỏ</p>\r\n\r\n<p>Ng&agrave;y 2: cơm + ba chỉ rang ch&aacute;y cạnh + canh cải xanh</p>\r\n\r\n<p>Ng&agrave;y 3: 1 b&aacute;t b&uacute;n + 1 quả trứng luộc + nước &eacute;p hoa quả.</p>\r\n\r\n<p>Ng&agrave;y 4: cơm + đ&ugrave;i g&agrave; luộc + canh khoai t&acirc;y</p>\r\n\r\n<p>Ng&agrave;y 5: cơm + đậu phụ nhồi thịt + đậu h&agrave; lan x&agrave;o</p>\r\n\r\n<p>Ng&agrave;y 6: cơm + thịt kho t&agrave;u trứng + b&iacute; luộc</p>\r\n\r\n<p>Ng&agrave;y 7: cơm + thịt ch&acirc;n gi&ograve; luộc + rau ng&oacute;t nấu thịt</p>\r\n\r\n<p>Đ&acirc;y l&agrave; thực đơn gi&agrave;u dinh dưỡng trong c&aacute;ch tăng c&acirc;n cho nam, đảm bảo cho qu&aacute; tr&igrave;nh vận động tăng c&acirc;n được tốt nhất. C&aacute;c bạn c&oacute; thể thay đổi c&aacute;c m&oacute;n ăn sao cho ph&ugrave; hợp với thực tế cũng như khẩu vị của từng ng&agrave;y.</p>\r\n\r\n<p>Thực đơn tăng c&acirc;n trong bữa trưa cũng cần đảm bảo đủ c&aacute;c chất: đạm, tinh bột, chất b&eacute;o, vitamin v&agrave; kho&aacute;ng chất.</p>\r\n\r\n<h3><strong><em>Thực đơn bữa tối</em></strong></h3>\r\n\r\n<p>Đ&acirc;y cũng l&agrave; một bữa ăn quan trọng nhưng bạn cần ch&uacute; &yacute; l&agrave; n&ecirc;n chọn những thức ăn chứa &iacute;t năng lượng, nhiều vitamin v&agrave; kho&aacute;ng chất, tr&aacute;nh những thực phẩm nhiều mỡ, gi&agrave;u chất b&eacute;o để cơ thể dễ ti&ecirc;u h&oacute;a, kh&ocirc;ng bị qu&aacute; no, dễ ngủ. N&ecirc;n ăn tối trước 7 giờ tối.</p>\r\n\r\n<p>Thực đơn tăng c&acirc;n bữa tối d&agrave;nh cho nam gầy</p>\r\n\r\n<p>Ng&agrave;y 1: 1 b&aacute;t cơm + thịt luộc + hoa thi&ecirc;n l&yacute; x&agrave;o</p>\r\n\r\n<p>Ng&agrave;y 2: 1 b&aacute;t cơm + 1 ch&ugrave;m nho + 1 b&aacute;t ch&egrave; sen</p>\r\n\r\n<p>Ng&agrave;y 3: 1 b&aacute;t cơm + t&ocirc;m rang + rau cải luộc</p>\r\n\r\n<p>Ng&agrave;y 4: 1 đĩa mỳ b&ograve; + 2 quả chuối</p>\r\n\r\n<p>Ng&agrave;y 5: 1 b&aacute;t cơm + b&ograve; b&iacute;t tết + b&iacute; luộc</p>\r\n\r\n<p>Ng&agrave;y 6: 1 b&aacute;t cơm + g&agrave; luộc + canh c&agrave; t&iacute;m</p>\r\n\r\n<p>Ng&agrave;y 7: 1 b&aacute;t cơm + c&aacute; thu r&aacute;n + canh c&aacute; nấu chua</p>\r\n\r\n<h3><strong><em>Thực đơn bữa phụ</em></strong></h3>\r\n\r\n<p>Bữa phụ thực chất kh&ocirc;ng phải l&agrave; một bữa ăn, chỉ l&agrave; ăn bổ sung để cơ thể c&oacute; th&ecirc;m năng lượng.</p>\r\n\r\n<p>Một nguy&ecirc;n tắc trng c&aacute;ch tăng c&acirc;n nhanh cho nam đ&oacute; l&agrave; kh&ocirc;ng để cơ thể rơi v&agrave;o trạng th&aacute;i bị đ&oacute;i. Khoảng c&aacute;ch giữa c&aacute;c bữa ch&iacute;nh rất l&agrave; d&agrave;i, cơ thể th&igrave; lu&ocirc;n phải ti&ecirc;u hao v&agrave;o c&aacute;c hoạt động n&ecirc;n sẽ c&oacute; l&uacute;c đ&oacute;i n&ecirc;n bạn cần bổ sung năng lượng ngay lập tức.</p>\r\n\r\n<p>Ngo&agrave;i 3 bữa ăn ch&iacute;nh ra, để qu&aacute; tr&igrave;nh tăng c&acirc;n được hiệu quả th&igrave; nam gầy cần bổ sung từ 2-3 bữa phụ trong một ng&agrave;y v&agrave;o c&aacute;c khoảng thời gian sau: 9 &ndash; 10h s&aacute;ng, 3 &ndash; 4h chiều v&agrave; 9h giờ tối.</p>\r\n\r\n<p>Đối với bữa ăn phụ, bạn c&oacute; thể tham khảo c&aacute;c thực phẩm sau:</p>\r\n\r\n<p>Bữa phụ c&aacute;c bạn c&oacute; thể ăn c&aacute;c loại tr&aacute;i c&acirc;y, uống sinh tố, uống 1 cốc sữa, ăn sald rau củ, &hellip;</p>\r\n\r\n<p>Đ&oacute; l&agrave; thực đơn tăng c&acirc;n cho nam gầy trong 1 tuần. Nhưng với những người kh&ocirc;ng c&oacute; thời gian nấu ăn, chuẩn bị c&aacute;c bữa ăn đầy đủ chất dinh dưỡng th&igrave; l&agrave;m thế n&agrave;o? C&aacute;c chuy&ecirc;n gia dinh dưỡng đ&atilde; nghi&ecirc;n cứu v&agrave; đưa ra thị trường d&ograve;ng&nbsp;<strong>sữa tăng c&acirc;n mass</strong>&nbsp;bổ sung đầy đủ c&aacute;c chất dinh dưỡng cần thiết cho qu&aacute; tr&igrave;nh tăng c&acirc;n, đồng thời c&ograve;n hỗ trợ ph&aacute;t triển cơ bắp rất tốt.</p>\r\n\r\n<p>Tr&ecirc;n đ&acirc;y l&agrave; những chia sẻ về&nbsp;<strong>c&aacute;ch tăng c&acirc;n nhanh cho nam gầy</strong>. Mong rằng qua đ&acirc;y, những bạn nam gầy, bị thiếu c&acirc;n nặng sẽ sớm t&igrave;m lại v&oacute;c d&aacute;ng khỏe mạnh, th&acirc;n h&igrave;nh săn chắc của m&igrave;nh. Ch&uacute;c c&aacute;c bạn th&agrave;nh c&ocirc;ng!</p>', '2020-05-08 12:24:37', 1, 1, '2020-05-08 12:31:12');
INSERT INTO `articles` (`id`, `a_name`, `a_slug`, `a_hot`, `a_active`, `a_menu_id`, `a_view`, `a_description`, `a_avatar`, `a_content`, `created_at`, `a_position_2`, `a_position_1`, `updated_at`) VALUES
(15, 'GIẢM CÂN CÓ NÊN BỎ BỮA SÁNG?', 'giam-can-co-nen-bo-bua-sang', 1, 1, 5, 0, 'Phương pháp giảm mỡ', '2020-05-08__1047-catalog-gi-m-c-n-c-n-n-b-b-a-s-ng-main-1587725916.jpg', '<h1>N&Ecirc;N HAY KH&Ocirc;NG N&Ecirc;N BỎ BỮA S&Aacute;NG ĐỂ GIẢM C&Acirc;N?</h1>\r\n\r\n<p>Nhiều người nghĩ rằng, việc nạp &iacute;t calo v&agrave;o bữa s&aacute;ng, thậm ch&iacute; bỏ qua bữa s&aacute;ng gi&uacute;p giảm được lượng mỡ dư thừa trong cơ thể. Thực chất, đ&acirc;y l&agrave; một quan điểm sai lầm v&ocirc; c&ugrave;ng nghi&ecirc;m trọng. V&igrave; bỏ bữa s&aacute;ng kh&ocirc;ng những c&oacute; thể c&oacute; t&aacute;c dụng ngược lại, g&acirc;y tăng c&acirc;n m&agrave; c&ograve;n l&agrave;m ảnh hưởng nghi&ecirc;m trọng đến sức khỏe. D&ugrave; c&oacute; &yacute; định giảm c&acirc;n hay kh&ocirc;ng th&igrave; bạn cũng cần phải ăn s&aacute;ng đầy đủ, bởi bữa s&aacute;ng c&oacute; vai tr&ograve; quan trọng đối với cơ thể. Nếu bỏ bữa s&aacute;ng, bạn c&oacute; thể gặp phải những vấn đề nghi&ecirc;m trọng như sau:</p>\r\n\r\n<h2>&diams; Suy giảm hệ miễn dịch:</h2>\r\n\r\n<p>Theo c&aacute;c chuy&ecirc;n gia dinh dưỡng, việc bổ sung năng lượng cho cơ thể n&ecirc;n ph&acirc;n bổ với lượng nhiều hơn v&agrave;o bữa s&aacute;ng, giảm dần v&agrave;o v&agrave;o buổi tối. V&igrave; sau một đ&ecirc;m d&agrave;i nghỉ ngơi, c&aacute;c cơ quan trong cơ thể cần được cung cấp đủ năng lượng để tiếp tục hoạt động. Do đ&oacute;, ăn uống đầy đủ v&agrave;o bữa s&aacute;ng sẽ l&agrave;m cho cơ thể khỏe mạnh, sức đề kh&aacute;ng được tăng cường. Điều n&agrave;y gi&uacute;p bạn cảm thấy tr&agrave;n đầy năng lượng cho một ng&agrave;y l&agrave;m việc d&agrave;i.</p>\r\n\r\n<p>Ngược lại, nếu kh&ocirc;ng ăn s&aacute;ng, cơ thể sẽ kh&ocirc;ng được cung cấp đầy đủ năng lượng, khiến bạn lu&ocirc;n cảm thấy mệt mỏi, uể oải. Cơ thể dễ bị mắc bệnh. Chưa dừng lại ở đ&oacute;, dạ d&agrave;y &ldquo;trống rỗng&rdquo; c&ograve;n khiến lượng dịch vị dạ d&agrave;y tiết ra nhiều hơn, l&agrave;m tăng nguy cơ mắc c&aacute;c bệnh l&yacute; đường ti&ecirc;u h&oacute;a như<a href=\"https://thuocdantoc.vn/benh/viem-loet-da-day\">&nbsp;vi&ecirc;m lo&eacute;t dạ d&agrave;y t&aacute; tr&agrave;ng</a>, đau dạ d&agrave;y&hellip;</p>\r\n\r\n<h2>&diams; G&acirc;y b&eacute;o ph&igrave;:</h2>\r\n\r\n<p>Bỏ bữa s&aacute;ng kh&ocirc;ng những kh&ocirc;ng gi&uacute;p bạn giảm c&acirc;n m&agrave; c&ograve;n l&agrave;m tăng nguy cơ b&eacute;o ph&igrave;. L&yacute; do l&agrave; bởi nhịn ăn s&aacute;ng khiến bạn lu&ocirc;n cảm thấy đ&oacute;i v&agrave; c&oacute; xu hướng ăn nhiều hơn v&agrave;o bữa trưa v&agrave; bữa tối. Ngo&agrave;i ra, nhịn ăn s&aacute;ng c&oacute; thể l&agrave;m bạn ăn nhiều đồ ăn vặt như b&aacute;nh kem, b&aacute;nh ngọt&hellip;. Những thực phẩm n&agrave;y lại rất dễ chuyển th&agrave;nh lớp mỡ dưới da, khiến bạn bị b&eacute;o ph&igrave;.</p>\r\n\r\n<p>Ngược lại, một bữa ăn s&aacute;ng khoa học sẽ l&agrave;m giảm cảm gi&aacute;c th&egrave;m ngọt, th&uacute;c đẩy qu&aacute; tr&igrave;nh trao đổi chất. Tr&aacute;nh được nguy cơ t&iacute;ch trữ mỡ thừa dưới da.</p>\r\n\r\n<h2>&diams; Nhanh bị l&atilde;o h&oacute;a:</h2>\r\n\r\n<p>Nếu bữa s&aacute;ng kh&ocirc;ng được tiếp năng lượng, cơ thể buộc phải lấy lượng đường v&agrave; protein được dự trữ trong cơ thể để duy tr&igrave; hoạt động. Do đ&oacute;, da của bạn sẽ bị kh&ocirc;, mất nước v&agrave; c&aacute;c chất dinh dưỡng khiến da dễ bị nhăn, nhất l&agrave; v&ugrave;ng mặt.</p>\r\n\r\n<p>&diams; Giảm năng suất l&agrave;m việc:</p>\r\n\r\n<p>Ngo&agrave;i việc l&agrave;m hại dạ d&agrave;y, bỏ bữa s&aacute;ng c&ograve;n g&acirc;y hại cho c&aacute;c cơ quan kh&aacute;c nữa m&agrave; nhất l&agrave; n&atilde;o bộ. Kh&ocirc;ng đủ năng lượng, bụng đ&oacute;i cồn c&agrave;o sẽ khiến bạn kh&ocirc;ng được tập trung trong c&ocirc;ng việc. Từ đ&oacute; l&agrave;m giảm năng suất l&agrave;m việc.</p>\r\n\r\n<h3>CHUẨN BỊ BỮA S&Aacute;NG GIẢM C&Acirc;N KHOA HỌC</h3>\r\n\r\n<p>Ch&iacute;nh v&igrave; những l&yacute; do nkể tr&ecirc;n, bạn kh&ocirc;ng n&ecirc;n bỏ bữa s&aacute;ng. Tuy nhi&ecirc;n, nếu đang trong qu&aacute; tr&igrave;nh giảm c&acirc;n, bữa s&aacute;ng của bạn cũng cần phải tu&acirc;n thủ những nguy&ecirc;n tắc sau đ&acirc;y:</p>\r\n\r\n<h2>&diams; Lựa chọn c&aacute;c thực phẩm &iacute;t năng lượng:</h2>\r\n\r\n<p>Nếu kh&ocirc;ng muốn nạp qu&aacute; nhiều năng lượng v&agrave;o bữa s&aacute;ng, dẫn đến nguy cơ bị tăng c&acirc;n, bạn cần lựa chọn c&aacute;c thực phẩm &iacute;t calo. Những thực phẩm gi&agrave;u protein hoặc c&aacute;c thực phẩm chứa nhiều chất xơ sẽ l&agrave; một lựa chọn th&ocirc;ng minh cho bữa s&aacute;ng. Ch&uacute;ng sẽ l&agrave;m cho bạn c&oacute; cảm gi&aacute;c no l&acirc;u hơn v&agrave; sẽ kh&ocirc;ng l&agrave;m tăng c&acirc;n cho bạn. Những thực phẩm được khuy&ecirc;n d&ugrave;ng như:</p>\r\n\r\n<ul>\r\n	<li>Trứng</li>\r\n	<li>C&aacute;c loại ngũ cốc nguy&ecirc;n hạt như đậu, yến mạch.</li>\r\n	<li>Sữa chua kh&ocirc;ng đường.</li>\r\n	<li>Tr&aacute;i c&acirc;y tươi như t&aacute;o, l&ecirc;, chuối.</li>\r\n	<li>C&aacute;c loại thức ăn lỏng, dễ ti&ecirc;u như hủ tiếu, b&uacute;n, phở, b&aacute;nh canh.</li>\r\n	<li>Ăn c&aacute;c loại củ như khoai lang, khoai m&ocirc;n.</li>\r\n</ul>\r\n\r\n<p>Ngo&agrave;i ra, bạn kh&ocirc;ng được sử dụng c&aacute;c thực phẩm như sau:</p>\r\n\r\n<ul>\r\n	<li>C&aacute;c thức ăn ngọt như b&aacute;nh kem, kẹo, đồ uống c&oacute; gas&hellip;</li>\r\n	<li>Thức ăn đ&oacute;ng hộp như x&uacute;c x&iacute;ch, hambuger, m&igrave; ăn liền.</li>\r\n	<li>Thực phẩm chứa nhiều dầu mỡ như b&aacute;nh chưng r&aacute;n, ch&acirc;n g&agrave; r&aacute;n, khoai t&acirc;y chi&ecirc;n&hellip;</li>\r\n</ul>\r\n\r\n<h2>&diams; Kiểm so&aacute;t lượng calo:</h2>\r\n\r\n<p>Việc x&aacute;c định được c&aacute;c thực phẩm n&ecirc;n d&ugrave;ng v&agrave;o bữa s&aacute;ng l&agrave; chưa đủ. Bạn cần trang bị th&ecirc;m c&aacute;c kiến thức v&agrave; x&aacute;c định được lượng calo của những loại thực n&agrave;y. Điều n&agrave;y gi&uacute;p bạn dễ d&agrave;ng hơn trong việc x&aacute;c định được lượng thực phẩm cần ăn. V&igrave; ăn nhiều hơn mức cho ph&eacute;p sẽ l&agrave;m cho năng lượng t&iacute;ch tụ v&agrave; khiến bạn bị tăng c&acirc;n.</p>\r\n\r\n<p>Lượng calo bạn ăn v&agrave;o bữa s&aacute;ng sẽ t&ugrave;y thuộc v&agrave;o chiều cao, c&acirc;n nặng, mục ti&ecirc;u giảm c&acirc;n v&agrave; c&ocirc;ng việc m&agrave; bạn l&agrave;m. Tuy nhi&ecirc;n, bạn cần ăn &iacute;t nhất 250 &ndash; 300 calo v&agrave;o bữa s&aacute;ng. Với đối tượng l&agrave; nam giới, con số n&agrave;y c&oacute; thể l&ecirc;n đến 500 &ndash; 600 calo.</p>\r\n\r\n<p>Đặc biệt, nếu muốn giảm c&acirc;n, ngo&agrave;i việc &aacute;p dụng một chế độ ăn uống hợp l&yacute;, bạn cần phải thường xuy&ecirc;n vận động. H&atilde;y chăm tập thể dục thể thao hơn, đồng thời duy tr&igrave; lối sống l&agrave;nh mạnh, uống đủ nước, ngủ đủ giấc v&agrave; bố tr&iacute; thời gian nghỉ ngơi hợp l&yacute;.</p>', '2020-05-08 12:26:11', 1, 1, '2020-05-08 12:30:45'),
(16, '6 CÁCH ĐƠN GIẢN ĐỂ GIẢM MỠ BỤNG, BẠN ĐÃ BIẾT?', '6-cach-don-gian-de-giam-mo-bung-ban-da-biet', 1, 1, 5, 0, 'Phương pháp giảm mỡ', '2020-05-08__1044-catalog-6-c-ch-n-gi-n-gi-m-m-b-ng-b-n-bi-t-main-1587725915.jpg', '<p>K&iacute;ch thước bụng c&agrave;ng ng&agrave;y c&agrave;ng lớn th&ecirc;m, bạn muốn giảm mỡ bụng, nhưng lại kh&ocirc;ng biết bắt đầu từ đ&acirc;u, như thế n&agrave;o?</p>\r\n\r\n<p>Nếu đ&atilde; t&igrave;m hiểu qua bạn sẽ biết, chất b&eacute;o ở v&ugrave;ng bụng c&oacute; sự li&ecirc;n quan chặt chẽ đến c&aacute;c bệnh nguy hiểm như: Tiểu đường loại 2, bệnh tim. V&igrave; vậy, việc giảm mỡ bụng l&agrave; ho&agrave;n to&agrave;n c&acirc;n thiết v&igrave; n&oacute; kh&ocirc;ng chỉ gi&uacute;p cho bạn c&oacute; một v&oacute;c d&aacute;ng c&acirc;n đối, thon gọn m&agrave; c&ograve;n gi&uacute;p cho sức khỏe được n&acirc;ng cao, sống thọ hơn.</p>\r\n\r\n<p>Phần mỡ bụng thường được t&iacute;nh chừng bằng c&aacute;ch đo chu vi quanh phần eo của bạn. Nếu k&iacute;ch thước phần eo lớn hơn 100cm đối với nam, v&agrave; 65cm đối với nữ th&igrave; c&oacute; nghĩa đang bị b&eacute;o bụng.</p>\r\n\r\n<p>Nếu bạn muốn c&oacute; một th&acirc;n h&igrave;nh đẹp, chuẩn, kh&ocirc;ng muốn c&oacute; nhiều mỡ thừa ở v&ugrave;ng eo th&igrave; ngay cả khi trọng lượng kh&ocirc;ng qu&aacute; nặng nề, th&igrave; bạn n&ecirc;n t&igrave;m ra những giải ph&aacute;p để loại bỏ v&ugrave;ng mỡ thừa đ&oacute;. Dưới đ&acirc;y l&agrave; 6 c&aacute;ch khoa học gi&uacute;p bạn giảm mỡ bụng hiệu quả, được nhiều người &aacute;p dụng.</p>\r\n\r\n<h3><strong>1/ Kh&ocirc;ng ăn đường v&agrave; tr&aacute;nh xa đồ uống c&oacute; đường.</strong></h3>\r\n\r\n<p>Một số nghi&ecirc;n cứu chỉ ra rằng, đường g&acirc;y ra t&aacute;c dụng ti&ecirc;u cực đối với khả năng trao đổi chất của cơ thể.</p>\r\n\r\n<p>Khi nạp nhiều đường v&agrave;o cơ thế, gan của bạn sẽ phải l&agrave;m việc qu&aacute; tải với fructose v&agrave; bắt buộc phải biến n&oacute; th&agrave;nh chất b&eacute;o. Đặc biệt, khi cơ thể bị dư thừa nhiều đường, n&oacute; sẽ phải t&iacute;ch lũy dưới dạng chất b&eacute;o ở phần bụng v&agrave; gan.</p>\r\n\r\n<p>Những loại đồ uống c&oacute; đường, li&ecirc;n quan đến nguy cơ tăng 60% b&eacute;o ph&igrave; ở đối tượng trẻ em. C&aacute;c đồ uống n&agrave;y gồm c&oacute;: Soda, nước &eacute;p tr&aacute;i c&acirc;y c&oacute; đường v&agrave; một đồ uống chứa đường kh&aacute;c.</p>\r\n\r\n<p>Ch&iacute;nh v&igrave; vậy, để đạt được mục ti&ecirc;u giảm mỡ bụng bạn bắt buộc phải tr&aacute;nh xa đường v&agrave; c&aacute;c loại đồ uống chứa đường.</p>\r\n\r\n<p><img alt=\"6 CÁCH ĐƠN GIẢN ĐỂ GIẢM MỠ BỤNG, BẠN ĐÃ BIẾT? - Ảnh 1\" src=\"https://cdn.wheystore.vn/upload/news_optimize/wst_1044_6_c__ch_____n_gi___n_______gi___m_m____b___ng__b___n______bi___t__image_1587725915_1.jpg\" title=\"6 CÁCH ĐƠN GIẢN ĐỂ GIẢM MỠ BỤNG, BẠN ĐÃ BIẾT? - Ảnh 1\" /></p>\r\n\r\n<p><em>Tr&aacute;nh xa đồ ăn/uống c&oacute; đường.</em></p>\r\n\r\n<h3><strong>2/ Ăn nhiều Protein.</strong></h3>\r\n\r\n<p>C&oacute; thể n&oacute;i ăn nhiều Protein l&agrave; một c&aacute;ch để giảm mỡ bụng l&acirc;u d&agrave;i. Theo đ&oacute;, Protein l&agrave; một chất dinh dưỡng đa lượng, giữa vai tr&ograve; tối quan trọng trong qu&aacute; tr&igrave;nh giảm c&acirc;n.</p>\r\n\r\n<p>Protein sẽ gi&uacute;p giảm tới 60%&nbsp; cảm gi&aacute;c th&egrave;m ăn của bạn, gi&uacute;p bạn ăn &iacute;t hơn 441 Calo mỗi ng&agrave;y v&agrave; tăng cường trao đổi chất nhiều hơn.</p>\r\n\r\n<p>Theo một số nh&agrave; nghi&ecirc;n cứu chứng minh, Protein kh&ocirc;ng chỉ gi&uacute;p giảm c&acirc;n m&agrave; c&ograve;n gi&uacute;p bạn tr&aacute;nh được khả năng tăng c&acirc;n trở lại nếu bạn &aacute;p dụng đ&uacute;ng v&agrave; hợp l&yacute; lượng Protein nạp v&agrave;o mỗi ng&agrave;y.</p>\r\n\r\n<h3><strong>3/ Loại bỏ Carbs.&nbsp;</strong></h3>\r\n\r\n<p>Giảm thiểu việc ăn c&aacute;c loại Carbs (tinh bột) l&agrave; c&aacute;ch cực kỳ hiệu quả để giảm b&eacute;o. Một chế độ ăn &iacute;t carbs sẽ gi&uacute;p giảm chất b&eacute;o trong bụng, c&aacute;c cơ quan xung quanh v&ugrave;ng n&agrave;y v&agrave; trong gan.</p>\r\n\r\n<p>Bạn n&ecirc;n c&acirc;n nhắc việc giảm lượng Carb của bạn xuống c&ograve;n 50g Carbs mỗi ng&agrave;y. V&igrave; việc l&agrave;m n&agrave;y sẽ đưa cơ thể bạn v&agrave;o trạng th&aacute;y Ketosis, hạn chế việc th&egrave;m ăn v&agrave; sẽ đốt ch&aacute;y lượng chất b&eacute;o dư thừa l&agrave;m nhi&ecirc;n liệu đ&aacute;p ứng c&aacute;c hoạt động thường ng&agrave;y.</p>\r\n\r\n<h3><strong>4/ Ăn thực phẩm gi&agrave;u chất xơ.</strong></h3>\r\n\r\n<p>C&oacute; nhiều nghi&ecirc;n cứu chứng minh rằng, ăn nhiều chất xơ sẽ gi&uacute;p bạn giảm c&acirc;n hiệu quả.</p>\r\n\r\n<p>Trong một nghi&ecirc;n cứu k&eacute;o d&agrave;i tới 5 năm, khi ăn 10 gram chất xơ h&ograve;a tan một ng&agrave;y, c&oacute; li&ecirc;n quan đến việc sẽ gi&uacute;p giảm tới 3.7% lượng chất b&eacute;o trong v&ugrave;ng khoang bụng.</p>\r\n\r\n<p>V&agrave; tất nhi&ecirc;n, c&aacute;ch tốt nhất để nạp th&ecirc;m chất xơ v&agrave;o cơ thể l&agrave; ăn nhiều loại thực vậy từ rau củ đến c&aacute;c loại tr&aacute;i c&acirc;y. Ngo&agrave;i ra, c&aacute;c loại đậu v&agrave; ngũ cốc chẳng hạn yến mạch cũng l&agrave; những c&aacute;i t&ecirc;n rất đ&aacute;ng cho bạn sử dụng.</p>\r\n\r\n<p><img alt=\"6 CÁCH ĐƠN GIẢN ĐỂ GIẢM MỠ BỤNG, BẠN ĐÃ BIẾT? - Ảnh 2\" src=\"https://cdn.wheystore.vn/upload/news_optimize/wst_1044_6_c__ch_____n_gi___n_______gi___m_m____b___ng__b___n______bi___t__image_1587725915_2.jpg\" title=\"6 CÁCH ĐƠN GIẢN ĐỂ GIẢM MỠ BỤNG, BẠN ĐÃ BIẾT? - Ảnh 2\" /></p>\r\n\r\n<p><em>Ăn nhiều rau củ quả để tăng chất xơ gi&uacute;p cảm mỡ thừa hiệu quả.&nbsp;</em></p>\r\n\r\n<h3><strong>5/ Tập luyện hiệu quả.</strong></h3>\r\n\r\n<p>Tập luyện (thể dục, thể thao, thể h&igrave;nh) đ&oacute;ng vai tr&ograve; rất quan trọng trong việc giảm mỡ bụng nhanh, hiệu quả.</p>\r\n\r\n<p>Tập thể thao kh&ocirc;ng những n&acirc;ng cao sức khỏe m&agrave; khi bạn muốn giảm mỡ ở bất kỳ bộ phận n&agrave;o cũng sẽ c&oacute; những b&agrave;i tập ph&ugrave; hợp, t&aacute;c động đến bộ phận đ&oacute; gi&uacute;p giảm mỡ hiệu quả hơn. Ri&ecirc;ng phần mỡ bụng, để giảm bạn c&oacute; thể tập một số động t&aacute;c như: Plank, thể dục nhịp điệu, &hellip;</p>\r\n\r\n<p>C&aacute;c nghi&ecirc;n cứu chỉ ra, tập thể dục, thể h&igrave;nh thường xuy&ecirc;n gi&uacute;p ngăn chặn ho&agrave;n to&agrave;n khả tăng lại mỡ bụng sau khi giảm th&agrave;nh c&ocirc;ng, n&oacute; gi&uacute;p cơ thể duy tr&igrave; ở mức c&acirc;n nặng ổn định v&agrave; săn chắc nhưng với điều kiện l&agrave; phải tập luyện đều đặn, kh&ocirc;ng phải ng&agrave;y tập ng&agrave;y kh&ocirc;ng hoặc sau thời gian giảm được mỡ bụng rồi th&igrave; bỏ bẵng đi kh&ocirc;ng tập nữa.</p>\r\n\r\n<h3><strong>6/ Theo d&otilde;i lượng, loại thực phẩm bạn nạp hằng ng&agrave;y.</strong></h3>\r\n\r\n<p>Những ai muốn tối ưu h&oacute;a triệt để một chế độ ăn giảm mỡ bụng, họ cần theo d&otilde;i tất cả những thứ m&agrave; họ ăn/uống trong một qu&atilde;ng thời gian l&agrave; ho&agrave;n to&agrave;n cần thiết.</p>\r\n\r\n<p>Mọi người thường mắc phải vấn đề chung, phổ biến đ&oacute; l&agrave; nghĩ rằng họ đạng ăn với lượng Protein cao hay Low carbs nhưng thực tế những g&igrave; họ ăn lại rất kh&aacute;c, thường bị qu&aacute; mức so với dự t&iacute;nh.</p>\r\n\r\n<p>V&igrave; vậy, việc theo d&otilde;i chế độ ăn l&agrave; cần thiết, n&oacute; kh&ocirc;ng c&oacute; nghĩa l&agrave; bạn phải c&acirc;n nhắc hay đo lường trong suốt qu&atilde;ng thời gian sau n&agrave;y, nhưng cần thực hiện theo nguy&ecirc;n tắc hằng ng&agrave;y thậm ch&iacute; l&agrave; mỗi giờ, sẽ gi&uacute;p bạn nhận ra bạn cần thay đổi những g&igrave;.</p>\r\n\r\n<p>Tr&ecirc;n đ&acirc;y l&agrave; 6 c&aacute;ch đơn giản gi&uacute;p bạn giảm mỡ bụng, được nhiều người &aacute;p dụng v&agrave; đ&atilde; th&agrave;nh c&ocirc;ng. Hi vọng b&agrave;i viết sẽ hữu &iacute;ch với bạn v&agrave; ch&uacute;c bạn sớm th&agrave;nh c&ocirc;ng với mục ti&ecirc;u h&igrave;nh thể của m&igrave;nh.</p>', '2020-05-08 12:27:04', 1, 1, '2020-05-08 12:30:32'),
(17, '6 SAI LẦM THƯỜNG XUYÊN MẮC PHẢI TRONG CHẾ ĐỘ ĂN KIÊNG SIẾT CƠ', '6-sai-lam-thuong-xuyen-mac-phai-trong-che-do-an-kieng-siet-co', 1, 1, 5, 0, 'Phương pháp giảm mỡ', '2020-05-08__1018-catalog-6-sai-l-m-th-ng-xuy-n-m-c-ph-i-trong-ch-n-ki-ng-si-t-c-main-1587725896.png', '<p>6 SAI LẦM THƯỜNG XUY&Ecirc;N MẮC PHẢI TRONG CHẾ ĐỘ ĂN KI&Ecirc;NG SIẾT CƠ</p>\r\n\r\n<p>Khi thực hiện chế độ ăn siết cơ, gymer thường xuy&ecirc;n v&ocirc; t&igrave;nh mắc phải c&aacute;c lỗi sai cơ bản m&agrave; kh&ocirc;ng hề hay biết. C&ugrave;ng t&igrave;m hiểu 6 sai lầm thường xuy&ecirc;n mắc phải trong chế độ ăn ki&ecirc;ng siết cơ dưới đ&acirc;y để xem m&igrave;nh c&oacute; đang mắc lỗi kh&ocirc;ng nh&eacute;!</p>\r\n\r\n<p><strong>SAI LẦM 1: KH&Ocirc;NG ĂN QU&Aacute; NHIỀU CALO.</strong><br />\r\nĂn &iacute;t calo hơn số calo bạn cần trong ng&agrave;y sẽ tạo ra sự thiếu hụt calo dẫn đến việc đốt mỡ. Tuy nhi&ecirc;n cắt qu&aacute; nhiều calo sẽ l&agrave;m chậm qu&aacute; tr&igrave;nh trao đổi chất, v&agrave; cuối c&ugrave;ng l&agrave; rất kh&oacute; gi&uacute;p cho cơ thực sự n&eacute;t.<br />\r\n<strong>Giải ph&aacute;p:</strong>&nbsp;Giảm lượng calo từ từ. Giảm 10% tổng lượng calo nạp v&agrave;o cơ thể l&agrave; đ&atilde; đủ.</p>\r\n\r\n<p><strong>SAI LẦM 2: KH&Ocirc;NG N&Ecirc;N ĂN QU&Aacute; NHIỀU PROTEIN NHƯ &ldquo;LỜI ĐỒN&rdquo;</strong><br />\r\nHiển nhi&ecirc;n l&agrave; khi bạn cắt lượng calo nạp v&agrave;o cơ thể th&igrave; bạn sẽ cần th&ecirc;m protein. Lượng Protein nạp th&ecirc;m được d&ugrave;ng như nhi&ecirc;n liệu cho cơ thể hoạt động, tr&aacute;nh mất cơ khi bạn đang ăn ki&ecirc;ng. Tuy nhi&ecirc;n nhiều VĐV thể h&igrave;nh lại chọn mức protein qu&aacute; lố so với nhu cầu thực sự.<br />\r\nGiải ph&aacute;p: Đ&atilde; la nguy&ecirc;n tắc cố định, d&ugrave;ng kh&ocirc;ng qu&aacute; 3gr protein/kg nặng cơ thể khi trong chế độ ăn ki&ecirc;ng. D&ugrave;ng qu&aacute; nhiều proteins, lượng protein thừa sẽ c&oacute; xu hướng t&iacute;ch lại th&agrave;nh chất b&eacute;o sẽ cản trở việc bạn đạt được độ n&eacute;t mong muốn.</p>\r\n\r\n<p><strong>SAI LẦM 3: ĐỪNG XA L&Aacute;NH CARB</strong><br />\r\nCarb vừa l&agrave; bạn vừa l&agrave; kẻ th&ugrave;, Carb gi&uacute;p tạo ra cơ bắp bằng c&aacute;ch tạo ra m&ocirc;i trường hooc m&ocirc;n insulin; tuy nhi&ecirc;n, mức insulin tăng l&ecirc;n c&oacute; thể l&agrave;m giảm qu&aacute; tr&igrave;nh giảm b&eacute;o của cơ thể. Nguy&ecirc;n nh&acirc;n thứ hai dẫn đến 1 thực tế l&agrave; nhiều vđv c&oacute; xu hướng lựa chọn 1 chế độ ăn ki&ecirc;ng carb thấp Khi lượng carb nạp v&agrave;o cơ thể giảm xuống, cơ thể bắt đầu đốt chất b&eacute;o l&agrave;m năng lượng. Kh&ocirc;ng may l&agrave; ăn qu&aacute; &iacute;t carb sẽ khiến cho cơ thể l&agrave;m tan cả khối cơ c&ugrave;ng với chất b&eacute;o<br />\r\n<strong>Giải ph&aacute;p:</strong>&nbsp;c&acirc;n nhắc 2gr carb/1kg nặng cơ thể đ&atilde; c&oacute; thể l&agrave; 1 chế độ ăn ki&ecirc;ng carb thấp, đủ để giảm b&eacute;o nhưng kh&ocirc;ng l&agrave;m mất cơ bắp.</p>\r\n\r\n<p><strong>SAU LẦM 4: ĐỪNG COI THƯỜNG THỜI GIAN NẠP CARB V&Agrave;O CƠ THỂ.</strong><br />\r\nĐơn giản l&agrave; chia tổng lượng carb của bạn th&agrave;nh 5 hoặc 6 phần trong 1 ng&agrave;y l&agrave; một lựa chọn đ&uacute;ng đắn. nhưng c&aacute;c b&aacute;o c&aacute;o từ c&aacute;c VĐV thể h&igrave;nh h&agrave;ng đầu chỉ ra rằng, nếu ăn carb v&agrave;o bữa cuối c&ugrave;ng trong ng&agrave;y sẽ l&agrave;m giảm khả năng giảm b&eacute;o đ&aacute;ng kể.<br />\r\n<strong>Giải ph&aacute;p:</strong>&nbsp;Bỏ carb trong bữa ăn cuối ng&agrave;y; thay v&agrave;o đ&oacute;, ăn nhiều carb hơn sau buổi tập v&agrave; v&agrave;o bữa s&aacute;ng. C&oacute; 2 bữa ăn m&agrave; bạn cần c&oacute; nhiều carb hơn. V&agrave;o buổi s&aacute;ng một lượng lớn hơn carb sẽ l&agrave; nguồn dự trữ cho đường trong cơ bắp hơn l&agrave; chất b&eacute;o do cơ thể nhạy cảm với insulin v&agrave;o buổi s&aacute;ng do dự trữ glycogen thấp. Bữa ăn sau khi tập đ&ograve;i hỏi nhiều carb để b&ugrave; đắp lại lượng cơ bị ph&aacute; hủy sau buổi tập. Carb ăn sau buổi tập c&oacute; t&aacute;c dụng phục hồi cơ bắp, kh&ocirc;ng tồn lại th&agrave;nh chất b&eacute;o.</p>\r\n\r\n<p><strong>SAI LẦM 5: ĐỪNG N&Ecirc;N ĂN KI&Ecirc;NG QU&Aacute; MỨC.</strong><br />\r\nCh&uacute;ng ta biết rằng việc tập luyện nhiều hiệp v&agrave; thời gian tập qu&aacute; thường xuy&ecirc;n c&oacute; thể dẫn đến mất cơ. Quy tắc tương tự cũng &aacute;p dụng cho việc ăn ki&ecirc;ng. Khi bạn ăn ki&ecirc;ng 24/7 m&agrave; kh&ocirc;ng c&oacute; khoảng nghỉ, qu&aacute; tr&igrave;nh chuyển h&oacute;a của bạn sẽ c&oacute; xu hướng đi xuống. Nếu điều đ&oacute; xảy ra th&igrave; việc siết cơ kh&ocirc; trở n&ecirc;n rất kh&oacute; khăn.<br />\r\n<strong>Giải ph&aacute;p:</strong>&nbsp;trong qu&aacute; tr&igrave;nh giảm b&eacute;o, thử phương ph&aacute;p 4 on/1 off. C&oacute; nghĩa l&agrave; trong 4 ng&agrave;y giữ lượng carb nạp v&agrave;o cơ thể l&agrave; 2gr/kg cơ thể (kh&ocirc;ng ăn carb v&agrave;o bữa cuối ng&agrave;y) v&agrave;o ng&agrave;y thứ 5, nghỉ ăn ki&ecirc;ng, tăng lượng carb nạp v&agrave;o cơ thể nhiều l&ecirc;n c&oacute; thể l&ecirc;n tới 6 gr/kg cơ thể. Lượng carb cao hơn kh&ocirc;ng chỉ cung cấp năng lượng cần thiết m&agrave; c&ograve;n chống lại sự suy giảm của qu&aacute; tr&igrave;nh trao đổi chất.</p>\r\n\r\n<p><strong>SAI LẦM 6: ĐỪNG QU&Aacute; CH&Uacute; TRỌNG TẬP CARDIO QU&Aacute; MỨC</strong><br />\r\n2 c&aacute;ch ch&iacute;nh để siết cơ l&agrave; nạp &iacute;t calo hơn v&agrave; calo ti&ecirc;u thụ v&agrave; thứ hai l&agrave; nhờ v&agrave;o c&aacute;c b&agrave;i Cardio. D&ugrave; cho cardio l&agrave; rất hữu &iacute;ch, nhưng nếu tập qu&aacute; nhiều sẽ dẫn đến giảm lượng testosterone, ảnh hưởng đến việc giữ g&igrave;n cơ bắp<br />\r\n<strong>Giải ph&aacute;p:</strong>&nbsp;Tập xe đạp hoặc đi bộ kh&ocirc;ng qu&aacute; 4 lần/tuần trong thời gian từ 30-40 ph&uacute;t. Bấy nhi&ecirc;u đ&oacute; cũng đủ đốt mỡ m&agrave; kh&ocirc;ng g&acirc;y ra việc giảm testosterone.</p>\r\n\r\n<p>Hy vọng với những chia sẻ về&nbsp;<strong>6 sai lầm trong chế độ ăn ki&ecirc;ng siết cơ</strong>&nbsp;tr&ecirc;n đ&acirc;y sẽ gi&uacute;p gymer thực hiện chế độ ăn ki&ecirc;ng siết cơ đ&uacute;ng đắn v&agrave; th&agrave;nh c&ocirc;ng!</p>', '2020-05-08 12:28:19', 1, 1, '2020-05-08 12:30:19'),
(19, 'Omega 3 loại nào tốt nhất? Cách chọn Omega 3 phù hợp', 'omega-3-loai-nao-tot-nhat-cach-chon-omega-3-phu-hop', 1, 1, 3, 0, 'Omega 3 là 1 loại Vitamin, khoáng chất thiếu yếu trong cơ thể chúng ta. Đối với mọi đối tượng, mọi giới tính đều cần bổ sung Omega 3 một cách hợp lý. Tuy nhiên với thị trường Omega 3 đầy \"biến động\" như hiện nay. Bạn đã biết cách phân biệt và chọn được Omega 3 loại nào tốt nhất chưa? Wheystore sẽ giúp bạn điều này.', '2020-06-16__omega3.jpg', '<h3><strong>Dầu c&aacute; Omega 3 l&agrave; g&igrave;?</strong></h3>\r\n\r\n<p>- Dầu c&aacute; Omega 3 l&agrave; 1 dạng&nbsp;<a href=\"https://www.wheystore.vn/c162/vitamin-khoang-chat\"><strong>Vitamin, kho&aacute;ng chất</strong></a>&nbsp;v&ocirc; c&ugrave;ng cần thiết cho cơ thể.</p>\r\n\r\n<p>- Loại acid b&eacute;o n&agrave;y c&oacute; chứa trong đậu n&agrave;nh, c&aacute; biển...c&oacute; t&aacute;c dụng rất tốt đối với tr&iacute; n&atilde;o, tim mạch v&agrave; l&agrave;n da. C&oacute; thể sử dụng cho cả người lớn v&agrave; trẻ em.</p>\r\n\r\n<p>- Dầu c&aacute; Omega 3 thường được chiết xuất từ c&aacute;c m&ocirc; của những lo&agrave;i c&aacute; c&oacute; chứa dầu như c&aacute; thu, c&aacute; hồi, c&aacute; ngừ, c&aacute; m&ograve;i, c&aacute; tr&iacute;ch, c&aacute; voi,&hellip;</p>\r\n\r\n<p><img alt=\"Omega 3 loại nào tốt nhất? Cách chọn Omega 3 phù hợp - Ảnh 1\" src=\"https://cdn.wheystore.vn/upload/news_optimize/wst_1592019968_omega_3_loai_nao_tot_nhat__cach_chon_omega_3_phu_hop_image_1592019968_1.jpg\" title=\"Omega 3 loại nào tốt nhất? Cách chọn Omega 3 phù hợp - Ảnh 1\" /></p>\r\n\r\n<h3><strong>C&ocirc;ng dụng tuyệt vời từ dầu c&aacute; Omega 3</strong></h3>\r\n\r\n<p>- Đối với trẻ em: tăng c&aacute;c điểm nhận thức, kỹ năng vận động tốt hơn</p>\r\n\r\n<p>- Đối với tim mạch: Hệ tim mạch của bạn hoạt động tốt hơn, dầu c&aacute; c&oacute; thể l&agrave;m giảm nồng độ lipid trung t&iacute;nh từ 15-30%.</p>\r\n\r\n<p>- Đối với n&atilde;o: k&igrave;m h&atilde;m sự l&atilde;o h&oacute;a n&atilde;o, ngăn ngừa sự suy giảm tr&iacute; nhớ.</p>\r\n\r\n<p>- Đối với l&agrave;n da: c&oacute; vai tr&ograve; quan trọng trong cấu tr&uacute;c da v&agrave; đặc biệt l&agrave; tầng sừng. Ngăn ngừa hiện tượng mất nước giữa c&aacute;c lớp da. Do đ&oacute; gi&uacute;p da mềm mại tươi trẻ.</p>\r\n\r\n<p>- Dầu c&aacute; gi&uacute;p ngăn ngừa c&aacute;c mảng b&aacute;m h&igrave;nh th&agrave;nh trong động mạch v&agrave; khiến cho ch&uacute;ng co lại. Cũng như l&agrave;m cho c&aacute;c mảng b&aacute;m trong động mạch ổn định. An to&agrave;n hơn đối với những người mắc phải bệnh xơ vữa động mạch.</p>\r\n\r\n<p>- Dầu c&aacute; gi&uacute;p bạn giảm b&eacute;o, thu gọn v&ograve;ng bụng hơn, giảm thiểu bệnh b&eacute;o ph&igrave;, bảo vệ mắt v&agrave; n&atilde;o bộ của bạn.</p>\r\n\r\n<p>- Ngo&agrave;i ra dầu c&aacute; c&ograve;n gi&uacute;p tăng khả năng tổng hợp protein, gi&uacute;p cơ bắp ph&aacute;t triển tối ưu hơn.</p>\r\n\r\n<p>- Ch&iacute;nh v&igrave; thế đầu c&aacute; cũng được coi l&agrave; một trong những&nbsp;<a href=\"https://www.wheystore.vn/c152/whey-protein-tang-co\" rel=\"noopener noreferrer\" target=\"_blank\"><strong>Whey Protein</strong></a>&nbsp;cơ bắp cần thiết. Ch&iacute;nh v&igrave; thế bổ sung dầu c&aacute; omega 3&nbsp;l&agrave; rất cần thiết đối với cơ thể con người. Đặc biệt l&agrave; những người đang trong qu&aacute; tr&igrave;nh tập luyện!</p>\r\n\r\n<h3><strong>C&aacute;c thực phẩm cung cấp nhiều dầu c&aacute; Omega 3 cho cơ thể</strong></h3>\r\n\r\n<p><strong><img alt=\"Omega 3 loại nào tốt nhất? Cách chọn Omega 3 phù hợp - Ảnh 2\" src=\"https://cdn.wheystore.vn/upload/news_optimize/wst_1592019968_omega_3_loai_nao_tot_nhat__cach_chon_omega_3_phu_hop_image_1592019968_2.jpg\" title=\"Omega 3 loại nào tốt nhất? Cách chọn Omega 3 phù hợp - Ảnh 2\" /></strong></p>\r\n\r\n<p>- Dầu c&aacute; Omega 3 c&oacute; nhiều c&ocirc;ng dụng l&agrave; vậy nhưng cũng kh&aacute; dễ d&agrave;ng bổ sung v&agrave;o cơ thể nhờ những thực phẩm quen thuộc sau: c&aacute;c loại c&aacute; biển như: c&aacute; cơm, c&aacute; m&ograve;i, c&aacute; tr&iacute;ch, c&aacute; hồi, c&aacute; thu, c&aacute; ngừ, trứng c&aacute;... B&ecirc;n cạnh đ&oacute; l&agrave; những loại hạt như: hạt chia, hạt lanh, đậu n&agrave;nh, quả &oacute;c ch&oacute;, rau ch&acirc;n vịt, đậu lăng,...</p>\r\n\r\n<p>- Hoặc 1 c&aacute;ch đơn giản, tiện lợi hơn m&agrave; hiện nay rất nhiều người đang &aacute;p dụng l&agrave; bạn c&oacute; thể mua những thực phẩm bổ sung Omega 3, những vi&ecirc;n nang dầu c&aacute;.</p>\r\n\r\n<p>- Tuy nhi&ecirc;n kh&aacute; nhiều bạn vẫn c&ograve;n đang thắc mắc dầu c&aacute; Omega 3 loại n&agrave;o tốt nhất, dầu omega 3 của mỹ loại n&agrave;o tốt nhất, c&aacute;ch chọn dầu c&aacute;,...</p>\r\n\r\n<h3><strong>Omega 3 loại n&agrave;o tốt nhất?</strong></h3>\r\n\r\n<p>Dầu c&aacute; Omega 3 kh&aacute; l&agrave; tốt, lại d&ugrave;ng được cho mọi đối tượng trẻ em v&agrave; người lớn v&igrave; thế bạn n&ecirc;n t&igrave;m mua những sản phẩm Omega 3 c&oacute; nguồn gốc xuất xứ r&otilde; r&agrave;ng, thương hiệu uy t&iacute;n, l&acirc;u năm như&nbsp;<strong>Wheystore</strong>. Sau đ&acirc;y l&agrave; những loại dầu c&aacute; Omega 3 m&agrave; bạn c&oacute; thể tham khảo:</p>\r\n\r\n<h4><strong>Now Omega-3</strong></h4>\r\n\r\n<p>Vi&ecirc;n dầu c&aacute;&nbsp;<strong>Now Omega-3</strong>&nbsp;c&ocirc; đặc l&agrave; chủ yếu c&oacute; nguồn gốc từ c&aacute; m&ograve;i, c&aacute; cơm, c&aacute; thu v&agrave; hỗ trợ sức khỏe tim mạch. Omega kh&ocirc;ng chứa Cholesterol &ndash; giảm nguy cơ mắc bệnh tim mạch.</p>\r\n\r\n<p><strong>Now Omega &ndash; 3 500 vi&ecirc;n&nbsp;</strong>(hoặc 200 vi&ecirc;n)&nbsp;cung cấp lượng&nbsp;<strong>Omega 3</strong>&nbsp;cần thiết gi&uacute;p bạn lu&ocirc;n khỏe mạnh v&agrave; lu&ocirc;n tr&agrave;n ngập năng lượng.&nbsp;<strong>Omega 3</strong>&nbsp;gi&uacute;p duy tr&igrave; một tr&aacute;i tim khỏe mạnh, tăng cường hệ miễn dịch, tăng cường sức khỏe n&atilde;o bộ v&agrave; kh&ocirc;ng chứa choresterol n&ecirc;n an to&agrave;n khi sử dụng.</p>\r\n\r\n<p>Uống 2 vi&ecirc;n mỗi ng&agrave;y trong bữa ăn.</p>\r\n\r\n<h4><strong>Platinum Fish Oil 100 vi&ecirc;n</strong></h4>\r\n\r\n<p><strong>Platinum 100% Fish Oil&nbsp;</strong>chỉ sử dụng nguồn Fish Oil tinh khiết. D&ugrave;ng c&ocirc;ng nghệ si&ecirc;u ph&acirc;n lọc để cung cấp nhiều hơn c&aacute;c axit b&eacute;o chủ yếu omega-3 v&agrave;o trong sản phẩm &ndash; DHA v&agrave; EPA.</p>\r\n\r\n<p>Những vi&ecirc;n nang mềm được d&ugrave;ng kỹ thuật bao bọc gi&uacute;p ngăn ngừa m&ugrave;i c&aacute; kh&oacute; chịu m&agrave; bạn thường gặp khi d&ugrave;ng c&aacute;c sản phẩm rẻ tiền kh&aacute;c.</p>\r\n\r\n<p>Sản phẩm ph&ugrave; hợp sử dụng với bất kỳ sản phẩm n&agrave;o trong d&ograve;ng MuscleTech&reg; Essential Series</p>\r\n\r\n<p>Mỗi lần d&ugrave;ng 1 vi&ecirc;n&nbsp;<strong>Fish Oil</strong>, uống với nước.</p>\r\n\r\n<h3><strong>C&aacute;ch chọn Omega 3 ph&ugrave; hợp</strong></h3>\r\n\r\n<p>- Đảm bảo dầu c&aacute; bạn chọn mua c&oacute; DHA v&agrave; EPA.</p>\r\n\r\n<p>- Độ tinh khiết của sản phẩm, độ uy t&iacute;n của cửa h&agrave;ng. Tr&aacute;nh mua những cửa h&agrave;ng kh&ocirc;ng uy t&iacute;n, h&agrave;ng h&oacute;a kh&ocirc;ng c&oacute; nguồn gốc xuất xứ r&otilde; r&agrave;ng bạn nh&eacute;.</p>\r\n\r\n<p>- Kiểm tra về hạn sử dụng. Dầu c&aacute; Omega 3 rất dễ bị &ocirc;i. Khi chọn mua bạn nhớ kiểm tra kỹ về hạn d&ugrave;ng của sản phẩm.</p>', '2020-06-16 03:33:12', 0, 1, '2020-06-16 03:34:07');
