(1, 'Mutant Mass 15lbs (6.8Kg)', 'mutant-mass-15lbs-68kg', 1800000, 1, 0, 5, '2020-03-24__mutant-mass-15lbs-6-8kg-image-1562510585.jpg', 60, 1, 1, 14, 'Mutant Mass 15lbs (6.8Kg) là cuộc cách mạng về tăng cơ bắp và cân nặng. Cung cấp cho cơ thể bạn một loạt các chất dinh dưỡng, phù hợp cho những người muốn thay đổi cân nặng.', 'Mutant Mass 15lbs (6.8Kg) là cuộc cách mạng về tăng cơ bắp và cân nặng. Cung cấp cho cơ thể bạn một loạt các chất dinh dưỡng, phù hợp cho những người muốn thay đổi cân nặng.', 2, 7, '2020-03-23 21:59:28', 20, '24ser', '1500cal', 3, '2020-08-05 02:05:41'),
(4, 'Alive Men\'s Energy 50 viên', 'alive-mens-energy-50-vien', 350000, 4, 0, 5, '2020-05-08__209-image-alive-men-s-energy-50-vien-image-1587722858.jpg', 78, 1, 1, 16, 'Vitamin tổng hợp Alive Men\'s Energy bổ sung 20 loại vitamin và khoáng chất thiết yếu cho cơ thể, tăng cường năng lượng và tăng khả năng hấp thu của cơ thể.', 'Alive Men\'s Energy - Bổ sung năng lượng từ thiên nhiên\r\nVitamin tổng hợp Alive Men’s Energy cho nam giới bổ sung 20 loại vitamin và khoáng chất thiết yếu cho cơ thể, thành phần bổ sung vitamin B giúp dễ dàng chuyển hóa thức ăn thành nhiên liệu để bổ sung năng lượng cho cơ thể hoạt động hiệu quả.\r\n\r\nƯu điểm nổi bật của Alive Men’s Energy:\r\nChứa đến 20 loại vitamin, khoáng chất được chiết xuất từ 26 loại rau quả hữu cơ góp phần chăm sóc toàn diện cho phái mạnh.\r\nCung cấp năng lượng giúp cơ thể khoẻ mạnh, tăng cường hệ miễn dịch, hỗ trợ tăng cường thị lực.\r\nTăng khả năng hấp thu và cân bằng dưỡng chất.\r\nHỗ trợ giảm sự mệt mỏi, căng thẳng và tăng cường sức đề kháng, nâng cao tinh thần và hiệu quả làm việc.\r\nCông thức bổ trợ tối ưu bổ sung năng lượng tuyệt vời đa tác động:\r\n1. Hỗ trợ sản xuất và chuyển hóa năng lượng\r\n\r\n- Alive Men’s Energy cung cấp thành phần vitamin nhóm B, đây là các vitamin tham gia tích cực vào chu trình Kreb, chuyển hóa carbonhydrate thành năng lượng, giúp bổ sung năng lượng đầy đủ cho các hoạt động của cơ thể.\r\n\r\n- Ngoài ra, các chất vi lượng như đồng, kẽm, crom, can-xi cũng có vai trò quan trọng trong việc thúc đẩy quá trình trao đổi chất, sinh năng lượng.\r\n\r\n2. Chống oxy hóa\r\n\r\n- Alive Men’s Energy bổ sung các thành phần như selen, kẽm, beta-caroten, vitamin A, C, E có vai trò ngăn chặn quá trình hình thành các gốc tự do, từ đó làm chậm lại quá trình oxy hóa, giúp hạn chế lão hóa tế bào.\r\n\r\n- Kết hợp với các chất chống ô xy hóa chiết xuất từ thực vật, các caroten nguồn gốc thiên nhiên có chứa carotenes khác như zeaxanthin, lutein, lycopene, vitamin tổng hợp Alive Men’s Energy có khả năng hỗ trợ phòng ngừa các bệnh lý liên quan đến lão hóa, rối loạn lipid máu, đục thủy tinh thể, thoái hóa hoàng điểm.\r\n\r\n3. Hỗ trợ cho hệ tim mạch:\r\n\r\nVới công thức bổ sung vitamin B6, B12, acid folic, Alive Men’s Energy giúp điều hòa nồng độ homocystein trong máu, qua đó giảm nguy cơ huyết khối, xơ vữa động mạch.\r\n\r\nHướng dẫn sử dụng:\r\nĐể đạt hiệu quả cao nhất khi sử dụng vitamin tổng hợp Alive Men’s Energy, bạn nên sử dụng mỗi ngày 1 viên vào buổi sáng và cùng với thức ăn để nạp năng lượng đầy đủ cho ngày mới.', 4, 15, '2020-05-08 13:05:02', 20, '50v', NULL, 4, '2020-08-14 16:48:38'),
(5, 'Platinum 100% Fish Oil 100 viên', 'platinum-100-fish-oil-100-vien', 300000, 4, 0, 5, '2020-05-08__126-image-catalog-platinum-100-fish-oil-100-vien-image-catalog-1587722781.jpg', 24, 1, 1, 4, 'MuscleTech Platinum 100% Fish Oil 100 viên được phân phối tại WheyStore là hàng chính hãng, cam kết đem đến các bạn nguồn EPA/DHA tinh khiết chất lượng, cần thiết cho cơ thể.', 'Platinum Fish Oil 100% tinh khiết\r\n- Platinum 100% Fish Oil chỉ sử dụng nguồn Fish Oil tinh khiết .Dùng công nghệ siêu phân lọc để cung cấp nhiều hơn các axit béo chủ yếu omega-3 vào trong sản phẩm – docosahexaenoic acid (DHA) and eicosapentaenoic acid (EPA).\r\n\r\n- Platinum 100% Fish Oil là một sản phẩm hỗ trợ bổ sung dầu cá cung cấp nguồn EPA/DHA tinh khiết đúng với những gì cơ thể bạn cần.\r\n\r\nĐiểm nổi bật của Platinum 100% Fish Oil\r\n- Những viên nang mềm được dùng kỹ thuật bao bọc giúp ngăn ngừa mùi cá khó chịu mà bạn thường gặp khi dùng các sản phẩm rẻ tiền khác.\r\n\r\n- Sản phẩm phù hợp sử dụng với bất kỳ sản phẩm nào trong dòng MuscleTech® Essential Series\r\n\r\nHướng dẫn sử dụng\r\n- Mỗi lần dùng 1 viên Fish Oil, uống với nước\r\n\r\n- Tuỳ thuộc vào trọng lượng cơ thể để bạn bổ sung nhiều lần cho đủ lượng EPA/DHA cho cơ thể.\r\n\r\n- Đọc kỹ hướng dẫn trước khi sử dụng.\r\n\r\nChú ý :\r\n- Không sử dụng sản phẩm với phụ nữ đang mang thai và cho con bú. Hỏi bác sỹ trước khi bắt đầu bất cứ chương trình ăn kiêng hoặc tập luyện.\r\n\r\n- Ngưng sử dụng sản phẩm và đến bác sỹ tư vấn nếu có những biểu hiện bất thường.\r\n\r\n- Không sử dụng sản phẩm khi vỏ hộp sản phẩm bị rách.\r\n\r\n- Giữ sản phẩm ở nơi mát và khô.\r\n\r\n- Sản phẩm này không phải thuốc nên không có tác dụng ngừa và chữa bệnh.', 2, 7, '2020-05-08 15:03:15', 15, '100', '10 Cal', 4, '2020-06-18 23:23:31'),
(6, 'Hydroxycut NextGen 100 viên', 'hydroxycut-nextgen-100-vien', 550000, 6, 0, 5, '2020-05-30__giammo1.jpg', 7, 1, 1, 1, 'Hydroxycut Next Gen gia tăng mạnh mẽ sự sinh nhiệt trong cơ thể giúp gia tăng tỷ lệ trao đổi chất của bạn.', 'Hydroxycut Next Gen gia tăng mạnh mẽ sự sinh nhiệt trong cơ thể giúp gia tăng tỷ lệ trao đổi chất của bạn.', 0, 0, '2020-05-30 16:22:02', 25, '50', '0 Cal', 4, '2020-05-30 16:34:07'),
(7, 'Lipo6 Black 60 viên', 'lipo6-black-60-vien', 590000, 6, 0, 5, '2020-05-30__giammo2.jpg', 4, 1, 1, 1, 'Lipo 6 Black Container 60v - Viên uống tập trung, cung cấp năng lượng với công thức đặc biệt đốt cháy chất béo dư thừa. Công thức đặc biệt tập trung đốt cháy mỡ thừa đem lại hiệu quả kinh ngạc.', 'Lipo 6 Black Container 60v - Viên uống tập trung, cung cấp năng lượng với công thức đặc biệt đốt cháy chất béo dư thừa. Công thức đặc biệt tập trung đốt cháy mỡ thừa đem lại hiệu quả kinh ngạc.', 0, 0, '2020-05-30 16:30:30', 25, '60', '10 Cal', 4, '2020-05-30 16:34:14'),
(8, 'SEMTEX 60 viên 30 lần dùng (bản mới)', 'semtex-60-vien-30-lan-dung-ban-moi', 690000, 6, 0, 5, '2020-05-30__giammo3.jpg', 5, 1, 1, 0, 'Nếu bạn đang bận lòng về những tảng mỡ bụng cứng đầu khó giảm, mỡ tay sau làm tay bạn không được rắn chắc. Bạn đang chán nản khi tập mãi chẳng thấy bắp vai đâu, cơ bụng đâu. Đừng lo về điều đấy. SEMTEX \"khối thuôc nổ\" mạnh mẽ đủ sức phá tan mọi tảng mỡ cứng đầu nhất', 'Nếu bạn đang bận lòng về những tảng mỡ bụng cứng đầu khó giảm, mỡ tay sau làm tay bạn không được rắn chắc. Bạn đang chán nản khi tập mãi chẳng thấy bắp vai đâu, cơ bụng đâu. Đừng lo về điều đấy. SEMTEX \"khối thuôc nổ\" mạnh mẽ đủ sức phá tan mọi tảng mỡ cứng đầu nhất', 0, 0, '2020-05-30 16:32:04', 25, '60', '10 Cal', 3, '2020-05-30 16:34:09'),
(9, 'Hydroxycut Elite Hardcore 100 Viên', 'hydroxycut-elite-hardcore-100-vien', 490000, 6, 0, 5, '2020-05-30__giammo4.jpg', 4, 1, 1, 0, 'Với sản phẩm Hydroxycut Elite là công thức giảm cân mới cực mạnh được sản xuất bởi MuscleTech giúp cho bạn có được 1 vóc dáng hoàn hảo như bạn hằng mong muốn.', 'Với sản phẩm Hydroxycut Elite là công thức giảm cân mới cực mạnh được sản xuất bởi MuscleTech giúp cho bạn có được 1 vóc dáng hoàn hảo như bạn hằng mong muốn.', 0, 0, '2020-05-30 16:33:58', 25, '50', '10 Cal', 4, '2020-05-30 16:34:11'),
(10, 'Yến Mạch QUAKER OATS - 4.5kg', 'yen-mach-quaker-oats-45kg', 330000, 6, 0, 5, '2020-05-30__giammo5.jpg', 25, 1, 1, 15, 'Yến mạch Quaker Oats cung cấp nguồn năng lượng sạch để tập luyện khỏe hơn, giảm cân tốt hơn, giảm thiểu các bệnh về tim mạch, cân bằng lượng Cholesterol cho người tập Gym.', 'Yến mạch Quaker Oats cung cấp nguồn năng lượng sạch để tập luyện khỏe hơn, giảm cân tốt hơn, giảm thiểu các bệnh về tim mạch, cân bằng lượng Cholesterol cho người tập Gym.', 2, 8, '2020-05-30 16:38:32', 30, 'N/A', '200 Cal', 4, '2020-08-05 02:06:30'),
(12, 'Mammoth Multi 30 Servings', 'mammoth-multi-30-servings', 500000, 4, 0, 5, '2020-05-30__vitamin1.jpg', 8, 1, 1, 1, 'Mammoth Multi cung cấp các vitamin và khoáng chất quan trọng giúp cơ thể có đầy đủ các chất thiết yếu, phát triển tốt toàn diện, luôn luôn khỏe mạnh tựa Voi Mammoth', 'Mammoth Multi cung cấp các vitamin và khoáng chất quan trọng giúp cơ thể có đầy đủ các chất thiết yếu, phát triển tốt toàn diện, luôn luôn khỏe mạnh tựa Voi Mammoth', 0, 0, '2020-05-30 16:53:09', 30, '30', '10 Cal', 4, '2020-05-31 18:45:57'),
(13, 'Vitabolic 196 viên', 'vitabolic-196-vien', 590000, 4, 0, 5, '2020-05-30__vitamin2.jpg', 4, 1, 1, 0, 'Vitabolic chính hãng Nutrabolics không chỉ bổ sung vitamin, khoáng chất mà còn có những chất tăng cường hệ miễn dịch, tăng trao đổi chất, tăng cường năng lượng tự nhiên của cơ thể.', 'Vitabolic chính hãng Nutrabolics không chỉ bổ sung vitamin, khoáng chất mà còn có những chất tăng cường hệ miễn dịch, tăng trao đổi chất, tăng cường năng lượng tự nhiên của cơ thể.', 0, 0, '2020-05-30 16:57:31', 30, '28', '10 Cal', 4, '2020-05-31 18:45:54'),
(14, 'Now Omega-3 200 viên', 'now-omega-3-200-vien', 400000, 4, 0, 5, '2020-05-31__vitamin3.jpg', 6, 1, 1, 1, 'Viên dầu cá Now Omega-3 200 viên cô đặc là chủ yếu có nguồn gốc từ cá mòi, cá cơm, cá thu và hỗ trợ sức khỏe tim mạch. Omega không chứa Cholesterol - giảm nguy cơ mắc bệnh tim mạch.', 'Viên dầu cá Now Omega-3 200 viên cô đặc là chủ yếu có nguồn gốc từ cá mòi, cá cơm, cá thu và hỗ trợ sức khỏe tim mạch. Omega không chứa Cholesterol - giảm nguy cơ mắc bệnh tim mạch.', 0, 0, '2020-05-30 17:01:52', 30, '100', '20 Cal', 4, '2020-05-31 18:45:52'),
(15, 'Dymatize Super Mass 5.4kg', 'dymatize-super-mass-54kg', 1290000, 1, 0, 5, '2020-05-31__mass1.jpg', 10, 1, 1, 0, 'Sữa tăng cân Super Mass với thành phần nguyên liệu chất lượng cao và nguồn dưỡng chất tiêu chuẩn giúp gia tăng tối đa sức mạnh và kích thước cơ bắp - bảo vệ cơ bắp khỏi quá trình dị hóa.', 'Sữa tăng cân Super Mass với thành phần nguyên liệu chất lượng cao và nguồn dưỡng chất tiêu chuẩn giúp gia tăng tối đa sức mạnh và kích thước cơ bắp - bảo vệ cơ bắp khỏi quá trình dị hóa.', 0, 0, '2020-05-30 17:06:49', 0, '16', '1280 Cal', 4, '2020-05-31 18:45:51'),
(16, 'Labrada Muscle Mass 12lbs 5.4Kg', 'labrada-muscle-mass-12lbs-54kg', 1550000, 1, 0, 5, '2020-05-31__mass2.jpg', 29, 1, 1, 8, 'Muscle Mass Gainer 12Lbs là dòng sữa tăng cân cho người gầy thiếu cân, khó hấp thụ, bởi chỉ với một lượng phù hợp được hấp thụ Mass Gainer làm cơ thể dễ thích nghi, tăng cân lành mạnh.', 'Muscle Mass Gainer 12Lbs là dòng sữa tăng cân cho người gầy thiếu cân, khó hấp thụ, bởi chỉ với một lượng phù hợp được hấp thụ Mass Gainer làm cơ thể dễ thích nghi, tăng cân lành mạnh.', 4, 16, '2020-05-30 17:10:48', 30, '16', '1265 Cal', 4, '2020-08-20 11:23:28'),
(17, 'Serious Mass 12 Lbs (5,44kg)', 'serious-mass-12-lbs-544kg', 1290000, 1, 0, 5, '2020-06-01__mass3.jpg', 2, 1, 1, 0, 'Serious Mass là sản phẩm hỗ trợ tăng cân dành cho người gầy kém ăn, vận động viên, người chơi thể thao. Với vitamin và khoáng chất dễ dàng hấp thụ sẽ giúp cơ thể cải thiện cân nặng.', 'Serious Mass là sản phẩm hỗ trợ tăng cân dành cho người gầy kém ăn, vận động viên, người chơi thể thao. Với vitamin và khoáng chất dễ dàng hấp thụ sẽ giúp cơ thể cải thiện cân nặng.', 0, 0, '2020-05-31 18:50:37', 30, '16', '1350 Cal', 4, '2020-05-31 19:12:16'),
(18, 'Serious Mass 6lbs (2.72KG)', 'serious-mass-6lbs-272kg', 800000, 1, 0, 5, '2020-06-01__mass4.jpg', 4, 1, 1, 0, 'Serious Mass 6lbs giàu glutamine cung cấp cho bạn 1 hàm lượng amino cao giúp phục hồi nhanh chóng và tăng trưởng tối đa. Hàng chính hãng, có tem chống giả, giá tốt kèm quà tặng.', 'Serious Mass 6lbs giàu glutamine cung cấp cho bạn 1 hàm lượng amino cao giúp phục hồi nhanh chóng và tăng trưởng tối đa. Hàng chính hãng, có tem chống giả, giá tốt kèm quà tặng.', 0, 0, '2020-05-31 18:52:31', 25, '8', '1350 Cal', 4, '2020-05-31 19:12:18'),
