(26, 'Essential Aminos 30 servings', 'essential-aminos-30-servings', 550000, 3, 0, 5, '2020-06-01__bcaa1.jpg', 2, 1, 1, 0, 'Để mang lại hiệu quả tốt nhất, bạn nên sử dụng theo khuyến cáo từ hãng. Thời điểm tốt nhất bạn nên sử dụng đó là trong quá trình tập, hoặc bạn có thể uống bất cứ lúc nào trong ngày nhằm giải khát, cung cấp điện giải.\r\n\r\nPha 1-2 muỗng với 400-500ml nước lạnh và lắc cho tan hết. Có thể để lạnh trước khi thưởng thức sẽ ngon hơn.', 'Để mang lại hiệu quả tốt nhất, bạn nên sử dụng theo khuyến cáo từ hãng. Thời điểm tốt nhất bạn nên sử dụng đó là trong quá trình tập, hoặc bạn có thể uống bất cứ lúc nào trong ngày nhằm giải khát, cung cấp điện giải.\r\n\r\nPha 1-2 muỗng với 400-500ml nước lạnh và lắc cho tan hết. Có thể để lạnh trước khi thưởng thức sẽ ngon hơn.', 0, 0, '2020-06-01 16:46:12', 35, '30', '10 Cal', 4, '2020-06-01 17:06:09'),
