(44, 'Rule 1 Protein 5lbs', 'rule-1-protein-5lbs', 35000000, 2, 0, 5, '2020-06-04__hydro6.jpg', 14, 1, 1, 1, 'Rule 1 Protein không có chất béo, tinh bột, hoặc cholesterol - và không bột kem thêm hoặc gums được thêm vào giống các sản phẩm protein khác, duy trì khối lượng tế bào và hỗ trợ phục hồi cơ.', 'Rule 1 Protein không có chất béo, tinh bột, hoặc cholesterol - và không bột kem thêm hoặc gums được thêm vào giống các sản phẩm protein khác, duy trì khối lượng tế bào và hỗ trợ phục hồi cơ.', 0, 0, '2020-06-03 20:17:58', 42, '76', '100 Cal', 4, '2020-08-26 02:48:23');
