INSERT INTO `statics` (`id`, `s_title`, `s_slug`, `s_type`, `s_md5`, `s_content`, `created_at`, `updated_at`) VALUES
(1, 'hướng dẫn mua hàngg', NULL, 1, NULL, '<p><strong>C&aacute;ch 1: Đ&acirc;y l&agrave; c&aacute;ch th&ocirc;ng dụng nhất</strong></p>\r\n\r\n<p>Gọi điện cho ch&uacute;ng t&ocirc;i theo số&nbsp;<strong>H&agrave; Nội, Đ&agrave; Nẵng: 091.901.3030 hoặc 098.901.3030, TP.HCM số 093.993.3030 hoặc 097.997.3030</strong>&nbsp;để mua h&agrave;ng, đ&acirc;y l&agrave; c&aacute;ch nhanh nhất để qu&yacute; vị c&oacute; thể đặt h&agrave;ng với ch&uacute;ng t&ocirc;i.</p>\r\n\r\n<p>Giờ trực điện thoại từ: 8h30 tới 22h30 c&aacute;c ng&agrave;y trong tuần trừ c&aacute;c ng&agrave;y nghỉ tết.</p>\r\n\r\n<p><strong>C&aacute;ch 2: Đến trực tiếp c&aacute;c cửa h&agrave;ng gần nơi bạn nhất để mua h&agrave;ng, ch&uacute;ng t&ocirc;i đảm bảo h&agrave;ng h&oacute;a lu&ocirc;n đa dạng</strong></p>\r\n\r\n<p>Ch&uacute;ng t&ocirc;i l&agrave; chuỗi c&aacute;c cửa h&agrave;ng uy t&iacute;n v&agrave; l&acirc;u năm, nằm ở ngay mặt đường c&aacute;c con phố lớn, vỉa h&egrave; rất rộng để xe v&agrave; đỗ xe an to&agrave;n.</p>\r\n\r\n<p>Chuỗi c&aacute;c cửa h&agrave;ng gồm:</p>\r\n\r\n<p><strong>Cửa h&agrave;ng 1:&nbsp;Phố Vọng</strong><br />\r\nsố 92 phố Vọng, Đống Đa, H&agrave; Nội Giờ mở cửa: 8h30 tới 23h đ&ecirc;m Hotline: 091.901.3030</p>\r\n\r\n<p><strong>Cửa h&agrave;ng 2:&nbsp;Cầu Giấy</strong><br />\r\nsố 17 Xu&acirc;n Thủy, Cầu Giấy, H&agrave; Nội Giờ mở cửa: 8h30 tới 21h tối Hotline: 098.901.3030</p>\r\n\r\n<p><strong>Cửa h&agrave;ng 3:&nbsp;H&agrave; Đ&ocirc;ng</strong><br />\r\nsố 46 Chiến Thắng, H&agrave; Đ&ocirc;ng, H&agrave; Nội Giờ mở cửa: 8h30 tới 21h tối Hotline: 0969.45.8998</p>\r\n\r\n<p><strong>Cửa h&agrave;ng 4:&nbsp;Đ&agrave; Nẵng</strong><br />\r\nsố 120 Trưng Nữ Vương, Đ&agrave; Nẵng Giờ mở cửa: 8h30 tới 21h tối Hotline: 094.734.8386</p>\r\n\r\n<p><strong>Cửa h&agrave;ng 5: T&acirc;n B&igrave;nh</strong><br />\r\nsố 51 Trần Quốc Ho&agrave;n, P4, Q.T&acirc;n B&igrave;nh, TP.HCM Giờ mở cửa: 8h30 tới 21h tối Hotline: 093.993.3030</p>\r\n\r\n<p><strong>Cửa h&agrave;ng 6:&nbsp;Quận 10</strong><br />\r\nsố 480 Điện Bi&ecirc;n Phủ, P11, Q.10, TP.HCM Giờ mở cửa: 8h30 tới 21h tối Hotline: 097.997.3030</p>\r\n\r\n<p><strong>C&aacute;ch 3: Đặt h&agrave;ng online qua website</strong></p>\r\n\r\n<p>Qu&yacute; kh&aacute;ch truy cập website của ch&uacute;ng t&ocirc;i sau đ&oacute; chọn sản phẩm cần mua, trong trang chi tiết của sản phẩm, qu&yacute; vị t&igrave;m n&uacute;t&nbsp;<strong>Đặt mua sp n&agrave;y,</strong>&nbsp;sau đ&oacute; qu&yacute; kh&aacute;ch điền đầy đủ th&ocirc;ng tin gồm c&oacute; Họ t&ecirc;n, số điện thoại, địa chỉ, ch&uacute;ng t&ocirc;i chắc chắn sẽ gọi lại cho qu&yacute; kh&aacute;ch trong thời gian sớm nhất c&oacute; thể.</p>\r\n\r\n<p><strong>C&aacute;ch 4: Đặt h&agrave;ng qua Facebook</strong></p>\r\n\r\n<p>Qu&yacute; kh&aacute;ch đang d&ugrave;ng facebook.&nbsp;Like fanpage của ch&uacute;ng t&ocirc;i, sau đ&oacute; nhắn tin cho ch&uacute;ng t&ocirc;i để đặt h&agrave;ng, c&aacute;c bạn cũng c&oacute; thể hỏi đ&aacute;p c&aacute;c thắc mắc hoặc theo d&otilde;i c&aacute;c tin tức về thể h&igrave;nh mới nhất của ch&uacute;ng t&ocirc;i</p>\r\n\r\n<p><strong>Đ&oacute; l&agrave; 4 c&aacute;ch để c&aacute;c bạn c&oacute; thể đặt mua sản phẩm của ch&uacute;ng t&ocirc;i. Xin c&aacute;m ơn c&aacute;c bạn</strong></p>', '2020-08-22 08:02:55', '2020-08-22 08:02:55'),
(3, 'chính sách đổi trảa', NULL, 2, NULL, '<p>Lu&ocirc;n lu&ocirc;n v&igrave; kh&aacute;ch h&agrave;ng, ch&uacute;ng t&ocirc;i chấp nhận tạo điều kiện cho kh&aacute;ch đổi v&agrave; trả h&agrave;ng trong trường hợp kh&aacute;ch mua h&agrave;ng chưa b&oacute;c tem, h&agrave;ng h&oacute;a c&ograve;n nguy&ecirc;n vẹn ko bị xước x&aacute;t hoặc m&eacute;o m&oacute;p. Thời gian đổi trả l&agrave; 30 ng&agrave;y kể từ ng&agrave;y mua, qu&aacute; 30 ng&agrave;y ch&uacute;ng t&ocirc;i sẽ kh&ocirc;ng chấp nhận đổi trả. Khi đổi hoặc trả kh&aacute;ch h&agrave;ng phải cung cấp h&oacute;a đơn b&aacute;n h&agrave;ng của ch&uacute;ng t&ocirc;i đi k&egrave;m, trường hợp kh&aacute;ch kh&ocirc;ng lấy h&oacute;a đơn khi mua h&agrave;ng th&igrave; sẽ kh&ocirc;ng được đổi hoặc trả.</p>\r\n\r\n<p>Nếu kh&aacute;ch h&agrave;ng đang sử dụng sản phẩm của ch&uacute;ng t&ocirc;i v&agrave; cảm thấy kh&ocirc;ng hợp vị hoặc muốn thanh l&yacute; v&igrave; l&yacute; do n&agrave;o đ&oacute;, ch&uacute;ng t&ocirc;i sẽ thanh l&yacute; hộ kh&aacute;ch h&agrave;ng qua fanpage của ch&uacute;ng t&ocirc;i (lưu &yacute; h&agrave;ng h&oacute;a phải đ&uacute;ng của WheyStore cung cấp, c&oacute; h&oacute;a đơn v&agrave; tem đảm bảo của ch&uacute;ng t&ocirc;i).</p>\r\n\r\n<h2><strong>Trường hợp kh&ocirc;ng được đổi trả h&agrave;ng</strong></h2>\r\n\r\n<p>1 - Kh&aacute;ch h&agrave;ng mua sản phẩm của b&ecirc;n kh&aacute;c.</p>\r\n\r\n<p>2 - Kh&aacute;ch h&agrave;ng đ&atilde; b&oacute;c tem hoặc c&agrave;o (kể cả chưa nhắn tin kiểm tra).</p>\r\n\r\n<p>3 - Kh&ocirc;ng được ph&eacute;p đổi sang những sản phẩm c&oacute; gi&aacute; trị nhỏ hơn sản phẩm đ&atilde; mua. Chỉ được đổi hặc trả sang những sản phẩm c&oacute; gi&aacute; trị tương đương hoặc lớn hơn</p>\r\n\r\n<p>4 - Kh&aacute;ch đi tỉnh vẫn được đổi trả b&igrave;nh thường, kh&aacute;ch chịu ph&iacute; vận chuyển khi chuyển về cửa h&agrave;ng.</p>\r\n\r\n<p>Mọi thắc mắc qu&yacute; kh&aacute;ch h&atilde;y gọi số,&nbsp;<strong>H&agrave; Nội, Đ&agrave; Nẵng</strong>: 091.901.3030 hoặc 098.901.3030 ,&nbsp;<strong>TP.HCM</strong>: 097.997.3030 hoặc 093.993.3030</p>', '2020-08-22 08:03:10', '2020-08-22 08:03:10'),
